    SET vPuntosRecuperados = 0;
	SET vTotalPuntos=0;
	SET vNumSanciones=0;
    SET vNumSanciones2=0;
    SET vNumSanciones3=0;
	
    WHILE vFecha <= vFechaFinal  DO
        
        	
		
        SELECT COUNT(*) INTO vNumSanciones2 
