        IF vNumSanciones2 > 0 THEN
		   SET vTotalPuntos = vPuntosIniciales;
        END IF;

			
		
        SELECT COUNT(*) INTO vNumSanciones3
		                FROM sanciones
						WHERE idAlumno = vId AND 
						date(fechaFinal) = vFecha AND
						idTipo = 3 AND
						idEstado = 5;
        IF vNumSanciones3 > 0 THEN
		   SET vPuntosIniciales = vPuntosIniciales + 2;
		   SET vTotalPuntos = vPuntosIniciales;
        END IF;
		
		
		SELECT IFNULL(SUM(puntos),0) INTO vPuntos FROM partes where idAlumno = vId and date(fecha) = vFecha;
        IF vPuntos > 0 THEN
           SET vTotalPuntos = vTotalPuntos + vPuntos;
		   IF vTotalPuntos > 10 THEN
		       SET vTotalPuntos = 10;
		   END IF;
        END IF;
        
        		
        IF vTotalPuntos > vPuntosIniciales THEN
            SELECT IFNULL(SUM(recupera),0) INTO vPuntosRecuperados FROM partes where idAlumno = vId and date(fecha) = vFecha;
            IF vPuntosRecuperados > 0 THEN
               SET vTotalPuntos = vTotalPuntos - vPuntosRecuperados;
			   IF vTotalPuntos < vPuntosIniciales THEN
			       SET vTotalPuntos = vPuntosIniciales;
			   END IF;
