			       SET vTotalPuntos = vPuntosIniciales;
			   END IF;
			END IF ;  
        END IF;
        
		
		IF vTotalPuntos > vPuntosIniciales THEN
           IF WEEKDAY(date(vFecha))= 6 THEN
              SELECT IFNULL(count(*),0) INTO vNumPartes FROM partes WHERE idAlumno = vId AND
