CREATE DEFINER=`root`@`localhost` PROCEDURE `estPartesAlumnado` (IN `fechaInicial` VARCHAR(10), IN `fechaFinal` VARCHAR(10))  BEGIN
  select max(grupo) as 'Grupo', concat(max(apellido1),' ',max(apellido2),' ',max(nombre)) as 'Nombre', count(*) as 'Partes'
 from alumno, partes, cursos
 where alumno.id = partes.idalumno and alumno.idcurso = cursos.id and
       (partes.fecha >= str_to_date(fechaInicial, '%d/%m/%Y') and 
       partes.fecha <= str_to_date(fechaFinal, '%d/%m/%Y'))
 group by alumno.id
 order by 1,3;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `estPartesGrupos` (IN `fechaInicial` VARCHAR(10), IN `fechaFinal` VARCHAR(10))  BEGIN
  select max(grupo) as 'Grupo', count(*) as 'Partes'
 from alumno, partes, cursos
 where alumno.id = partes.idalumno and alumno.idcurso = cursos.id and
       (partes.fecha >= str_to_date(fechaInicial, '%d/%m/%Y') and 
       partes.fecha <= str_to_date(fechaFinal, '%d/%m/%Y'))
 group by Grupo
 order by 1;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `estPartesProfesorado` (IN `fechaInicial` VARCHAR(10), IN `fechaFinal` VARCHAR(10))  BEGIN
  select concat(max(nombre),' ',max(apellido1),' ',max(apellido2)) as 'Nombre', count(*) as 'Partes'
 from profesores, partes
 where profesores.id = partes.idprofesor and
       (partes.fecha >= str_to_date(fechaInicial, '%d/%m/%Y') and 
       partes.fecha <= str_to_date(fechaFinal, '%d/%m/%Y'))
 group by profesores.id
