CREATE DEFINER=`root`@`localhost` PROCEDURE `estSancionesAlumnadoGrupo` (IN `fechaInicial` VARCHAR(10), IN `fechaFinal` VARCHAR(10))  BEGIN
  select max(grupo) as 'Grupo', concat(max(apellido1),' ',max(apellido2),' ',max(nombre)) as 'Nombre', max(tipo) ,count(*) as 'Sanciones'
 from alumno, sanciones, cursos, tipo_sancion
 where alumno.id = sanciones.idalumno and alumno.idcurso = cursos.id and sanciones.idTipo = tipo_sancion.id and
       (sanciones.fecha >= str_to_date(fechaInicial, '%d/%m/%Y') and 
       sanciones.fecha <= str_to_date(fechaFinal, '%d/%m/%Y'))
 group by alumno.id, sanciones.idTipo
 order by 1,3;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `finalizaSancion` ()  NO SQL
BEGIN


	 
UPDATE alumno set puntos = puntosIniciales where id IN (SELECT idAlumno FROM sanciones WHERE TIMESTAMPDIFF(day,date(CURRENT_TIMESTAMP()),date(fechaFinal)) < 0 AND                  idTipo = 2 AND idEstado <> 5);


UPDATE alumno set puntosIniciales = puntosIniciales + 2, puntos = puntosIniciales where id IN (SELECT idAlumno FROM sanciones WHERE TIMESTAMPDIFF(day,date(CURRENT_TIMESTAMP()),date(fechaFinal)) < 0 AND idTipo=3 and idEstado<>5);
	

UPDATE sanciones set idEstado = 5 where TIMESTAMPDIFF(day, date(CURRENT_TIMESTAMP()),date(fechaFinal)) < 0 and idTipo <> 5 and idEstado <> 5;


UPDATE sanciones set idEstado = 5 where TIMESTAMPDIFF(minute, CURRENT_TIMESTAMP(),fechaFinal) < 0 and idTipo = 5 and idEstado <> 5;

END$$

