DELIMITER $$
CREATE TRIGGER `cambiarEstado` BEFORE UPDATE ON `partes` FOR EACH ROW BEGIN
 IF  (NEW.fechaConfirmacion IS NOT NULL OR OLD.fechaConfirmacion IS NOT NULL) THEN
      SET NEW.idEstado = 3;
   END IF;
   
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `devuelvePuntos` AFTER DELETE ON `partes` FOR EACH ROW BEGIN
	UPDATE alumno a SET a.puntos = a.puntos - old.puntos WHERE a.id = old.idAlumno;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `disp_AfterInsertPartes` AFTER INSERT ON `partes` FOR EACH ROW BEGIN
call actDisciplina(NEW.id, DATE(NEW.fecha),  NEW.idAlumno, NEW.idProfesor,NEW.descripcion,'Leve');
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `disp_AfterUpdatePartes` AFTER UPDATE ON `partes` FOR EACH ROW BEGIN
    
    IF (NEW.fechaConfirmacion IS NOT NULL) THEN
        UPDATE disciplina SET revisado = 'Si' WHERE numero = NEW.id;
    END IF;

    
    IF(old.recupera = 0 AND new.recupera = 1) THEN
        UPDATE alumno SET puntos = puntos -1 WHERE alumno.id=new.idAlumno;
    END IF;

    IF(old.idAlumno != new.idAlumno) THEN
        UPDATE alumno SET puntos = puntos - old.puntos WHERE alumno.id = old.idAlumno;
        UPDATE alumno SET puntos = puntos + new.puntos WHERE alumno.id = new.idAlumno;
    ELSE
    	UPDATE alumno a SET a.puntos = a.puntos + (new.puntos - old.puntos) WHERE a.id = new.idAlumno;
    END IF;
    
END
$$
DELIMITER ;

