DELIMITER $$
CREATE TRIGGER `sumaPuntos` BEFORE INSERT ON `partes_conductas` FOR EACH ROW BEGIN
	DECLARE puntosUpdate INT;
    DECLARE puntosUpdatePartes INT;
	SET puntosUpdate = (SELECT ABS(c.puntos) FROM conductas c WHERE c.id = NEW.conductas_id);
    SET puntosUpdatePartes = (SELECT p.puntos FROM partes p WHERE p.id = NEW.partes_id);
    IF(puntosUpdate>puntosUpdatePartes)THEN
    UPDATE partes pa SET pa.puntos = puntosUpdate WHERE pa.id = NEW.partes_id;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `trg_actMotivosDisciplina` AFTER INSERT ON `partes_conductas` FOR EACH ROW BEGIN
DECLARE vmotivo VARCHAR(255);
DECLARE vpuntos INT;


SELECT conducta, puntos INTO vmotivo, vpuntos FROM conductas WHERE id = NEW.conductas_id;
UPDATE disciplina SET motivos = SUBSTRING(CONCAT(motivos,vmotivo,'\r\n'),1,400) WHERE numero = NEW.partes_id;
IF vpuntos = -10 THEN
   UPDATE disciplina SET tipo = 'Grave' WHERE numero = NEW.partes_id;
END IF;

END
$$
DELIMITER ;

