CREATE DEFINER=`root`@`localhost` EVENT `ev_actGlobalPuntos` ON SCHEDULE EVERY 1 WEEK STARTS '2019-09-24 08:15:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
   CALL actGlobalPuntos;
