CREATE DEFINER=`root`@`localhost` EVENT `activaSanciones` ON SCHEDULE EVERY 1 DAY STARTS '2017-10-01 14:00:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
   UPDATE sanciones set estados_sancion = 4 
   WHERE estados_sancion <> 4 AND
         now() BETWEEN fechaIncio AND fechaFinal;
        
END$$

CREATE DEFINER=`root`@`localhost` EVENT `ev_finalizaSancion` ON SCHEDULE EVERY 1 HOUR STARTS '2017-06-11 05:00:00' ON COMPLETION PRESERVE ENABLE DO BEGIN
CALL finalizaSancion();


END$$

CREATE DEFINER=`root`@`localhost` EVENT `caducaParte` ON SCHEDULE EVERY 1 DAY STARTS '2017-05-25 05:00:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
UPDATE partes SET idEstado = 4 WHERE (SELECT DATEDIFF(NOW(), fecha) AS days) >=(SELECT dias_validez FROM config);
END$$

CREATE DEFINER=`root`@`localhost` EVENT `publicacion_caducada` ON SCHEDULE EVERY 1 DAY STARTS '2020-06-09 08:00:00' ON COMPLETION NOT PRESERVE ENABLE DO delete from publicaciones where fecha_final<NOW()$$

CREATE DEFINER=`root`@`localhost` EVENT `evento_publicacion_automatica` ON SCHEDULE EVERY 5 SECOND STARTS '2020-06-15 08:00:00' ON COMPLETION NOT PRESERVE ENABLE DO begin
DECLARE v_idEvento INT default (select id from eventos where now()>fecha_inicio and now()<=fecha_final order by fecha_inicio desc, created_at desc LIMIT 1);
DECLARE v_idNoticia INT default (select idNoticia from noticias_eventos where idEvento = v_idEvento LIMIT 1);
if (select count((select id from eventos where now()>fecha_inicio and now()<=fecha_final order by fecha_inicio desc LIMIT 1)))>0 then
if v_idNoticia not in (select id_noticia from publicaciones where tipo_publicacion=2) then
SET @disable_triggers = 1;
    UPDATE noticiasV2 set numero_publicaciones=((select numero_publicaciones from noticiasV2 where id=v_idNoticia)+1), fecha_ultima_publicacion=now() where id=v_idNoticia;
UPDATE noticiasV2 set fecha_primera_publicacion=now() where id=v_idNoticia and numero_publicaciones=1;
    SET @disable_triggers = NULL;
    end if;
end if;
end$$

