INSERT INTO `conductas` (`id`, `conducta`, `puntos`, `tipo`) VALUES
(1, 'Estar fuera del aula entre horas sin permiso.', -1, 'Leve'),
(2, 'Perturbar el normal desarrollo de las actividades de clase o del centro.', -2, 'Leve'),
(3, 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.', -2, 'Leve'),
(4, 'Ignorar las llamadas de atención del personal docente y no docente.', -2, 'Leve'),
(5, 'Cinco faltas injustificadas de puntualidad.', -2, 'Leve'),
(6, 'Cinco faltas injustificadas de asistencia a clase.', -2, 'Leve'),
(7, 'No disponer del material necesario para su aprendizaje.', -2, 'Leve'),
(8, 'Tirar objetos, papeles o basura al suelo en cualquier dependencia del centro.', -2, 'Leve'),
(9, 'Comer o beber en clase.', -2, 'Leve'),
(10, 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.', -3, 'Leve'),
(11, 'Falta injustificada de asistencia a las horas previas a una prueba de evaluación.', -3, 'Leve'),
(12, 'No guardar las debidas normas de seguridad establecidas para el uso de material o el funcionamiento de determinados aparatos eléctricos.', -3, 'Leve'),
(13, 'Causar pequeños daños en las instalaciones, materiales o documentos del centro (incluidos los partes de asistencia o de incidencia), o en las pertenencias de otros miembros de la comunidad educativa.', -4, 'Leve'),
(14, 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.', -4, 'Leve'),
(15, 'Abandonar el centro de manera injustificada durante la jornada escolar.', -5, 'Leve'),
(16, 'Utilizar los ordenadores del aula sin permiso o de manera indebida.', -6, 'Leve'),
(17, 'Fumar en las dependencias y recinto del centro.', -7, 'Leve'),
(18, 'Otras (contempladas en el P.C.).', -1, 'Leve'),
(19, 'Agresión física a un miembro de la comunidad educativa.', -10, 'Grave'),
(20, 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.', -10, 'Grave'),
(21, 'Suplantación de la personalidad, falsificación o sustracción de documentos académicos.', -10, 'Grave'),
(22, 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.', -10, 'Grave'),
(23, 'Actuaciones perjudiciales para la salud y la integridad personal de los miembros de la comunidad educativa, o la incitación a las mismas. Consumo de alcohol o drogas.', -10, 'Grave'),
(24, 'Perjudicar gravemente el desarrollo de las actividades del centro.', -10, 'Grave'),
(25, 'Conductas leves en las que concurran las circunstancias de colectividad y/o publicidad intencionada.', -10, 'Grave'),
(26, 'Incumplimiento de las correcciones impuestas.', -10, 'Grave'),
(27, 'Reiteración de conductas contrarias a las normas de convivencia.', -10, 'Grave'),
(28, 'Utilizar el móvil para fotografiar o grabar a cualquier miembro de la comunidad educativa.', -10, 'Grave'),
(29, 'Exhibir el móvil en el centro escolar.', -2, 'Leve'),
(30, 'No traer el parte firmado en el plazo de una semana.', -2, 'Leve'),
(31, 'No entregar el móvil al profesor cuando es requerido por éste por su uso incorrecto.', -10, 'Grave'),
(32, 'Otros. Falta grave', -10, 'Grave');
