INSERT INTO `disciplina` (`id_disc`, `NIE`, `fecha`, `hora`, `profesor`, `motivos`, `descripcion`, `tipo`, `revisado`, `expulsion`, `id_medidas`, `numero`) VALUES
(0, '4075071', '2020-04-03', '', 'Godoy Triviño Miguel', 'No disponer del material necesario para su aprendizaje.\r\n', 'Descripción', 'Leve', 'No', 'Si', 0, 1057),
(1, '3914184', '2019-09-19', '2', 'Blanco Domínguez, Guillermo', 'Reiteración de conductas contrarias a las normas de convivencia.\r\nPerjudicar gravemente el desarrollo de las actividades del centro\r\nIncumplimiento de las correcciones impuestas.\r\n', ' El alumno está comiendo chicle en clase. Luego se tira al suelo e introduce la cabeza en el habitáculo de la mesa donde estaba el ordenador. No deja de hablar e interrumpir al profesor.', 'Grave', 'No', 'No', 0, 0),
(2, '6668755', '2019-09-18', '5', 'Parejo Navarro, Francisco Javier', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Después de expulsarlo al aula de convivencia, el alumno me llama \"chupapollas\" y \"asqueroso\" delante de toda la clase.', 'Grave', 'No', 'No', 0, 0),
(3, '6668755', '2019-09-18', '4', 'Parejo Navarro, Francisco Javier', 'Estar fuera del aula entre horas sin permiso.\nPerturbar el normal desarrollo de las actividades de clase o del centro.\nComer o beber en clase.\nOtras (contempladas en el P.C.)...\n', 'El alumno llega tarde a clase y llega comiendo. Cuando le indico que deje de comer no lo hace y le da una colleja a un compañero. Después le digo que espere fuera de clase y no lo hace.', 'Leve', 'No', 'No', 0, 0),
(4, '2988184', '2019-09-17', '5', 'Ruiz Gómez, Clara Eugenia', 'Estar fuera del aula entre horas sin permiso.\n', 'Llega a clase tarde y dice que ha estado hablando con la orientadora. Mando a una alumna a que pregunten a la orientadora y allí no saben nada de la entrevista.', 'Leve', 'No', 'No', 0, 0),
(5, '3828387', '2019-09-24', 'Recreo', 'Alcázar González, Jorge', 'Agresión física a un miembro de la comunidad educativa.\n', 'Durante el recreo, hace la zancadilla en las escaleras intencionadamente a un compañero, estando a punto éste de caerse. No sólo no e disculpa sino que además cuando el compañero le pide explicaciones, Adrián responde: \"lo he hecho porque me da la gana\".', 'Grave', 'No', 'No', 0, 0),
(6, '3914184', '2019-09-25', '3', 'León Romera, Juan José', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\nReiteración de conductas contrarias a las normas de convivencia.\n', 'Interrumpe continuamente, se enfrenta al profesor y hace caso omiso a las indicaciones. Después de advertirle en numerosas ocasiones acaba por insultarme, primero dice \"el payaso éste...\" y luego me llama fantasma. ', 'Grave', 'No', 'No', 0, 0),
(7, '3516999', '2019-09-24', '3', 'Ramírez Oña, Verónica', 'Comer o beber en clase.\n', 'Se le advierte al alumno que no coma en clase, diez minutos después se levanta sin pedir permiso, se acerca a la papelera terminando de comerse lo que le quedaba y tira a la papelera el plástico.', 'Leve', 'No', 'No', 0, 0),
(8, '2972753', '2019-09-24', '3', 'Ruiz Gómez, Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No deja de molestar en clase y no trabaja.', 'Leve', 'No', 'No', 0, 0),
(9, '3835978', '2019-09-25', '3', 'Castro Luque, Agustín', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Lo he cambiado de sitio pero no deja de hablar, molestar, hacer comentarios improcedentes, etc.', 'Leve', 'No', 'No', 0, 0),
(10, '3807596', '2019-09-20', '3', 'Camino Conde, María', 'Estar fuera del aula entre horas sin permiso.\nPerturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Durante el cambio de clase en los desdobles, se mete en mi clase estando yo dentro. Le aviso de que no lo vuelva a hacer y entra de nuevo.', 'Leve', 'No', 'No', 0, 0),
(11, '3067897', '2019-09-30', '5', 'Sánchez Luque, Rafael', 'Suplantación de la personalidad o falsificación o sustracción de documentos académicos.\r\n', ' El alumno se cuela en el aula de 1º de ESO C y se hace pasar por alumno de dicha clase. ', 'Grave', 'No', 'No', 0, 0),
(12, '3914184', '2019-09-30', '3', 'Jefatura de Estudios', 'Perjudicar gravemente el desarrollo de las actividades del centro\nActuaciones perjudiciales para la salud y la integridad personal de los miembros de la comunidad educativa, o la incitación a las mismas. consumo de alcohol, tabaco o drogas.\n', 'Se tira por la ventana desde la primera planta hasta el patio.', 'Grave', 'No', 'No', 0, 0),
(13, '3914184', '2019-09-26', '3', 'Abad Ruiz, Federico', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Ha hecho un comentario grosero en clase.', 'Leve', 'No', 'No', 0, 0),
(14, '3835978', '2019-09-27', '3', 'Muñoz Muñoz, Rosario', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No trae material. Se negaba a cambiarse de sitio. Continuamente interrumpe y llama la atención.', 'Leve', 'No', 'No', 0, 0),
(15, '3828860', '2019-10-01', '5', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No para de molestar en clase a pesar de mis llamadas de atención. Bromea y se ríe cuando le expulso.', 'Leve', 'No', 'No', 0, 0),
(16, '3871838', '2019-10-01', '5', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se ríe y bromea cuando decido expulsar a un compañero. Lo sigue haciendo a pesar de que lo advierto varias veces.', 'Leve', 'No', 'No', 0, 0),
(17, '3363996', '2019-09-26', '3', 'Ventura Fernández, Lourdes', 'Agresión física a un miembro de la comunidad educativa.\n', 'Al término de la jornada escolar en la puerta del Centro, la alumna está implicada en una violenta pelea con Raquel Santos, agresiones físicas y verbales. Les separo, acompaño a la otra alumna al centro y María se marcha a su casa.', 'Grave', 'No', 'No', 0, 0),
(18, '3562460', '2019-09-27', '3', 'Parejo Navarro, Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'La alumna está en clase charlando y molestando. Le advierto de que si continua le pondré un parte y sigue haciéndolo. Así que se le impone la sanción.', 'Leve', 'No', 'No', 0, 0),
(19, '3562460', '2019-10-01', '3', 'Luengo López, Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No trabaja e interrumpe constantemente, pese a haber sido cambiada de sitio. Se ríe al ser regañada.', 'Leve', 'No', 'No', 0, 0),
(20, '3067897', '2019-09-30', '3', 'Sánchez Luque, Rafael', 'Suplantación de la personalidad o falsificación o sustracción de documentos académicos.\n', 'El alumno se cuela en el aula de 1º ESO C y se hace pasar por alumno de esta clase.', 'Grave', 'No', 'No', 0, 0),
(21, '3067897', '2019-10-01', '4', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Le he dicho en repetidas ocasiones que tire a la papelera un avión, se ha negado, y lo vuelve a sacar en repetidas ocasiones.', 'Leve', 'No', 'No', 0, 0),
(22, '3277909', '2019-10-01', '3', 'Barroso Fernández, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\nNo disponer del material necesario para el aprendizaje.\n', 'No trae material, no trabaja después de dar material, y cuando hay una prueba oral y mando silencio \"se ríe\". No piensa comprar materiales ni hacer \"nada\".', 'Leve', 'No', 'No', 0, 0),
(23, '3371476', '2019-09-26', '3', 'Ventura Fernández, Lourdes', 'Agresión física a un miembro de la comunidad educativa.\n', 'Al término de la jornada escolar, en la puerta del centro la alumna está implicada en una violenta pelea con María Cañadillas, agresiones físicas y verbales. Los separo y acompaño a Raquel al centro.', 'Grave', 'No', 'No', 0, 0),
(24, '3371476', '2019-10-01', '3', 'Luengo López, Juan Carlos', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Tengo que llamarle la atención en repetidas ocasiones por hablar con Brenda. Al ponerle parte a su compañera, elijo a otro alumno para que la acompañe a jefatura. Se levanta de su sitio de forma desafiante aludiendo que debe ser ella quien vaya. Ni con la amenaza del parte se sienta.', 'Leve', 'No', 'No', 0, 0),
(25, '3363359', '2019-10-01', '3', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se levanta, se coloca en mitad de la clase y lanza a la papelera un papel, intentando encestar.', 'Leve', 'No', 'No', 0, 0),
(26, '3033134', '2019-09-30', '3', 'Belmonte Pérez, Antonio José', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'El alumno pide ir a beber agua. Le contesto que no, y responde \"joder\".', 'Leve', 'No', 'No', 0, 0),
(27, '3275377', '2019-10-02', '4', 'Ruiz Gómez, Clara Eugenia', 'Estar fuera del aula entre horas sin permiso.\n', 'Llego a clase y la empiezo y Villodres llega tarde. Dice que quiere que lo cambien de clase.', 'Leve', 'No', 'No', 0, 0),
(28, '3871838', '2019-10-03', '3', 'Muñoz Muñoz, María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Habla de manera irrespetuosa a sus compañeros, gritándoles. No deja de molestar y reírse. Al recriminarle dice \"cuando lo vea salir del instituto lo mato\", refiriéndose a un compañero.', 'Leve', 'No', 'No', 0, 0),
(29, '3914184', '2019-10-01', '4', 'Cabrero Doncel, Carmen', 'Utilizar aparatos grabadores o reproductores, cámaras de fotos y teléfonos móviles.\n', 'Yerai estaba usando el móvil en clase.', 'Leve', 'No', 'No', 0, 0),
(30, '4200865', '2019-10-01', '4', 'Cabrero Doncel, Carmen', 'Utilizar aparatos grabadores o reproductores, cámaras de fotos y teléfonos móviles.\n', 'José miguel estaba usando el móvil en clase.', 'Leve', 'No', 'No', 0, 0),
(31, '3907317', '2019-10-02', '4', 'Muñoz Muñoz, María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se dedica a tirar gomitas al compañero, desde la otra punta de la clase. No trabaja y se pasa parte de la clase riéndose.', 'Leve', 'No', 'No', 0, 0),
(32, '3871838', '2019-10-04', '6', 'Muñoz Muñoz, María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Molesta durante la clase. Se levanta. Se tumba encima de la mesa. Le dice al compañero algunos comentarios desde la otra punta de la clase.', 'Leve', 'No', 'No', 0, 0),
(33, '3903064', '2019-09-20', '4', 'Polonio Pino, Cristóbal', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\nPerjudicar gravemente el desarrollo de las actividades del centro\n', 'Cuando entro en clase (A-103/1º C) me encuentro a este alumno en su interior. Le informo que no puede salir entre horas ni estar en una clase que no sea la suya bajo posibilidad de parte, a lo que me responde que le da igual y que mientras antes, mejor. A continuación me imita con movimientos detrás de mí y ante el aviso de una nueva sanción, me indica: \",vale, mejor\".', 'Grave', 'No', 'No', 0, 0),
(34, '3903064', '2019-09-20', '4', 'Camino Conde, María', 'Estar fuera del aula entre horas sin permiso.\nPerturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Se mete en mi clase siendo de otro grupo, tira la chaqueta a un compañero y cuando le llamo la atención, me contesta de forma chulesca y diciendo que le dan igual los partes. al salir de la clase, se demora intencionadamente.', 'Leve', 'No', 'No', 0, 0),
(35, '3278125', '2019-10-01', '4', 'Parejo Navarro, Francisco Javier', 'Agresión física a un miembro de la comunidad educativa.\n', 'Estando en clase, escucho un golpe que suena como una colleja. La clase se sorprende de cómo ha sonado. Ha sido en un grupo de cuatro alumnos. Les pido que salga el que ha sido, de lo contrario le pondré un parte a los cuatro.', 'Grave', 'No', 'No', 0, 0),
(36, '3565077', '2019-10-02', '4', 'Sánchez Aguera, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se levanta constantemente de su sitio sin permiso.', 'Leve', 'No', 'No', 0, 0),
(37, '3516999', '2019-10-02', '4', 'Sánchez Aguera, María Carmen', 'Comer o beber en clase.\n', 'Estaba en clase comiendo chicle.', 'Leve', 'No', 'No', 0, 0),
(38, '3529727', '2019-10-07', '4', 'Román Vázquez, Álvaro Jesús', 'Ignorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Cuando le digo que saque material para trabajar no hace caso y no para de contestar con comentarios \"graciosos\". Le aviso que le pongo un parte y contesta que le da igual. Sigue con la misma actitud.', 'Leve', 'No', 'No', 0, 0),
(39, '3543365', '2019-10-02', '4', 'Sánchez Aguera, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se levanta constantemente sin permiso.', 'Leve', 'No', 'No', 0, 0),
(40, '3067897', '2019-10-02', '3', 'Román Vázquez, Álvaro Jesús', 'Estar fuera del aula entre horas sin permiso.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nOtras (contempladas en el P.C.)...\n', 'Se encuentra a la hora de clase en otro aula. Permanece en el otro aula (tecnología) hasta que el profesor se da cuenta y lo acompaña a su clase. Ya lo ha hecho en otras ocasiones.', 'Leve', 'No', 'No', 0, 0),
(41, '6668755', '2019-10-07', '4', 'Román Vázquez, Álvaro Jesús', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Entra en clase tarde. Le digo que tire el chicle y al rato tiene otro en la boca. Cuando le aviso que le voy a poner un parte contesta mal. Le digo que hable con respeto y dice que habla \"como le sale la polla\". Continúa con comentarios mientras escribo el parte.', 'Grave', 'No', 'No', 0, 0),
(42, '3254483', '2019-10-07', '4', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'El alumno no trae firmadas dos notas a los padres a pesar de estar advertido de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(43, '3371476', '2019-10-03', '4', 'Luengo López, Juan Carlos', 'Estar fuera del aula entre horas sin permiso.\nPerturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Entre clases me la encuentro fuera del aula. Interrumpe la clase constantemente pidiendo ir al baño, hablando a voces y de forma poco correcta. Finalmente se va del aula sin permiso. Antes de salir dice: \"si me vas a poner un parte por no poder ir al baño, vaya mierda de parte\".', 'Leve', 'No', 'No', 0, 0),
(44, '3871838', '2019-10-08', '3', 'Muñoz Muñoz, María Jesús', 'Incumplimiento de las correcciones impuestas.\n', 'Le digo que le voy a poner un parte por darle una patada a una mesa y salir de clase dando un portazo. A los pocos días me dice que el Jefe de Estudios ha hablado con él y se lo ha quitado, siendo mentira.', 'Grave', 'No', 'No', 0, 0),
(45, '3517085', '2019-10-09', '3', 'Muñoz Muñoz, Rosario', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Suele llegar siempre tarde. Cuando le he dicho que cinco faltas de puntualidad son motivo de parte, me ha dicho que eso es \"mentira\".', 'Leve', 'No', 'No', 0, 0),
(46, '3913818', '2019-10-08', '3', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'La alumna no trae firmada una nota a sus padres a pesar de estar advertida de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(47, '3277909', '2019-10-08', '3', 'Barroso Fernández, María Carmen', 'No traer el parte firmado en el plazo de una semana.\nNo disponer del material necesario para el aprendizaje.\n', 'Pérdida del parte del día 1 de octubre de 2019. \"Sin materiales\", no trae nada.', 'Leve', 'No', 'No', 0, 0),
(48, '6668755', '2019-10-08', '6', 'Luengo López, Juan Carlos', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Amenaza a un compañero: \" como diga algo de mí, lo reviento\".', 'Grave', 'No', 'No', 0, 0),
(49, '3292673', '2019-10-08', '3', 'Abad Ruiz, Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Forma parte de un grupo que llama con voz de choteo al profesor. Se niega a decir quién ha sido.', 'Grave', 'No', 'No', 0, 0),
(50, '3255985', '2019-10-08', '3', 'Ruiz Gómez, Clara Eugenia', 'Estar fuera del aula entre horas sin permiso.\n', 'Le permito que vaya al servicio y finalmente se entretiene y tiene que buscarlo el profesor de guardia.', 'Leve', 'No', 'No', 0, 0),
(51, '3033134', '2019-10-08', '3', 'Abad Ruiz, Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Forma parte de un grupo que llama con voz de choteo al profesor. Se niega a decir quién ha sido.', 'Grave', 'No', 'No', 0, 0),
(52, '2961357', '2019-10-08', '3', 'Abad Ruiz, Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Forma parte de un grupo que llama con voz de choteo al profesor. Se niega a decir quién ha sido.', 'Grave', 'No', 'No', 0, 0),
(53, '3046334', '2019-10-04', 'Recreo', 'Alcázar González, Jorge', 'Perjudicar gravemente el desarrollo de las actividades del centro\n', 'Sale del Centro en el recreo sin permiso, suplantando la identidad de otra alumna, con el carnet que habilita este permiso.', 'Grave', 'Si', 'No', 0, 0),
(54, '3316292', '2019-10-07', '6', 'Moriana Catalán, Gertrudis', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\nPerjudicar gravemente el desarrollo de las actividades del centro\n', 'Iván, alumno de 4º ESO-A, abrió la puerta y entró en la clase de 4ª ESO-B sin permiso a las 14:40 horas del pasado viernes 4 de octubre. Con gestos, el dedo índice de la mano izquierda sobre la muñeca de la mano derecha, me indicó que la clase había terminado. Todo esto mientras yo impartía clase en 4º ESO-B. Salió del aula, salí tras él y le dije que le pondría un parte. Me dijo que no podía.', 'Grave', 'No', 'No', 0, 0),
(55, '3363359', '2019-10-02', '5', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Se levanta sin permiso, molesta, \"hace chistes\" y en general se toma la clase \"a pitorreo\". Persiste en las bromas con una botella de agua.', 'Leve', 'No', 'No', 0, 0),
(56, '3363359', '2019-10-08', '3', 'Abad Ruiz, Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Forma parte de un grupo que llama con voz de choteo al profesor. Se niega a decir quién ha sido.', 'Grave', 'No', 'No', 0, 0),
(57, '2948319', '2019-10-07', '3', 'Alcázar González, Jorge', 'Perjudicar gravemente el desarrollo de las actividades del centro\nOtros.\n', 'Sale del Centro en el recreo y no regresa hasta las 12:40 cuando las clases empezaban a las 11:45. Como primera medida le ha sido retirado el carnet que le autoriza a salir del Centro.', 'Grave', 'No', 'No', 0, 0),
(58, '3393689', '2019-10-04', '3', 'Ruiz Gómez, Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'En clase se quita el zapato y el calcetín y le enseña el pi a su compañero. Le digo que esi es tonto y me responde que la tonta soy yo.', 'Leve', 'No', 'No', 0, 0),
(59, '3085103', '2019-10-07', '3', 'Alcázar González, Jorge', 'Otros.\n', 'Sale del Centro en el recreo y no regresa hasta las 12:40 cuando las clases empezaban a las 11:45. Como primera medida le ha sido retirado el carnet que le autoriza a salir del Centro.', 'Grave', 'No', 'No', 0, 0),
(60, '2958723', '2019-10-07', '3', 'Alcázar González, Jorge', 'Otros.\n', 'Sale del Centro en el recreo y no regresa hasta las 12:40 cuando las clases empezaban a las 11:45. Como primera medida le ha sido retirado el carnet que le autoriza a salir del Centro.', 'Grave', 'No', 'No', 0, 0),
(61, '3278125', '2019-10-08', '6', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No para de hablar. \r\nSe le avisa varias veces y sigue. Le digo que copie del libro y no hace nada y sigue charlando.', 'Leve', 'No', 'No', 0, 0),
(62, '3239970', '2019-10-08', '6', 'Abad Ruiz, Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Forma parte de un grupo que llama con voz de choteo al profesor. Se niega a decir quién ha sido.', 'Grave', 'No', 'No', 0, 0),
(63, '2332764', '2019-10-08', '6', 'Serrano Ruiz, Mª Gracia', 'Otros.\n', 'Está haciendo ruiditos toda la clase. Intensifica ruidos con llaves, funda del móvil sobre la mesa. Le llamo la atención varias veces. Le pido que se vaya al pasillo a hacer ruidos, coge las llaves y el móvil, golpeando con ellos la mesa. Sale de clase dando patadas a las puertas. Me asomo al pasillo y ha desaparecido.', 'Grave', 'No', 'No', 0, 0),
(64, '3301341', '2019-10-10', '6', 'Muñoz Muñoz, María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se pasa la clase hablando. Hace ruido vaciando un típpex. Le llamo la atención y al darme la vuelta continúa haciendo ruido.', 'Leve', 'No', 'No', 0, 0),
(65, '3292673', '2019-10-10', '6', 'Muñoz Muñoz, María Jesús', 'Estar fuera del aula entre horas sin permiso.\n', 'Sale a beber agua en el cambio de clase, llegando tarde.', 'Leve', 'No', 'No', 0, 0),
(66, '2981593', '2019-10-10', '4', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Interrumpe la clase en repetidas ocasiones sin hacer caso de mis llamadas de atención.', 'Leve', 'No', 'No', 0, 0),
(67, '2716544', '2019-10-10', '6', 'Muñoz Muñoz, María Jesús', 'Estar fuera del aula entre horas sin permiso.\n', 'Sale a beber agua en el cambio de clase, llegando tarde.', 'Leve', 'No', 'No', 0, 0),
(68, '3016658', '2019-10-09', '5', 'Lozano Luján, Rafael', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'El profesor le llama la atención y el alumno se ríe en su cara.', 'Leve', 'No', 'No', 0, 0),
(69, '2988184', '2019-10-09', '5', 'Lozano Luján, Rafael', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Después de que el profesor llame la atención a gritos a todo el grupo, el alumno se ríe.', 'Leve', 'No', 'No', 0, 0),
(70, '4089903', '2019-10-10', '6', 'Polonio Pino, Cristóbal', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Estando explicando, de espaldas, en la pizarra, oigo un ruido similar a una \"guantazo-tortazo\". Cuando me vuelvo, observo que Felipe ha salido de su asiento, pasado bajo la mesa y golpeado \"de broma\" a un compañero (Diego) en la espalda.', 'Leve', 'No', 'No', 0, 0),
(71, '3521235', '2019-10-09', '3', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'La alumna no trae firmada una nota a sus padres a pesar de estar advertida de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(72, '3516999', '2019-10-09', '3', 'Sánchez Aguera, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se pone a jugar en clase con Cristian.', 'Leve', 'No', 'No', 0, 0),
(73, '3562460', '2019-10-09', '3', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'La alumna no trae firmadas dos notas a sus padres a pesar de ser advertida de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(74, '3562460', '2019-10-10', '3', 'Lara Ruiz, Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Brenda continuamente altera el normal desarrollo de la clase, protesta de mala manera porque le llamo la atención por distraerse con su compañera.', 'Leve', 'No', 'No', 0, 0),
(75, '6668755', '2019-10-09', '4', 'Luengo López, Juan Carlos', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Le dice al profesor: \"que te calles ya, vizco de mierda\". al salir del aula dice: \"aver si te operan del ojo un poco, no seas como Roberto que llora\".', 'Grave', 'No', 'No', 0, 0),
(76, '3371476', '2019-10-09', '3', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'La alumna no trae firmada una nota a sus padres a pesar de estar advertida de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(77, '3858111', '2019-10-09', '3', 'Camino Conde, María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Actitud chulesca durante varios días. A pesar de advertirle en varias ocasiones, sigue con la misma actitud.', 'Leve', 'No', 'No', 0, 0),
(78, '3515318', '2019-10-09', '3', 'Barroso Fernández, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'El alumno después de reiteradas amonestaciones orales está sin atender, hablando en voz alta un comentario fuera de lugar, no admisibles en el aula.', 'Leve', 'No', 'No', 0, 0),
(79, '3914184', '2019-10-14', '4', 'Polonio Pino, Cristóbal', 'Estar fuera del aula entre horas sin permiso.\n', 'El alumno se encuentra en el pasillo y jugando con la puerta del aula donde me toca dar clase.', 'Leve', 'No', 'No', 0, 0),
(80, '3914184', '2019-10-14', '4', 'Castro Luque, Agustín', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No deja de interrumpir con comentarios, gracietas, etc. Le he advertido varias veces y lo he cambiado de sitio.', 'Leve', 'No', 'No', 0, 0),
(81, '3828387', '2019-10-11', '4', 'Moriana Catalán, Gertrudis', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Se niega a sacar el libro y el cuaderno. Quiere salir al aula de convivencia. No quiere hacer las actividades. Mantiene esta actitud durante toda la clase (hora).', 'Leve', 'No', 'No', 0, 0),
(82, '3828387', '2019-10-14', '4', 'Polonio Pino, Cristóbal', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Tras indicarle en varias ocasiones que saque el material, no lo hace. Cuando finalmente lo hace, se niega a copiar nada de lo explicado en la pizarra mostrando una actitud claramente \"pasota\".', 'Leve', 'No', 'No', 0, 0),
(83, '3828387', '2019-10-14', '4', 'Blanco Domínguez, Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\nNo disponer del material necesario para el aprendizaje.\n', 'No hace nada de nada ningún día que ha venido a clase. No trae nunca material ni documentos firmados ni nada absolutamente. Nunca hace la tarea ni castigos que se le mandan.', 'Leve', 'No', 'No', 0, 0),
(84, '3828387', '2019-10-11', '4', 'Moriana Catalán, Gertrudis', 'Estar fuera del aula entre horas sin permiso.\nPerturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Llega diez minutos tarde a clase. Le digo que se ponga en primera fila para que atienda, al igual que el día anterior, se niega a hacerlo. Quiere salir al aula de convivencia. Dice que no le gusta donde lo sitúo. Permanece en clase.', 'Leve', 'No', 'No', 0, 0),
(85, '4137158', '2019-10-14', '4', 'Sierra Martín, Francisco Manuel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Le llama \"puta\" a una compañera de clase (Atenea).', 'Leve', 'No', 'No', 0, 0),
(86, '3914184', '2019-10-15', '3', 'Sánchez Luque, Rafael', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'El alumno está jugando a soplar una bolsa de plástico en clase. No saca material y se burla del profesor. Se le amonesta y continúa con su mala actitud. Me amenaza: \"tú a mí no me conoces\".', 'Grave', 'No', 'No', 0, 0),
(87, '3907317', '2019-10-15', '5', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No para de molestar en clase a pesar de mis numerosas llamadas de atención.', 'Leve', 'No', 'No', 0, 0),
(88, '4089713', '2019-10-15', '4', 'Ayllón Rodríguez, Dolores', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'No hace caso, se levanta varias veces y no trabaja.', 'Leve', 'No', 'No', 0, 0),
(89, '3828387', '2019-10-15', '6', 'García Castro, Rosa María', 'Otras (contempladas en el P.C.)...\n', 'Montarse en la barandilla de la escalera y subir una planta de pie sobre la barandilla.', 'Leve', 'No', 'No', 0, 0),
(90, '3825548', '2019-10-15', '3', 'Blanco Domínguez, Guillermo', 'Otras (contempladas en el P.C.)...\n', 'Cuando tiene que hacer una prueba corriendo, la hace andando y tomándose la cosa a cachondeo. Lleva todo el día charlando y sin hacer nada. Tiene una lesión y le digo que la tiene que justificar con un escrito (padres o médico) pero nunca le digo que corra. Él lo hace andando delante de todos sus compañeros.', 'Leve', 'No', 'No', 0, 0),
(91, '3517085', '2019-10-15', '3', 'Sánchez Luque, Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'El alumno no saca ningún material y no deja de reírse. Cuando se le amonesta sigue igual. Se burla del profesor, al decir el número de una página del libro, grita :\"¡bingo!\".', 'Leve', 'No', 'No', 0, 0),
(92, '3527474', '2019-10-14', '3', 'Ruiz Gómez, Clara Eugenia', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Le digo muchas veces, a lo largo de lo que llevamos de curso, que no hable con las compañeras cuando estoy explicando. Lo he cambiado de sitio varias veces.', 'Leve', 'No', 'No', 0, 0),
(93, '3860095', '2019-10-15', '3', 'Alcázar González, Jorge', 'Agresión física a un miembro de la comunidad educativa.\nCausar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\n', 'Durante el recreo lanza con violencia e intencionadamente el balón de volleyball, a la cara de otro compañero, ocasionándole un balonazo que además rompe las gafas del compañero.', 'Grave', 'No', 'No', 0, 0),
(94, '3278125', '2019-10-14', '3', 'Ramírez Oña, Verónica', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'El alumno no tiene material, no hace nada y perturba el desarrollo normal de la clase.', 'Leve', 'No', 'No', 0, 0),
(95, '3565077', '2019-10-02', '3', 'Sánchez Aguera, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se levanta constantemente de su sitio, sin permiso.', 'Leve', 'No', 'No', 0, 0),
(96, '3516999', '2019-10-02', '3', 'Sánchez Aguera, María Carmen', 'Comer o beber en clase.\n', 'Estaba en clase comiendo chicle.', 'Leve', 'No', 'No', 0, 0),
(97, '3516999', '2019-10-09', '3', 'Sánchez Aguera, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se pone a jugar en clase con Cristian.', 'Leve', 'No', 'No', 0, 0),
(98, '3529727', '2019-10-11', '3', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'El alumno no trae firmada una nota a sus padres a pesar de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(99, '3529727', '2019-10-09', '3', 'Sánchez Aguera, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se levanta de sitio y se pone a jugar con Marcos.', 'Leve', 'No', 'No', 0, 0),
(100, '3543365', '2019-10-02', '3', 'Sánchez Aguera, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se levanta constantemente sin permiso.', 'Leve', 'No', 'No', 0, 0),
(101, '3562460', '2019-10-15', '3', 'Lara Ruiz, Ana', 'Otras (contempladas en el P.C.)...\n', 'No traer la agenda firmada. Le mandé una nota el 3 de octubre.', 'Leve', 'No', 'No', 0, 0),
(102, '3277909', '2019-10-16', '1', 'Polonio Pino, Cristóbal', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Cunado estoy dando clase interrumpe la clase con clara intención de perjudicar. Estoy numerando los alumnos con 1º pendiente y dice \"bingo\". He intentado hablar con él en varias ocasiones pero no sirve,', 'Leve', 'No', 'No', 0, 0),
(103, '3254483', '2019-10-11', '4', 'Muñoz Muñoz, María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Lo veo infando una bolsa con la intención de explotarla. lo miro y le digo que no lo haga, y se levanta y lo hace.', 'Leve', 'No', 'No', 0, 0),
(104, '3371476', '2019-10-15', '3', 'Luengo López, Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Durante la realización de un examen interrumpe constantemente diciendo que \"se está meando\" y \"se va a mear encima\". Al decirle que hasta que acabe el examen no puede ir, se va sin permiso.', 'Leve', 'No', 'No', 0, 0),
(105, '3371476', '2019-10-15', '3', 'Luengo López, Juan Carlos', 'No traer el parte firmado en el plazo de una semana.\n', 'No trae un parte anterior firmado.', 'Leve', 'No', 'No', 0, 0),
(106, '3371476', '2019-10-11', '3', 'Luengo López, Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No trabaja, juega con su compañera y se niega a cambiarse de sitio, pese a que se lo repito en varias ocasiones.', 'Leve', 'No', 'No', 0, 0),
(108, '3255985', '2019-10-11', '3', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No para de hablar en clase y no trabaja nada. Se le advierte varias veces, pero sigue igual.', 'Leve', 'No', 'No', 0, 0),
(109, '3385032', '2019-10-14', '2', 'Coello Palomino, Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Perturba el desarrollo de las clases.', 'Leve', 'No', 'No', 0, 0),
(110, '3016658', '2019-10-15', '5', 'Coello Palomino, Francisco Javier', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Insultó a otro compañero.', 'Leve', 'No', 'No', 0, 0),
(111, '3247118', '2019-10-16', '3', 'Moriana Catalán, Gertrudis', 'Cinco faltas injustificadas de puntualidad.\n', 'Llega 15 minutos tarde a clase. Y ha sido advertida por la profesora, porque también ha llegado tarde en otras ocasiones. Reincidente.', 'Leve', 'No', 'No', 0, 0),
(112, '2972753', '2019-10-16', '3', 'Moriana Catalán, Gertrudis', 'Cinco faltas injustificadas de puntualidad.\nExhibir el móvil en el centro escolar.\n', 'Llega 15 minutos tarde. Trae los cascos puestos. No me oye cuando le hablo. Reincidente en faltas de puntualidad.', 'Leve', 'No', 'No', 0, 0),
(113, '2988184', '2019-10-16', '4', 'Ventura Fernández, Lourdes', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Estoy usando la tablet, una aplicación para poner unas notas y me dice con mal tono: \"¿qué estás usando whatsapp?\" Le pido que salga del aula y dice \"¡qué mierda de instituto!\".', 'Leve', 'No', 'No', 0, 0),
(114, '3275377', '2019-10-14', '5', 'Román Vázquez, Álvaro Jesús', 'Estar fuera del aula entre horas sin permiso.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Se encuentra en la clase de 3º C en lugar de en la suya. Le advierto que como lo vuelva a ver le pongo un parte y dice que piensa estar aquí todos los días. Dice que vaya poniéndole dos partes porque seguirá haciéndolo.', 'Leve', 'No', 'No', 0, 0),
(115, '3275377', '2019-10-14', '3', 'Román Vázquez, Álvaro Jesús', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Se echa a dormir en clase. Le aviso y sigue igual, ni siquiera levanta la cabeza.', 'Leve', 'No', 'No', 0, 0),
(116, '4126525', '2019-10-16', '5', 'López Galiot, Lidia', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Un compañero quiere ir al servicio. Él dice \" le va a reventar el nabo\".', 'Leve', 'No', 'No', 0, 0),
(117, '3267199', '2019-10-17', '3', 'Barroso Fernández, María Carmen', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nNo disponer del material necesario para el aprendizaje.\n', 'No trae los materiales y la nota firmada. No trabaja. Ruego mirar el horario y traer. Se le ha escrito dos notas para sus padres. No trae agenda y se llama telefónicamente.', 'Leve', 'No', 'No', 0, 0),
(118, '3266528', '2019-10-16', '3', 'Muñoz Muñoz, María Jesús', 'Estar fuera del aula entre horas sin permiso.\n', 'Sale en el cambio de clase sin permiso para hablar con compañeros de la clase de al lado.', 'Leve', 'No', 'No', 0, 0),
(119, '2718911', '2019-10-17', '3', 'Ordóñez Pérez, Rocío', 'Estar fuera del aula entre horas sin permiso.\nOtras (contempladas en el P.C.)...\n', 'Entramos al taller y no quiere ponerse el uniforme; sube al vestuario y no baja. No entra a clase y no sé dónde está.', 'Leve', 'No', 'No', 0, 0),
(120, '3914184', '2019-10-17', '4', 'Polonio Pino, Cristóbal', 'Estar fuera del aula entre horas sin permiso.\nNo traer el parte firmado en el plazo de una semana.\n', 'El alumno se encuentra fuera de su clase, cuando sabe que no debe hacerlo, y dentro de otra aula. Además, no me ha traído el parte firmado de casa.', 'Leve', 'No', 'No', 0, 0),
(121, '3914184', '2019-10-18', '4', 'Sánchez Luque, Rafael', 'Utilizar el móvil para fotografiar o grabar a cualquier miembro de la comunidad educativa.\n', 'Se le cae el móvil al suelo. Posteriormente sigue con él y al ser descubierto lo esconde entre la ropa.', 'Grave', 'No', 'No', 0, 0),
(122, '4200865', '2019-10-21', '4', 'Serrano Ruiz, Mª Gracia', 'Agresión física a un miembro de la comunidad educativa.\n', 'Durante el camino de vuelta al Centro desde el Centro Cívico Fuensanta con  motivo del concierto de Jazz para escolares, el alumno lanza naranjas, pone zancadillas a sus compañeros y acaba lanzando una naranja contra la cabeza de una compañera.', 'Grave', 'No', 'No', 0, 0),
(123, '3835978', '2019-10-18', '3', 'Muñoz Muñoz, Rosario', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Ángel está continuamente llamando la atención. Cuando le digo que se calle me dice que se quiere ir a su \"puta\" casa. No quiere salir del aula y me ha dicho \"tu puta madre\".', 'Grave', 'No', 'No', 0, 0),
(124, '3828387', '2019-10-22', 'Recreo', 'Polonio Pino, Cristóbal', 'Agresión física a un miembro de la comunidad educativa.\n', 'Adrián se niega a trabajar a pesar de las diversas llamadas de atención, respondiendo: \"me da igual\". Cuando sale de clase agrede \"de broma\" a un compañero de clase. Así no puede seguir.', 'Grave', 'No', 'No', 0, 0),
(125, '3828387', '2019-10-18', '4', 'Sánchez Luque, Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'El alumno lanza una pelota en mitad de la clase a otro compañero. Tampoco trae materiales a clase y llega tarde.', 'Leve', 'No', 'No', 0, 0),
(126, '3828387', '2019-10-22', '4', 'García Castro, Rosa María', 'No traer el parte firmado en el plazo de una semana.\n', 'Le he pedido el parte que le puse hace más de una semana por subir de pìe haciendo equilibrio por la barandilla de la esclelra y con actitud chulesca dice que lo ha perdido.', 'Leve', 'No', 'No', 0, 0),
(127, '3871838', '2019-10-21', '4', 'Serrano Ruiz, Mª Gracia', 'Agresión física a un miembro de la comunidad educativa.\n', 'En el camino de vuelta al Centro desde el Centro Cívico Fuensanta con motivo del concierto de Jazz para escolares, el alumno ha estado lanzando naranjas y poniendo zancadillas a sus compañeros. Al final ha lanzado una naranja contra la cabeza de una compañera, causándole un fuerte dolor.', 'Grave', 'No', 'No', 0, 0),
(128, '3871838', '2019-10-18', '4', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Le llamo la atención muchas veces en clase. Le advierto de que no se asome a la ventana y lo hace. Me engaña diciendo que la profesora ausente estaba en el servicio.', 'Leve', 'No', 'No', 0, 0),
(129, '3835978', '2019-10-23', '2', 'Castro Luque, Agustín', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Al pasar frente al aula de convivencia, el alumno que se encontraba dentro, grita mi nombre en un tono un tanto burlón y falto de consideración, no como un sincero saludo. Esta actitud es reiterada y ya le he hecho saber al alumno mi disgusto por ella.', 'Leve', 'No', 'No', 0, 0),
(130, '3828387', '2019-10-22', '2', 'Moriana Catalán, Gertrudis', 'Reiteración de conductas contrarias a las normas de convivencia.\nPerjudicar gravemente el desarrollo de las actividades del centro\nIncumplimiento de las correcciones impuestas.\nOtros.\n', 'Adrián no hace ningún caso. no quería ni sentarse en primera fila ni sacar el material. Llegó tarde. Esta conducta se repite desde principio de curso. Ya le he puesto varios partes y he considerado no ponerle más porque el alumno quiere salir al aula de convivencia. Responde inadecuadamente.', 'Grave', 'No', 'No', 0, 0),
(131, '3860095', '2019-10-22', '4', 'García Muñoz, Marcos', 'Otras (contempladas en el P.C.)...\n', 'Lanza un objeto que llega hasta mi mesa.', 'Leve', 'No', 'No', 0, 0),
(132, '3545854', '2019-10-21', '3', 'Ruiz Gómez, Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Es un alumno que normalmente trabaja, pero hoy no paraba de protestar y le he llamado la atención varias veces. Habla en voz alta en clase, interviene sin ser preguntado.', 'Leve', 'No', 'No', 0, 0),
(133, '3521235', '2019-10-17', '3', 'Lara Ruiz, Ana', 'Estar fuera del aula entre horas sin permiso.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'A 3ª hora sale María sin permiso del aula, me la encuentro bebiendo agua, le digo expresamente que vaya rápido a clase que yo voy para allá (estoy de guardia). Tarda en venir, no sólo no ha ido rápido, sino que se ha parado en ir al baño sin permiso, además entra en el aula con malos modos cuando le riño por su actitud.', 'Leve', 'No', 'No', 0, 0),
(134, '3898453', '2019-10-17', '3', 'Lara Ruiz, Ana', 'Estar fuera del aula entre horas sin permiso.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'A 3ª hora sale María del Mar sin permiso del aula, me la encuentro bebiendo agua, le digo expresamente que vayan rápido a clase que yo (estoy de guardia) voy para allá. Tarda en venir porque no sólo no ha ido rápido sino que se para en ir al baño sin permiso.', 'Leve', 'No', 'No', 0, 0),
(135, '3255863', '2019-10-17', '4', 'Polonio Pino, Cristóbal', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'El alumno no hace nada en clase. No atiende las llamadas de atención y en un tono impropio pretende tomarle el pelo al profesor, siendo expulsado de clase.', 'Leve', 'No', 'No', 0, 0),
(136, '3371476', '2019-10-18', '3', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'La alumna no entrega una nota a sus padres firmados a pesar de estar advertida de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(137, '3545934', '2019-10-23', '3', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Se le advierte en varias ocasiones que se siente bien y no hable con los compañeros, pero no hace caso. Cuando se lo vuelvo a decir contesta de mala forma y llamándome \"pesao\".', 'Leve', 'No', 'No', 0, 0),
(138, '3255985', '2019-10-18', '3', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nTirar objetos, papales, o basura al suelo en cualquier dependencia del centro.\n', 'No trabaja nada, sólo habla. Tengo que cambiarlo de sitio. Le tira un papel a un compañero. Sigue charlando el resto de la clase.', 'Leve', 'No', 'No', 0, 0),
(139, '3519553', '2019-10-17', '5', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Chilla fuertemente en clase en repetidas ocasiones. Tarda varios minutos recogiendo sus cosas provocando la risa de sus compañeros.', 'Leve', 'No', 'No', 0, 0),
(140, '3537160', '2019-10-18', '3', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Se golpea \"jugando\" con un compañero. No paraba de molestar al compañero.', 'Leve', 'No', 'No', 0, 0);
INSERT INTO `disciplina` (`id_disc`, `NIE`, `fecha`, `hora`, `profesor`, `motivos`, `descripcion`, `tipo`, `revisado`, `expulsion`, `id_medidas`, `numero`) VALUES
(141, '2988184', '2019-10-22', '3', 'Cruz Salido, Pedro Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No deja de alborotar, molestar,... y no hace caso a mis instrucciones: no saca la libreta, etc...', 'Leve', 'No', 'No', 0, 0),
(142, '2988184', '2019-10-18', '3', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'No trabaja nada y no para de hablar. Se ríe a carcajadas al ponerle un parte  a un compañero. Vuelve a reírse a carcajadas en varias ocasiones.', 'Leve', 'No', 'No', 0, 0),
(143, '3292759', '2019-10-17', '4', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Mientras le estoy rellenando el parte a Villodres se levanta sin permiso y se cambia a otra mesa.', 'Leve', 'No', 'No', 0, 0),
(144, '3524062', '2019-10-18', '3', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Golpea a un compañero \"jugando\" porque dice que le está molestando.', 'Leve', 'No', 'No', 0, 0),
(145, '2994936', '2019-10-18', '3', 'Sierra Martín, Francisco Manuel', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Se pone a dormir en clase.', 'Leve', 'No', 'No', 0, 0),
(146, '3275377', '2019-10-17', '4', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Tiene los auriculares puestos, le digo que los deje en mi mesa y al levantarse se pone a hacer flexiones.', 'Leve', 'No', 'No', 0, 0),
(147, '3275377', '2019-10-17', '3', 'Jefatura de Estudios', 'Reiteración de conductas contrarias a las normas de convivencia.\nIncumplimiento de las correcciones impuestas.\n', 'Es expulsado de clase de tecnología y no acude al aula de convivencia. Deben buscarle por el patio.', 'Grave', 'No', 'No', 0, 0),
(148, '3275377', '2019-10-18', '3', 'Sierra Martín, Francisco Manuel', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Se pasa toda la clase durmiendo, a pesar de haberle llamado la atención.', 'Leve', 'No', 'No', 0, 0),
(149, '2332764', '2019-10-17', '3', 'Ordóñez Pérez, Rocío', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Esconde la mochila de un compañero y se empieza a reír. Le digo que se ponga a trabajar y después de varios avisos continúa riéndose. Le digo que se salga a la puerta y sigue riéndose.', 'Leve', 'No', 'No', 0, 0),
(150, '3530182', '2019-10-23', '5', 'Camino Conde, María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Hace ruidos constantemente. Cuando le digo que deje de hacerlo, me contesta por lo bajo una y otra vez a pesar de advertírselo muchas veces.', 'Leve', 'No', 'No', 0, 0),
(151, '3903064', '2019-10-21', '5', 'Serrano Ruiz, Mª Gracia', 'Agresión física a un miembro de la comunidad educativa.\nUtilizar el móvil para fotografiar o grabar a cualquier miembro de la comunidad educativa.\n', 'En visita al centro cívico Fuensanta , con motivo del concierto de Jazz, el comportamiento del alumno José María Ojeda no ha sido ejemplar. Ha molestado durante el concierto, se ha subido por aparcamientos de bicicletas con el riesgo para su integridad física, ha lanzado una naranja con furia contra un compañero y ah hecho referencia al tamaño de sus genitales ante la profesora que pone el parte.', 'Grave', 'No', 'No', 0, 0),
(152, '3903064', '2019-10-23', '3', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No para de molestar. El repito varias veces que se siente y no me hace caso. Le digo que se baje el cuaderno y se niega.', 'Leve', 'No', 'No', 0, 0),
(153, '3278125', '2019-10-23', '4', 'Román Vázquez, Álvaro Jesús', 'No traer el parte firmado en el plazo de una semana.\n', 'Después de 15 días y de pedírselo varias veces, sigue sin traer el parte anterior firmado.', 'Leve', 'No', 'No', 0, 0),
(154, '3240055', '2019-10-23', '4', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No trabaja absolutamente nada. Le advierto en varias ocasiones que se calle y no hace ningún caso. Incluso cuando le estoy avisando habla en voz baja con un compañero de la otra punta de la clase.', 'Leve', 'No', 'No', 0, 0),
(155, '3899421', '2019-10-23', '5', 'Lara Ruiz, Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No para de hacer ruidos, dar golpes, hablar y molestar.', 'Leve', 'No', 'No', 0, 0),
(156, '3516999', '2019-10-22', '5', 'Sánchez Aguera, María Carmen', 'No traer el parte firmado en el plazo de una semana.\n', 'No trae un parte anterior firmado.', 'Leve', 'No', 'No', 0, 0),
(157, '3529727', '2019-10-22', '5', 'Sánchez Aguera, María Carmen', 'No traer el parte firmado en el plazo de una semana.\n', 'No trae un parte anterior firmado.', 'Leve', 'No', 'No', 0, 0),
(158, '3255985', '2019-10-23', '5', 'Sanjuán Vidal, Mª del Carmen', 'Exhibir el móvil en el centro escolar.\n', 'Le he pillado con el móvil en la mano. Sólo miraba la hora.', 'Leve', 'No', 'No', 0, 0),
(159, '3323287', '2019-10-23', '5', 'Rivera Reyes, Juan', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'Los conserjes la encuentra en el patio sin asistir a clase de Biología y utilizando el móvil. Lo niegan pese a que Manolo y Luis la han visto. Desconsideración y falta de respeto al PAS.', 'Grave', 'No', 'No', 0, 0),
(160, '2716544', '2019-10-23', '5', 'Rivera Reyes, Juan', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'Los conserjes la encuentra en el patio sin asistir a clase de Inglés y utilizando el móvil. Lo niegan pese a que Manolo y Luis la han visto. Desconsideración y falta de respeto al PAS.', 'Grave', 'No', 'No', 0, 0),
(161, '3914184', '2019-10-28', '4', 'Castro Luque, Agustín', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No deja de molestar impidiendo la impartición de la clase.', 'Leve', 'No', 'No', 0, 0),
(162, '3914184', '2019-10-28', '4', 'Sierra Martín, Francisco Manuel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No se está quieto, no se calla, se pone a bailar en clase y me pregunta insistentemente que cuándo lo voy a echar.', 'Leve', 'No', 'No', 0, 0),
(163, '3825674', '2019-10-23', '6', 'Cortes Sánchez, Ana María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nNo disponer del material necesario para el aprendizaje.\n', 'No trae nada de material. Y se le llama la atención, pero sólo molesta.', 'Leve', 'No', 'No', 0, 0),
(164, '3828387', '2019-10-28', '4', 'Román Vázquez, Álvaro Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Está en el aula de convivencia y no trabaja nada y no para de hablar y molestar. Contesta de manera poco adecuada, diciendo \"sí, hombre\", \" anda ya, me vas a poner un parte\". Continúa con la misma actitud.', 'Leve', 'No', 'No', 0, 0),
(165, '3907317', '2019-10-22', '5', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No para de molestar en clase a pesar de mis numerosas llamadas de atención.', 'Leve', 'No', 'No', 0, 0),
(166, '4162626', '2019-10-28', '4', 'Quintana Ramos, José Ángel', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Después de mandarle que tire el chicle dos veces, se mete un chicle por tercera vez.', 'Leve', 'No', 'No', 0, 0),
(167, '3871838', '2019-10-22', '5', 'Núñez Granados, Miguel Ángel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Hace un comentario jocoso cuando estoy poniéndole un parte a un compañero.', 'Leve', 'No', 'No', 0, 0),
(168, '3903064', '2019-10-28', '4', 'Sánchez Luque, Rafael', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\nReiteración de conductas contrarias a las normas de convivencia.\nPerjudicar gravemente el desarrollo de las actividades del centro\nIncumplimiento de las correcciones impuestas.\n', 'No se sienta en clase. Me pone el brazo encima en actitud chulesca. Le amonesto y continúa chuleando. Cuando lo expulso del aula sigue insultando y se va dando un portazo.', 'Grave', 'No', 'No', 0, 0),
(169, '3903064', '2019-10-28', '4', 'González de los Ríos Guillén, Abraham', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Va a clase a recoger material. Como empieza a intervenir en la clase, el profesor de guardia le pide que espere fuera del aula mientras se acaba la tarea. El alumno se niega repetidamente.', 'Leve', 'No', 'No', 0, 0),
(170, '3903064', '2019-10-28', '6', 'Rivera Reyes, Juan', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'El alumno ha sido expulsado al aula de convivencia por el profesor Rafael Sánchez. Al llegar al aula de convivencia dice que está allí \"porque lo ha expulsado Mr. Bean\". al hablar con e´l sigue mofándose del profesor.', 'Grave', 'No', 'No', 0, 0),
(171, '3903064', '2019-10-28', '4', 'Abad Ruiz, Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Llega con mucho retraso a clase. Intenta salir a su aula (ya cerrada) para coger material, y contesta con groserías al profesor.', 'Grave', 'No', 'No', 0, 0),
(172, '3521235', '2019-10-28', '4', 'Lara Ruiz, Ana', 'No traer el parte firmado en el plazo de una semana.\n', 'Le puse un parte el jueves 17/10 que no ha traído firmado.', 'Leve', 'No', 'No', 0, 0),
(173, '3898453', '2019-10-28', '4', 'Lara Ruiz, Ana', 'No traer el parte firmado en el plazo de una semana.\n', 'Le puse un parte el 17/10 que no ha traído firmado.', 'Leve', 'No', 'No', 0, 0),
(174, '3815289', '2019-10-29', '4', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No trae firmada una nota a sus padres a pesar de estar advertido de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(175, '3545389', '2019-10-29', '4', 'Parejo Navarro, Francisco Javier', 'No disponer del material necesario para el aprendizaje.\n', 'Tercer día que no trae el libro a clase.', 'Leve', 'No', 'No', 0, 0),
(176, '3278125', '2019-10-23', '4', 'Belmonte Pérez, Antonio José', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Además de interrumpir y no hacer caso a las llamadas de atención, se dedica a hacer gestos muy ostensibles a una compañera indicándole \"tú a mí me vas a comer la...\".', 'Grave', 'No', 'No', 0, 0),
(177, '3240055', '2019-10-25', '4', 'Blanco Domínguez, Guillermo', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se le manda una tarea y no la hace porque se dedica a charlar haciendo caso omiso a lo que se le dice en varias ocasiones.', 'Leve', 'No', 'No', 0, 0),
(178, '3240055', '2019-10-25', '4', 'Martínez Ruiz, María Rocío', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Grita, le digo que se calle y vuelve a gritar. No hace nada en clase y desobedece sistemáticamente.', 'Leve', 'No', 'No', 0, 0),
(179, '3914184', '2019-10-29', '2', 'Blanco Domínguez, Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Se niega a hacer nada. En lugar de hacer el ejercicio se dedica a pasear con Mario Sánchez. Viene rebotado de Jefatura.', 'Leve', 'No', 'No', 0, 0),
(180, '3517085', '2019-10-29', '3', 'Blanco Domínguez, Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Se niega a hacer nada. En lugar de hacer el ejercicio se dedica a pasear con Yerai. Viene rebotado de Jefatura.', 'Leve', 'No', 'No', 0, 0),
(181, '3255863', '2019-10-30', '3', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No trae firmada una nota a sus padres a pesar de estar advertido de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(182, '3537821', '2019-10-28', '3', 'Muñoz Muñoz, María Jesús', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Hace semanas le escribí una nota en la agenda para informar a sus padres de su comportamiento en clase. Al pedírsela firmada me dice que no le he escrito ninguna nota, y posteriormente observo que ha arrancado la hoja.', 'Leve', 'No', 'No', 0, 0),
(183, '3815357', '2019-10-25', '3', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'La alumna no trae firmada una nota del día 14 a pesar de ser advertida de que no hacerlo le supondría un parte.', 'Leve', 'No', 'No', 0, 0),
(184, '3255863', '2019-10-28', '3', 'Ruiz Gómez, Clara Eugenia', 'Estar fuera del aula entre horas sin permiso.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Le pido que se vaya a su clase. No me hace caso ninguno. Le pregunto para rellenar el parte. Mantiene una actitud incorrecta.', 'Leve', 'No', 'No', 0, 0),
(185, '3255863', '2019-10-28', '5', 'Ramírez Oña, Verónica', 'Otros.\n', 'El alumno llega a clase con actitud chulesca porque le han puesto un parte. Le digo que no hable y me contesta malamente insistiendo y mofándose de que no sabe por qué le han puesto el parte. Me falta el respeto delante de los compañeros.', 'Grave', 'No', 'No', 0, 0),
(186, '3913818', '2019-10-25', '3', 'Blanco Domínguez, Guillermo', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No hace lo que se le manda. Se dedica a charlar haciendo caso omiso a mis indicaciones. Se le avisa en varias ocasiones.', 'Leve', 'No', 'No', 0, 0),
(187, '3848291', '2019-10-28', '3', 'Parejo Navarro, Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Está charlando en clase.', 'Leve', 'No', 'No', 0, 0),
(188, '3348606', '2019-10-28', '3', 'Del Pino Cepedello, Antonio', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Se le llama constantemente la atención para que no hable con los compañeros, y atienda en clase. Hace caso omiso, después de muchas advertencias a lo largo del curso.', 'Leve', 'No', 'No', 0, 0),
(189, '3254483', '2019-10-22', '3', 'Ramírez Oña, Verónica', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\n', 'El alumno coge sin permiso un protector labial de una compañera y seguidamente lo rompe.', 'Grave', 'No', 'No', 0, 0),
(190, '3292673', '2019-10-22', '3', 'Muñoz Muñoz, María Jesús', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Entran en clase algunos alumnos que han estado en ella durante la hora anterior para aclarar quién ha ensuciado.  El alumno se pone a gritarles sin causa aparente y de forma irrespetuosa.', 'Leve', 'No', 'No', 0, 0),
(191, '3046334', '2019-10-29', '3', 'Del Pino Cepedello, Antonio', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Tras darle la nota correspondiente de un examen (buena nota, por cierto), me exige de forma destemplada que le enseñe el examen. Le digo que ahora no se lo voy a enseñar y me dice que es mi obligación con exigencia. Se va de clase sin permiso.', 'Leve', 'No', 'No', 0, 0),
(192, '3512275', '2019-10-29', '3', 'Román Vázquez, Álvaro Jesús', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', '\"Jugando\" le pincha con el compás a Antonio.', 'Leve', 'No', 'No', 0, 0),
(193, '2959750', '2019-10-30', '3', 'Coello Palomino, Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Insultar a gritos a un compañero durante la clase.', 'Leve', 'No', 'No', 0, 0),
(194, '3263805', '2019-10-23', '3', 'Romero García, Alejandro', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Cuando llamo la atención a un compañero en clase, el alumno da un grito \"¡uhhhh!\"', 'Leve', 'No', 'No', 0, 0),
(195, '3903064', '2019-10-30', '4', 'Abad Ruiz, Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Al devolver firmado el parte que le puse ayer, me ha dicho textualmente: \"toma profe, que eres subnormal\".', 'Grave', 'No', 'No', 0, 0),
(196, '3903064', '2019-10-30', '2', 'Serrano Ruiz, Mª Gracia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\nNo disponer del material necesario para el aprendizaje.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Le pido que se siente hasta diez veces, me dice que si no es mucho que si no me entero. No permite que se pueda dar clase, me grita, me contesta mal, pero no se sienta porque no quiere.', 'Leve', 'No', 'No', 0, 0),
(197, '3527474', '2019-10-30', '3', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Molesta continuamente a sus compañeros, me dice que si le pongo un parte \"me la lía\" y utiliza expresiones inadecuadas.', 'Leve', 'No', 'No', 0, 0),
(198, '3255863', '2019-10-30', '5', 'Polonio Pino, Cristóbal', 'No traer el parte firmado en el plazo de una semana.\n', 'A pesar de habérselo recordado durante la semana, no trae el parte anterior firmado, añadiendo que lo \"ha perdido\".', 'Leve', 'No', 'No', 0, 0),
(199, '3255863', '2019-10-30', '5', 'Parejo Navarro, Francisco Javier', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Después de ponerle un parte me dice que porqué se lo pongo, le respondo y tras ello dice en voz alta: \"pues esto (se refiere a la tarea) lo va a hacer su puta madre2. Más tarde me pregunta si le voy a poner un parte y dice: \"está amargado\".', 'Grave', 'No', 'No', 0, 0),
(200, '3254483', '2019-10-30', '5', 'Barroso Fernández, María Carmen', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No hace lo que se le manda. Se dedica a charlar haciendo caso omiso de las indicaciones de la profesora.', 'Leve', 'No', 'No', 0, 0),
(201, '3595442', '2019-10-30', '5', 'Ponce de León Echevarria, Augusto', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Habla continuamente y contesta al profesor. Interrumpe la clase.', 'Leve', 'No', 'No', 0, 0),
(202, '3530182', '2019-10-31', '4', 'Abad Ruiz, Federico', 'No disponer del material necesario para el aprendizaje.\n', 'Acude a clase repetidamente sin material.', 'Leve', 'No', 'No', 0, 0),
(203, '3914184', '2019-10-31', '4', 'Abad Ruiz, Federico', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'En lugar de usar la app de piano para tocar la canción está vídeos de youtube.', 'Leve', 'No', 'No', 0, 0),
(204, '3914184', '2019-10-31', '4', 'Sánchez Luque, Rafael', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'Desde el inicio de la clase está sentado apoyado en la pared, con la silla en equilibrio y golpeando la pared. No trae ningún material a clase. Le he advertido para que se comporte pero se burla de mí y sigue con la misma actitud. Golpea el suelo con la silla, se burla y da voces.', 'Grave', 'No', 'No', 0, 0),
(205, '4084731', '2019-10-31', '4', 'Abad Ruiz, Federico', 'No disponer del material necesario para el aprendizaje.\n', 'Acude a clase repetidamente sin material.', 'Leve', 'No', 'No', 0, 0),
(206, '4117462', '2019-10-29', '4', 'Sánchez Luque, Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'El alumno está en el aula hablando sin parar con el compañero. Se empujan mutuamente. Como medida correctiva le indico que copie \"no hablaré en clase\". No cumple la corrección impuesta.', 'Leve', 'No', 'No', 0, 0),
(207, '3825674', '2019-10-29', '4', 'Sánchez Luque, Rafael', 'Ignorar las llamadas de atención del personal docente y no docente.\nComer o beber en clase.\n', 'El alumno está en clase sin atender las indicaciones. Está con una pepsi abierta y se esconde al fondo del aula para beber. Le he advertido previamente y no sigue indicaciones.', 'Leve', 'No', 'No', 0, 0),
(208, '3828387', '2019-10-28', '4', 'Camino Conde, María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No sacar el material. Contesta con actitud chulesca cuando se le llama la atención.', 'Leve', 'No', 'No', 0, 0),
(209, '3828387', '2019-11-05', '2', 'Polonio Pino, Cristóbal', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Tras llamarle la atención varias veces continúa hablando. Cuando le indico que se cambie de sitio, se niega.', 'Leve', 'No', 'No', 0, 0),
(210, '3871838', '2019-10-31', '6', 'Polonio Pino, Cristóbal', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Estando realizando un examen, y tras ser advertido en numerosas ocasiones, no deja de molestar, especialmente a su compañero Pablo, perjudicando la realización del examen y el listening Halloween.', 'Leve', 'No', 'No', 0, 0),
(211, '3903064', '2019-10-30', '6', 'Cortes Sánchez, Ana María', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'Se niega a hacer el examen y a sentarse.', 'Grave', 'No', 'No', 0, 0),
(212, '3807596', '2019-10-29', '4', 'Sánchez Luque, Rafael', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'El alumno está hablando sin parar con el compañero. Se empujan mutuamente. Como medida correctiva le indico que copie: \"no hablaré en clase\". No cumple la corrección impuesta. su compañero se queja que le insulta: \"tus muertos\".', 'Grave', 'No', 'No', 0, 0),
(213, '3278125', '2019-10-30', '5', 'Ayllón Redondo, Enrique', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No saca el material escolar reiteradamente, ignora las llamadas del personal docente e insulta a un compañero diciéndole: \"tu puta madre\".', 'Leve', 'No', 'No', 0, 0),
(214, '3240055', '2019-10-30', '4', 'Blanco Domínguez, Guillermo', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No hace nada. Lo cuestiona todo y se pone en actitud chulesca y diciéndome lo que tengo que mandar y lo que tengo o no que hacer en mis clases.', 'Leve', 'No', 'No', 0, 0),
(215, '3240055', '2019-10-31', '4', 'Barroso Fernández, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Hace caso omiso de las indicaciones de la profesora. Se levanta, no hace nada. Contesta a la profesora de forma indebida: silbando.', 'Leve', 'No', 'No', 0, 0),
(216, '3255863', '2019-10-30', '4', 'Toledano Rubio, Miguel', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'El alumno miente sobre los motivos de un parte. Una vez aclaradas las causas del mencionado parte, abandona la Jefatura de Estudios con malos modos y sin atender las indicaciones del profesor.', 'Grave', 'No', 'No', 0, 0),
(217, '3913818', '2019-10-30', '4', 'Ayllón Redondo, Enrique', 'Estar fuera del aula entre horas sin permiso.\n', 'Estar en el pasillo en el cambio de clase.', 'Leve', 'No', 'No', 0, 0),
(218, '3833386', '2019-10-30', '4', 'Ayllón Redondo, Enrique', 'Estar fuera del aula entre horas sin permiso.\n', 'Estar en el pasillo en el cambio de clase.', 'Leve', 'No', 'No', 0, 0),
(219, '3846943', '2019-10-31', '4', 'Barroso Fernández, María Carmen', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Interrumpe continuamente la explicación de la profesora. Después de reiteradas amonestaciones.', 'Leve', 'No', 'No', 0, 0),
(220, '3267199', '2019-10-30', '4', 'Ayllón Redondo, Enrique', 'Estar fuera del aula entre horas sin permiso.\n', 'Estar en el pasillo en el cambio de clase.', 'Leve', 'No', 'No', 0, 0),
(221, '3371476', '2019-10-31', '4', 'Luengo López, Juan Carlos', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'No trabaja en clase, distrae a los compañeros y contesta mal al ser regañada. Cuando le digo que le voy a poner un parte, contesta: \"¿es mi regalo de Halloween?\". Después de eso, sigue hablando y de risas con los compañeros. Me pregunta: \"¿te echas una foto conmigo?\".', 'Grave', 'No', 'No', 0, 0),
(222, '3595442', '2019-11-05', '2', 'Polonio Pino, Cristóbal', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Le pega con la regla a un compañero. Están toda la clase igual, no paran de jugar.', 'Leve', 'No', 'No', 0, 0),
(223, '3914184', '2019-11-05', '2', 'Sánchez Luque, Rafael', 'Reiteración de conductas contrarias a las normas de convivencia.\nIncumplimiento de las correcciones impuestas.\n', 'Está en clase interrumpiendo y gritando sin parar. Llega un momento en que no obedece y las risotadas son molestas y groseras. Cuando lo expulso del aula se va dando golpes al mobiliario y gritando.', 'Grave', 'No', 'No', 0, 0),
(224, '3527474', '2019-11-05', '2', 'Barroso Fernández, María Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Reiteración en su conducta. Al entrar le pone el gorro al compañero se levanta y se pone a dar abrazos... No para de interrumpir en clase. El pasado día fue a Jefatura por su comportamiento, fue un aviso (sin parte). ', 'Leve', 'No', 'No', 0, 0),
(225, '2689013', '2019-10-31', '3', 'Magarín Corvillo, Mª Lourdes', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nUtilizar aparatos grabadores o reproductores, cámaras de fotos y teléfonos móviles.\n', 'Hace uso del móvil en clase. Fotografía. Perturba el desarrollo de clase.', 'Leve', 'No', 'No', 0, 0),
(226, '3449800', '2019-10-22', '3', 'Arribas Ríos, Regino', 'Otras (contempladas en el P.C.)...\n', 'Se cambia en el mismo pasillo, junto a la taquilla, quedando su cuerpo semidesnudo.', 'Leve', 'No', 'No', 0, 0),
(227, '2375745', '2019-10-30', '3', 'Coello Palomino, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Incumplimiento reiterativo a la indicación de mantener silencio y en última instancia rebeldía e indicación de que no mantendrá silencio.', 'Leve', 'No', 'No', 0, 0),
(228, '2914681', '2019-10-29', '3', 'Huertas Fuentes, Nicolás', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Después de varios avisos, se ponen a jugar en el aula.', 'Leve', 'No', 'No', 0, 0),
(229, '2953371', '2019-10-28', '3', 'Del Pino Cepedello, Antonio', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Estando de guardia a última hora del día, le pido al grupo de 1º bach B que entraran en el aula 105A, a la espera de que llegara el profesor. Me dirijo hacia la sala de profesores y al girarme veo que de nuevo han salido de la clase. Me dirijo hacia ellos y todos entran de nuevo,menos Rafael Muñoz que me dice que no va a entrar porque el aula huele \"mucho peste\".Habla descarado y con poco respeto.', 'Leve', 'No', 'No', 0, 0),
(230, '3521620', '2019-10-22', '3', 'Muñoz Muñoz, María Jesús', 'No traer el parte firmado en el plazo de una semana.\n', 'Han pasado once días desde que le puse el parte anterior y no lo ha traído.', 'Leve', 'No', 'No', 0, 0),
(231, '3016726', '2019-10-22', '3', 'Del Pino Cepedello, Antonio', 'No traer el parte firmado en el plazo de una semana.\n', 'Debía traer el parte firmado el viernes 18 de octubre de 2019 y no lo ha traído a martes 22 de octubre dándome unas excusas peregrinas.', 'Leve', 'No', 'No', 0, 0),
(232, '3016726', '2019-10-17', '3', 'Del Pino Cepedello, Antonio', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Interrupción continua y sistemática de la dinámica de clase con intervenciones impertinentes. Culmina con un estornudo exagerado sin venir a cuenta.', 'Leve', 'No', 'No', 0, 0),
(233, '3016726', '2019-10-28', '5', 'Coello Palomino, Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Tirar \"cosas\" a una compañera situada 6 filas adelante. Es actitud reiterativa.', 'Leve', 'No', 'No', 0, 0),
