(235, '3530182', '2019-11-07', '1', 'Abad Ruiz, Federico', 'No traer el parte firmado en el plazo de una semana.\n', 'No trae el parte anterior en una semana ni trae el material a clase.', 'Leve', 'No', 'No', 0, 0),
(236, '3914184', '2019-11-07', '3', 'Castro Luque, Agustín', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Alborota, se resiste a cambiarse de sitio, grita,...\r\nLe he hecho varias advertencias.', 'Leve', 'No', 'No', 0, 0),
(237, '3914184', '2019-11-07', '1', 'Sánchez Luque, Rafael', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'Está mal sentado, no para de hablar en voz alta y se burla del profesor cada vez que se le amonesta. Le he dado oportunidad de entrar en clase, pero es imposible. Se pone a jugar con un avión gigante de papel y se sigue burlando: \"voy para piloto\".', 'Grave', 'No', 'No', 0, 0),
