(242, '3828387', '2019-11-07', '1', 'Abad Ruiz, Federico', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Sus continuas interrupciones, charlas, ... impiden dar y seguir la clase.', 'Leve', 'No', 'No', 0, 0),
(243, '3828387', '2019-11-06', '1', 'Blanco Domínguez, Guillermo', 'Reiteración de conductas contrarias a las normas de convivencia.\nIncumplimiento de las correcciones impuestas.\nOtros.\n', 'Durante la actividad de senderismo, a la que no podían asistir por estar sancionados, se presentan con sus bicicletas mezclándose con el resto de alumnos, entorpeciendo su marcha aveces e incluso parándoles los pies a algunos. Se le advierte en repetidas ocasiones que se vayan pero no hacen caso. Al final se van cuando creen que hemos llamado a la guardia civil.', 'Grave', 'No', 'No', 0, 0),
(244, '3903064', '2019-11-06', '1', 'Blanco Domínguez, Guillermo', 'Reiteración de conductas contrarias a las normas de convivencia.\nIncumplimiento de las correcciones impuestas.\nOtros.\n', 'Durante la actividad de senderismo, a la que no podían asistir por estar sancionados, se presentan con sus bicicletas mezclándose con el resto de alumnos, entorpeciendo su marcha aveces e incluso parándoles los pies a algunos. Se le advierte en repetidas ocasiones que se vayan pero no hacen caso. Al final se van cuando creen que hemos llamado a la guardia civil.', 'Grave', 'No', 'No', 0, 0),
(245, '3828387', '2019-11-08', '3', 'Polonio Pino, Cristóbal', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Adrián llega tarde a clase. Cunado le pregunto de dónde viene, me responde que de beber agua. Cuando le pregunto que con qué permiso, me dice que con ninguno. Le digo que se cambie de sitio y se niega a hacerlo (siempre está hablando).', 'Leve', 'No', 'No', 0, 0),
(246, '3828387', '2019-11-08', '1', 'Moriana Catalán, Gertrudis', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\nCinco faltas injustificadas de puntualidad.\n', 'No me hace caso. Cuando le indico que se siente en primera fila se niega. Responde: \"no, no, no\". Llega tarde a clase. Siempre llega tarde. No trae el material, después dice que sí lo tiene. Dice que lo tiene en la mochila.', 'Leve', 'No', 'No', 0, 0),
(247, '3914184', '2019-11-08', '4', 'Sierra Martín, Francisco Manuel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No para de dar voces y se niega a copiar.', 'Leve', 'No', 'No', 0, 0),
(248, '3828387', '2019-11-06', '4', 'Camino Conde, María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\nNo disponer del material necesario para el aprendizaje.\n', 'Habla en clase en voz alta sin hacer caso a los avisos. Le digo que salga 5 minutos a la puerta para que relaje y entra cuando le parece. Le vuelvo a reñir y sigue con la misma actitud en un tono desafiante.', 'Leve', 'No', 'No', 0, 0),
(249, '3832471', '2019-11-08', '4', 'Ponce de León Echevarria, Augusto', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Contestar al profesor y decir tacos al llamarle la atención.', 'Leve', 'No', 'No', 0, 0),
