(251, '3517085', '2019-11-07', '4', 'Castro Luque, Agustín', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Vamos al laboratorio y no se lleva nada para trabajar. Los aviso dos veces.', 'Leve', 'No', 'No', 0, 0),
