(253, '3527474', '2019-11-11', '6', 'Ruiz Gómez, Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No trabaja nada y no deja de hablar con los compañeros.', 'Leve', 'No', 'No', 0, 0),
