(256, '3240055', '2019-11-07', '6', 'Muñoz Muñoz, Rosario', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'No hace nada y todo el tiempo charla e interrumpe. Cuando le he llamado la atención, me contesta: \"estoy hasta los cojones\".', 'Leve', 'No', 'No', 0, 0),
(257, '3814599', '2019-11-06', '6', 'Ruiz Gómez, Clara Eugenia', 'Estar fuera del aula entre horas sin permiso.\n', 'Estaba fuera del aula en el cambio de clase.', 'Leve', 'No', 'No', 0, 0),
(258, '3562460', '2019-11-08', '6', 'Parejo Navarro, Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Le indico que se calle y me contesta de malos modos, negándose a realizar la tarea que le encomiendo. Además me dice que no la va a hacer y me dice que la baje al aula de convivencia.', 'Leve', 'No', 'No', 0, 0),
(259, '3562460', '2019-11-07', '6', 'Cruz Salido, Pedro Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No para de reírse, no hace caso al profesor al decirle que saque el material y que se cambie de sitio.', 'Leve', 'No', 'No', 0, 0),
(260, '3067897', '2019-11-06', '5', 'Jefatura de Estudios', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\n', 'Entre 4ª hora y 5ª hora del martes 5, vacía un extintor en el pasillo de la primera planta.', 'Grave', 'No', 'No', 0, 0),
