(262, '3371476', '2019-11-11', '5', 'Luengo López, Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Se levanta sin permiso y responde mal al profesor.', 'Leve', 'No', 'No', 0, 0),
(263, '3371476', '2019-11-11', '6', 'Lara Ruiz, Ana', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Ha llegado tarde. Se sienta con los libros encima de la mesa y cerrados. Se dedica a distraer a la compañera de al lado y a los de atrás. Le aviso muchas veces de que no distraiga a sus compañeros y que copie los ejercicios de la pizarra. No hace caso ninguno cuando le llamo la atención, se niega a cambiarse de sitio. La llamo para hablar y me dice : \"eres una pesada y no tengo ganas de hablar.', 'Grave', 'No', 'No', 0, 0),
(264, '6668755', '2019-11-06', '4', 'Luengo López, Juan Carlos', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'Entra en clase, coge la mochila y sale. Cuando voy a buscarle me dice que tiene que hacer una cosa y que me vaya a la clase. Al decirle que no, contesta: \"déjame en paz\".', 'Grave', 'No', 'No', 0, 0),
(265, '3371476', '2019-11-07', '6', 'Lara Ruiz, Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Le digo a Raquel varias veces que se cambie de sitio y se niega. Dice que prefiere irse al aula de convivencia.', 'Leve', 'No', 'No', 0, 0),
(266, '2725621', '2019-11-08', '6', 'Del Pino Cepedello, Antonio', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Permanente disrupción de la clase, a pesar de constantes llamadas de atención.', 'Leve', 'No', 'No', 0, 0),
(267, '3527527', '2019-11-04', '6', 'Coello Palomino, Francisco Javier', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'No para de hablar en clase, se le llama la atención varias veces y no obedece.', 'Leve', 'No', 'No', 0, 0),
(268, '3521620', '2019-11-04', '6', 'Coello Palomino, Francisco Javier', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'No para de hablar en clase, se le llama la atención varias veces y no obedece.', 'Leve', 'No', 'No', 0, 0),
(269, '4200865', '2019-11-11', '2', 'Sierra Martín, Francisco Manuel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No trabaja nada. No para de molestar y de jugar con los compañeros de al lado y con los de atrás.', 'Leve', 'No', 'No', 0, 0),
(270, '3914184', '2019-11-11', '2', 'Sierra Martín, Francisco Manuel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No obedece cuando le digo que se esté quieto. Está continuamente retándome y provocando a sus compañeros.', 'Leve', 'No', 'No', 0, 0),
(271, '3914184', '2019-11-12', '2', 'Quintana Ramos, José Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No calla en toda la hora a pesar de las continuas advertencias.', 'Leve', 'No', 'No', 0, 0),
(272, '3914184', '2019-11-12', '2', 'Sánchez Luque, Rafael', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'Entro en clase y está manipulando el ordenador y la pizarra digital. Se va a su sitio dando voces y burlándose del profesor. Al salir vuelve y apaga las luces del aula. Se despide llamando \"maricón\" a un compañero y \"guapo\" al profesor.', 'Grave', 'No', 'No', 0, 0),
(273, '3828387', '2019-11-12', '6', 'Abad Ruiz, Federico', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No deja de hablar y de incordiar. Es imposible seguir la clase con él.', 'Leve', 'No', 'No', 0, 0),
(274, '3828387', '2019-11-13', '2', 'Polonio Pino, Cristóbal', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Ni trabaja, ni atiende, ni deja al compañero. Cuando para evitarlo le indico que se cambie de sitio, \"se niega\".', 'Leve', 'No', 'No', 0, 0),
(275, '3828387', '2019-11-11', '3', 'Jefatura de Estudios', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\n', 'Entre 4ª y 5ª hora del martes 5 vacía un extintor de la primera planta. Inculpa a un compañero y hasta hoy no admite haber participado en estos hechos.', 'Grave', 'No', 'No', 0, 0),
(276, '3828387', '2019-11-11', '3', 'Polonio Pino, Cristóbal', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Cuando entra en clase (algunos minutos tarde porque dice haber olvidado la mochila en clase) le indico que se siente en un lugar determinado y se niega a hacerlo. Le advierto de la posible sanción y, sin dejar de mostrar una sonrisa, se reitera en su negativa a sentarse en el lugar indicado.', 'Leve', 'No', 'No', 0, 0),
(277, '3316292', '2019-11-06', '3', 'Del Pino Cepedello, Antonio', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Continua interrupción de la clase, sin atender a las llamadas de atención reiteradas.', 'Leve', 'No', 'No', 0, 0),
(278, '3901361', '2019-11-12', '3', 'Blanco Domínguez, Guillermo', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No deja de charlar. Tira pedazos de goma a sus compañeros. Se le llama continuamente la atención y no hace caso.', 'Leve', 'No', 'No', 0, 0),
(279, '3901292', '2019-11-11', '3', 'Serrano Ruiz, Mª Gracia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No saca material. No se sienta. Se va a hablar con  cualquier compañero de clase. Cuando le llamo la atención me pregunta a voz en grito \"¡¿qué quieres?!\".', 'Leve', 'No', 'No', 0, 0),
(280, '3914184', '2019-11-13', '4', 'Castro Luque, Agustín', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Grita, corre por la clase, se tira al suelo,...', 'Leve', 'No', 'No', 0, 0);
INSERT INTO `disciplina` (`id_disc`, `NIE`, `fecha`, `hora`, `profesor`, `motivos`, `descripcion`, `tipo`, `revisado`, `expulsion`, `id_medidas`, `numero`) VALUES
(281, '4084656', '2019-11-13', '4', 'Antúnez Alperiz, María Isabel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'En el aula, al finalizar el recreo, levanta la mesa y la deja caer reiteradamente junto con otro compañero.', 'Leve', 'No', 'No', 0, 0),
(282, '4137158', '2019-11-13', '4', 'Antúnez Alperiz, María Isabel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'En el aula, al finalizar el recreo, levanta la mesa y la deja caer reiteradamente junto con otro compañero.', 'Leve', 'No', 'No', 0, 0),
(283, '3828387', '2019-11-13', 'Recreo', 'Serrano Ruiz, Mª Gracia', 'Reiteración de conductas contrarias a las normas de convivencia.\nPerjudicar gravemente el desarrollo de las actividades del centro\n', 'El alumno se pasa todo el recreo asomado a la valla del centro. Le llamo al atención en varias ocasiones, le apercibo de que la próxima vez le pondré un parte. Me contesta alto y claro \"me vas a poner 4\"y sigue en la valla cuando toca el timbre del final del recreo.', 'Grave', 'No', 'No', 0, 0),
(284, '4089713', '2019-11-13', '4', 'Ponce de León Echevarria, Augusto', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Contesta continuamente al profesor, llevándole la contraria e interrumpiendo.', 'Leve', 'No', 'No', 0, 0),
(286, '3278125', '2019-11-13', '2', 'Román Vázquez, Álvaro Jesús', 'No traer el parte firmado en el plazo de una semana.\n', 'No trae firmado un parte que se le puso el 23/10. Ese parte ya era por no traer otro parte firmado.', 'Leve', 'No', 'No', 0, 0),
(287, '3323951', '2019-11-13', '2', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Ha reventado un zumo en el suelo.', 'Leve', 'No', 'No', 0, 0),
(360, '3530182', '2019-11-14', '3', 'Abad Ruiz, Federico', 'No disponer del material necesario para el aprendizaje.\n', 'A estas alturas de curso, sigue sin traer, después de dos partes, la partitura.', 'Leve', 'No', 'No', 0, 0),
(361, '4075071', '2019-11-15', '3', 'Muñoz Muñoz, María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No atiende, habla, se levanta sin permiso. Cuando le digo que voy a añadir en el parte su actitud, me contesta \"pon lo que tú quieras\" de forma cultiva.', 'Leve', 'No', 'No', 0, 0),
(362, '3914184', '2019-11-12', '4', 'Abad Ruiz, Federico', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Mientras el grupo de 1º ESO-C esperaba para salir, él ha apagado repetidamente la luz del vestíbulo de música.', 'Leve', 'No', 'No', 0, 0),
(363, '4129541', '2019-11-14', '4', 'Abad Ruiz, Federico', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No está haciendo las tareas que se le han encargado.', 'Leve', 'No', 'No', 0, 0),
(364, '4089903', '2019-11-18', '4', 'Sierra Martín, Francisco Manuel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No trabaja. no para de levantarse y de hablar.', 'Leve', 'No', 'No', 0, 0),
(365, '4115588', '2019-11-12', '4', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No deja de hablar en clase. Todos los días le tengo que llamar varias veces la atención.', 'Leve', 'No', 'No', 0, 0),
(366, '3825674', '2019-11-18', '4', 'Sánchez Luque, Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'El alumno no se sienta en el sitio que tiene asignado en el aula. Cuando se le amonesta para que se siente correctamente, engaña al profesor y no atiende a las indicaciones, haciendo una cuenta atrás y burlándose. Se pasa la hora hablando con el compañero.', 'Leve', 'No', 'No', 0, 0),
(367, '3828860', '2019-11-19', '5', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'A pesar de mis llamadas de atención no deja de interrumpir. Me dice \"anda ya\" cuando le digo que tiene un parte.', 'Leve', 'No', 'No', 0, 0),
(368, '3828387', '2019-11-11', '6', 'Polonio Pino, Cristóbal', 'Causar pequeños datos en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\n', 'Estando a 6ª hora de guardia, comienzo a dar la vuelta por el pasillo de la 1ª planta y cuando miro el aula 103 encuentro al alumno dando patadas a las sillas (en concreto, le observo dos veces).', 'Leve', 'No', 'No', 0, 0),
(369, '4111072', '2019-11-15', '4', 'García Castro, Rosa María', 'Utilizar aparatos grabadores o reproductores, cámaras de fotos y teléfonos móviles.\n', 'Durante la clase, Marta estaba usando el móvil, viendo un vídeo o fotografía o haciendo uan grabación o foto.', 'Leve', 'No', 'No', 0, 0),
(370, '3857570', '2019-11-15', '6', 'Sierra Martín, Francisco Manuel', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Acabo de llamarle la atención por hablar y reñirle y cuando me doy la vuelta sigue hablando con la compañera.', 'Leve', 'No', 'No', 0, 0),
(371, '3907317', '2019-11-20', '4', 'Muñoz Muñoz, María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'No trabaja en clase, lanza objetos a sus compañeros. Le digo que se cambie de sitio y contesta a gritos \"venga ya...\". Tarda mucho en cambiarse de sitio haciéndome perder el tiempo.', 'Leve', 'No', 'No', 0, 0),
(372, '4078381', '2019-11-12', '6', 'Núñez Granados, Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No deja de molestar en clase. Le tengo que llamar la atención todos los días y a pesar de eso, no mejora su conducta.', 'Leve', 'No', 'No', 0, 0),
(373, '3559956', '2019-11-13', '6', 'Abad Ruiz, Federico', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Lleva toda la clase de juerga, hablando e interrumpiendo constantemente.', 'Leve', 'No', 'No', 0, 0),
(374, '4160376', '2019-11-12', '6', 'Ayllón Rodríguez, Dolores', 'Agresión física a un miembro de la comunidad educativa.\n', 'Se pelea a puñetazos con un compañero.', 'Grave', 'No', 'No', 0, 0),
(375, '3901292', '2019-11-14', '6', 'Sánchez Luque, Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Está en clase lanzando trozos de gomas a otros compañeros. He advertido varias veces que se quedarán sin recreo de seguir haciéndolo. Cuando le amonesto por ello, me insulta: \"tienes un poco de retraso\". \"sigue máquina\"...en actitud desafiante y chulesca.', 'Leve', 'No', 'No', 0, 0),
(376, '3871838', '2019-11-14', '4', 'Muñoz Muñoz, María Jesús', 'Ignorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Se levanta de su sitio, no atiende a mis indicaciones. Le digo que si sigue así se irá al aula de convivencia y se burla de mí. Dice que no va a hacer las actividades.', 'Leve', 'No', 'No', 0, 0),
(377, '3871838', '2019-11-15', '6', 'Muñoz Muñoz, María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No atiende, habla, se levanta sin permiso, etc.', 'Leve', 'No', 'No', 0, 0),
(378, '3868418', '2019-11-13', '6', 'Ponce de León Echevarria, Augusto', 'Ignorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'No traer las tareas hechas en varias ocasiones. Responder al profesor de mala forma y a destiempo.', 'Leve', 'No', 'No', 0, 0),
(379, '4051799', '2019-11-12', '6', 'Ayllón Rodríguez, Dolores', 'Agresión física a un miembro de la comunidad educativa.\n', 'Agrede a un compañero resolviendo sus problemas a puñetazos.', 'Grave', 'No', 'No', 0, 0),
(380, '4051799', '2019-11-19', '6', 'López Galiot, Lidia', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Está todo el tiempo girándose hablando con el compañero. No hace caso a las llamadas de atención. ', 'Leve', 'No', 'No', 0, 0),
(381, '3517085', '2019-11-18', '6', 'Castro Luque, Agustín', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Ante la sospecha de que está haciendo ruidos para interrumpir la clase, el indico que se cambie de sitio, a lo que se niega.', 'Leve', 'No', 'No', 0, 0),
(382, '6172829', '2019-11-14', '6', 'Abad Ruiz, Federico', 'No disponer del material necesario para el aprendizaje.\n', 'Viene a clase siempre sin materiales, partitura y auriculares.', 'Leve', 'No', 'No', 0, 0),
(383, '3860095', '2019-11-18', '6', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Habla y molesta continuamente.', 'Leve', 'No', 'No', 0, 0),
(384, '3860095', '2019-11-18', '4', 'Muñoz Muñoz, Rosario', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Está continuamente charlando, haciendo \"gracias\" y dando la lata básicamente.', 'Leve', 'No', 'No', 0, 0),
(385, '3545854', '2019-11-20', '5', 'Lozano Luján, Rafael', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Cuando el profesor manda callar al grupo por el excesivo jaleo en el aula, Kevin se pone a emitir ruidos simulando una trompeta (dos veces).', 'Leve', 'No', 'No', 0, 0),
(386, '3545854', '2019-11-15', '6', 'Ruiz Gómez, Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'No deja de interrumpir en clase.', 'Leve', 'No', 'No', 0, 0),
(387, '3521235', '2019-11-15', '6', 'Luengo López, Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Llega tarde, se niega a trabajar y al no dejarle ir al baño, se va sin permiso.', 'Leve', 'No', 'No', 0, 0),
(388, '3565077', '2019-11-14', '6', 'Ramírez Oña, Verónica', 'Agresión física a un miembro de la comunidad educativa.\n', 'El alumno se ha abalanzado hacia un compañero, empujándolo. Según sus compañeros, el agredido antes lo ha insultado de manera reiterada.', 'Grave', 'No', 'No', 0, 0),
(389, '3815357', '2019-11-15', '6', 'Muñoz Muñoz, María Jesús', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Le escribí una nota en la agenda hace días y no me la ha traído aún firmada. La alumna está muy distraída en clase y habla mucho, por lo que no trabaja como debería.', 'Leve', 'No', 'No', 0, 0),
(390, '3515318', '2019-11-15', '6', 'Muñoz Muñoz, María Jesús', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Le escribí una nota en la agenda hace días y no me la ha traído aún. El alumno trabaja poco y habla mucho durante la clase.', 'Leve', 'No', 'No', 0, 0),
(391, '3516999', '2019-11-15', '6', 'Parejo Navarro, Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'El alumno se pone a silbar en un examen molestando a sus compañeros. Cuando lo miraba se callaba y cuando dejaba de hacerlo volvía a silbar. Falta de respeto hacia mí y sus compañeros en el examen.', 'Leve', 'No', 'No', 0, 0),
(392, '3516999', '2019-11-18', '6', 'Parejo Navarro, Francisco Javier', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Le entrego un parte que le puse el viernes a última hora y lo tira al suelo. Le digo que lo recoja o le pongo otro y me dice \"pues pónmelo\".', 'Leve', 'No', 'No', 0, 0),
(393, '3516999', '2019-11-13', '6', 'Luengo López, Juan Carlos', 'Cinco faltas injustificadas de puntualidad.\n', 'Llega tarde a clase en repetidas ocasiones.', 'Leve', 'No', 'No', 0, 0),
(394, '3529727', '2019-11-13', '6', 'Luengo López, Juan Carlos', 'Cinco faltas injustificadas de puntualidad.\n', 'Llega tarde a clase en repetidas ocasiones.', 'Leve', 'No', 'No', 0, 0),
(395, '3529727', '2019-11-14', 'Recreo', 'Abad Ruiz, Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'Durante el recreo se ha dedicado a mofarse del profesor de guardia, persistiendo pese a las advertencias.', 'Grave', 'No', 'No', 0, 0),
(396, '3530182', '2019-11-21', '6', 'Polonio Pino, Cristóbal', 'No guardar las debidas normas de seguridad establecidas para el uso de material o el funcionamiento de determinados aparatos eléctricos.\n', 'Cuando entro en el aula encuentro a cinco alumnos corriendo entre las mesas, jugando, con el consiguiente peligro y alboroto-desorden.', 'Leve', 'No', 'No', 0, 0),
(397, '3807358', '2019-11-21', '6', 'Polonio Pino, Cristóbal', 'No guardar las debidas normas de seguridad establecidas para el uso de material o el funcionamiento de determinados aparatos eléctricos.\n', 'Cuando entro en el aula encuentro a cinco alumnos corriendo entre las mesas, jugando, con el consiguiente peligro y alboroto-desorden.', 'Leve', 'No', 'No', 0, 0),
(398, '4117462', '2019-11-21', '6', 'Polonio Pino, Cristóbal', 'No guardar las debidas normas de seguridad establecidas para el uso de material o el funcionamiento de determinados aparatos eléctricos.\n', 'Cuando entro en el aula encuentro a cinco alumnos corriendo entre las mesas, jugando, con el consiguiente peligro y alboroto-desorden.', 'Leve', 'No', 'No', 0, 0),
(399, '4137158', '2019-11-21', '6', 'Polonio Pino, Cristóbal', 'No guardar las debidas normas de seguridad establecidas para el uso de material o el funcionamiento de determinados aparatos eléctricos.\n', 'Cuando entro en el aula encuentro a cinco alumnos corriendo entre las mesas, jugando, con el consiguiente peligro y alboroto-desorden.', 'Leve', 'No', 'No', 0, 0),
(400, '3836666', '2019-11-20', '6', 'Estévez Fernández, Noelia', 'Otras (contempladas en el P.C.)...\n', 'Óscar Escobar y Raúl Granados hacen una puesta de 50 €  en el centro. Además mienten al jefe de estudios diciéndole que los 50 € era un regalo de Óscar a Raúl por su cumpleaños.', 'Leve', 'No', 'No', 0, 0),
(401, '3828860', '2019-11-20', '6', 'Abad Ruiz, Federico', 'Estar fuera del aula entre horas sin permiso.\nExhibir el móvil en el centro escolar.\n', 'Se marcha del aula antes de que tenga permiso y además usa el teléfono móvil.', 'Leve', 'No', 'No', 0, 0),
(402, '3559956', '2019-11-20', '6', 'Estévez Fernández, Noelia', 'Otras (contempladas en el P.C.)...\n', 'Hace una puesta con Óscar de 50 € en el centro y miente al jefe de estudios diciéndole que era un regaldo de Óscar.', 'Leve', 'No', 'No', 0, 0),
