(404, '3529727', '2019-11-14', '2', 'Barroso Fernández, María Carmen', 'Cinco faltas injustificadas de puntualidad.\n', 'Se avisa con una anotación en la agenda, el pasado día 5 de noviembre, de los días con retraso del alumno (3, 8 y 31 de octubre; 5 de noviembre y hoy 14 de noviembre). Co0ntinúa con la misma actitud. Agenda sin firmar y son cinco faltas injustificadas de puntualidad. No trae el parte para firmar a clase (delegado).', 'Leve', 'No', 'No', 0, 0),
