(407, '3823312', '2019-11-15', '2', 'Romero García, Alejandro', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'En el recreo da un golpe a un compañero jugando al baloncesto.', 'Leve', 'No', 'No', 0, 0),
(408, '3562460', '2019-11-18', '2', 'Blanco Domínguez, Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Se niega a trabajar. Interrumpe cuando quiere y molesta. No deja de hacer la graciosa. No me deja dar clase cuando a ella le apetece.', 'Leve', 'No', 'No', 0, 0),
