(410, '3348606', '2019-11-14', '2', 'Blanco Domínguez, Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'No hace las correcciones que se le mandaron advirtiéndole que si no las hacía tendría parte. Dijo que no las iba a hacer y efectivamente no las ha hecho.', 'Leve', 'No', 'No', 0, 0),
