(414, '3858111', '2019-11-14', '2', 'Ramírez Oña, Verónica', 'Agresión física a un miembro de la comunidad educativa.\n', 'El alumno, según sus compañeros, ha comenzado a insultar a otro alumno, haciendo referencia a un aspecto físico, y al final han acabado llegando a las manos.', 'Grave', 'No', 'No', 0, 0),
