(420, '3322937', '2019-11-20', '4', 'García Muñoz, Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\n', 'Da golpes en la mesa del taller con un tubo.', 'Leve', 'No', 'No', 0, 0),
(421, '3278506', '2019-11-15', '3', 'Magarín Corvillo, Mª Lourdes', 'No guardar las debidas normas de seguridad establecidas para el uso de material o el funcionamiento de determinados aparatos eléctricos.\nOtras (contempladas en el P.C.)...\n', 'No responde a las órdenes de la profesora de guardia. Ni deja el balón ni obedece. Mala contestación de forma reiterada.', 'Leve', 'No', 'No', 0, 0),
(422, '3046334', '2019-11-14', '3', 'Coello Palomino, Francisco Javier', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Se le llama a mantener silencio en varias ocasiones haciendo caso omiso.', 'Leve', 'No', 'No', 0, 0),
(423, '2988764', '2019-11-14', '1', 'Jefatura de Estudios', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\n', 'El alumno llega tarde al Centro (8:27 h) y pretende acceder golpeando la puerta y violentando al ordenanza, que realizando su trabajo les estaba pidiendo explicaciones por el retraso en su entrada.', 'Grave', 'No', 'No', 0, 0),
(424, '2981593', '2019-11-19', '5', 'Sánchez Aguera, María Carmen', 'Otras (contempladas en el P.C.)...\n', 'Durante la clase de física y química se dedica a hacer ejercicios de tecnología. Se le llama la atención y pide autorización para ir al aseo, se le indica que no mientras que no trabaje en clase. Dice que le da igual que le ponga un parte y sale de clase al aseo sin autorización.', 'Leve', 'No', 'No', 0, 0),
(425, '3256233', '2019-11-15', '5', 'Romero García, Alejandro', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Habla constantemente mientras el profesor explica en clase. pone el pie encima de la mesa.', 'Leve', 'No', 'No', 0, 0),
(426, '3633887', '2019-11-15', '5', 'Camino Conde, María', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\n', 'Cuando empiezo la clase hace comentarios que están fuera de tono. Al llamarle la atención me contesta de manera chulesca y desafiante.', 'Leve', 'No', 'No', 0, 0),
(427, '2988184', '2019-11-18', '5', 'Castro Luque, Agustín', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'El alumno se encontraba en 3º C al comenzar la clase. Cuando le llamo para pedirle explicaciones hace caso omiso.', 'Leve', 'No', 'No', 0, 0),
(428, '3258084', '2019-11-19', '5', 'Coello Palomino, Francisco Javier', 'Ignorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'La alumna interrumpe con un insulto fuerte a gritos.', 'Leve', 'No', 'No', 0, 0),
(429, '4077396', '2019-11-15', '5', 'Ventura Fernández, Lourdes', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'El jueves a 4ª hora, participando en una actividad del departamento de inglés, no para de hablar. Se le llama la atención varias veces. Como no deja de molestar, la profesora le pide que se cambie de sitio. Se niega. se le pide que salga del SUM y se le explican las molestias que causa su conducta. Se le advierte que o cambia de sitio o va a jefatura. Responde: \"uhm, me lo estoy pensando\".', 'Leve', 'No', 'No', 0, 0),
(430, '3587288', '2019-11-12', '5', 'Coello Palomino, Francisco Javier', 'Ignorar las llamadas de atención del personal docente y no docente.\n', 'Se le ha pedido en varias ocasiones guardar silencio durante el examen y hace caso omiso.', 'Leve', 'No', 'No', 0, 0),
(431, '4089903', '2019-11-25', '', 'Antúnez Alperiz María Isabel', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'Ha dañado parte del montaje realizado por el día contra la violencia.', 'Grave', 'No', 'No', 0, 413),
(432, '3907317', '2019-11-22', '', 'Muñoz Muñoz María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No saca el material y dice que no va a hacer nada. Molesta.', 'Leve', 'No', 'Si', 0, 414),
(433, '4089903', '2019-11-25', '', 'Hernández Ovejero Ana Isabel', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'Arranca y se lleva parte de una instalación puesta para conmemorar el Día contra la Violencia de Género.', 'Grave', 'Si', 'No', 0, 415),
(434, '3517085', '2019-11-25', '', 'Antúnez Alperiz María Isabel', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'Le digo que a partir de ahora, si no trabaja le voy a  poner un parte, con lo que se levanta y se encara conmigo y al sentarse me dice gilipollas.', 'Grave', 'No', 'No', 0, 416),
(436, '3517647', '2019-11-25', '', 'Lara Ruiz Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nExhibir el móvil en el centro escolar.\r\n', 'Le llamo la atención y me contesta: \"No saco libro ni cuaderno\". No hace nada. Se levanta 4 veces sin permiso y recorre toda la clase para tirar un papel. Sigue contestando al ponerle el parte.', 'Leve', 'No', 'No', 0, 418),
(437, '3254483', '2019-11-25', '', 'Muñoz Muñoz María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'No hace caso de mis indicaciones. No guarda silencio, no trabaja nada, lanza un objeto a un compañero desde el final de la clase, etc.', 'Leve', 'Si', 'Si', 0, 419),
(438, '4077396', '2019-11-25', '', 'Román Vázquez Alvaró Jesús', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'Utiliza el móvil en clase.', 'Leve', 'No', 'No', 0, 420),
(440, '2988184', '2019-11-22', '', 'Huertas Fuentes Nicolás', 'Estar fuera del aula entre horas sin permiso.\r\nPerturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'Tras llamarle la atención e indicarle que se metiese en el aula, se encara con su profesora Lola Pérez, se le indica que baje a Jefatura y busca el enfrentamiento con comentarios como \"no eres nadie para decirme nada\", \"el centro tendría que explotar\", \"tendría que venir un colgado a prenderte fuego\".', 'Grave', 'No', 'Si', 0, 422),
(442, '3255985', '2019-11-26', '', 'Cruz Salido Pedro Javier', 'Estar fuera del aula entre horas sin permiso.\r\nPerturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncumplimiento de las correcciones impuestas.\r\n', 'Está en todos los cambios de clase fuera. A pesar de las llamadas de atención, sigue fuera, grita en los pasillos y empuja a Salvador León.', 'Grave', 'No', 'Si', 0, 424),
(445, '3363996', '2019-11-25', '', 'Muñoz Muñoz Rosario', 'Incumplimiento de las correcciones impuestas.\r\n', 'Estoy todo el rato mandándolo callar. Cuando lo saco fuera para charlar con él, me reta y se ríe. Al final de la clase he intentado que se disculpe y olvidar el parte, pero sigue \"riendo\"', 'Grave', 'No', 'No', 0, 427),
