(459, '3835978', '2019-11-25', '3', 'Antúnez Alperiz, María Isabel', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Mientras comentamos en clase la gravedad de lo sucedido con los paraguas, él comenta: \"pá qué ponen paraguas dentro del Instituto si dentro no llueve\". Muy adecuado a su grado de sensibilidad con el tema.', 'Leve', 'No', 'No', 0, 0),
