(465, '3875485', '2019-11-21', '3', 'Abad Ruiz, Federico', 'Estar fuera del aula entre horas sin permiso.\n', 'Junto con dos compañeros estaba en una zona de escaleras durante el recreo no permitido.', 'Leve', 'No', 'No', 0, 0),
