(467, '3543365', '2019-11-21', '3', 'Barroso Fernández, María Carmen', 'Reiteración de conductas contrarias a las normas de convivencia.\n', 'Después de mandar silencio, Sara contesta \"nadie me manda callar\". Transgresión de las normas de comportamiento en clase, no sólo no hace caso a las llamadas de atención de la profesora sino que además la remeda. Falta de respeto.', 'Grave', 'No', 'No', 0, 0),
