(478, '3316292', '2019-11-25', '4', 'Jefatura de Estudios', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'El conserje le señala que no puede estar en el hueco de la escalera y le contesta que no quiere irse, formas inapropiadas.', 'Leve', 'No', 'No', 0, 0),
(479, '2988184', '2019-11-22', '6', 'Cruz Salido, Pedro Javier', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\nIncumplimiento de las correcciones impuestas.\n', 'Está en todos los cambios de clase fuera. A pesar de ordenar el profesor que entre en clase, sigue fuera. Grita en los pasillos y se empuja mutuamente con Adrián Arévalo.  Hace el comentario \"voy a poner una bomba\".', 'Grave', 'No', 'No', 0, 0),
(480, '3363359', '2019-11-26', '', 'Hernández Ovejero Ana Isabel', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'Arranca parte de una instalación hecha en el Centro para conmemorar el día contra la Violencia de Género.', 'Grave', 'No', 'No', 0, 444),
(481, '2953371', '2019-11-25', '2', 'Muñoz Muñoz, Rosario', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'No hace nada en clase de inglés. Está continuamente vuelto hacia atrás charlando. Cuando le llamo la atención, me ha contestado: \"me vas a decir tú lo que tengo que hacer...\"', 'Leve', 'No', 'No', 0, 0),
(482, '3363359', '2019-11-25', '5', 'Pérez Ebrero, María Dolores', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\nExhibir el móvil en el centro escolar.\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\n', 'Se pasa gran parte de la hora de clase tumbado sobre la mesa, literalmente durmiendo. Despierta y echa mano del móvil para mirar la hora, se dirige a mí dicéndome: \"cucha, la víctima\".', 'Leve', 'No', 'No', 0, 0),
(483, '3033134', '2019-11-27', '', 'Muñoz Muñoz María Jesús', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'El alumno contesta de forma irrespetuosa continuamente, en tono de burla e ironía. Se ríe durante las clases, si se le llama la atención contesta de forma altiva, se sienta donde quiere sin permiso, etc', 'Grave', 'No', 'No', 0, 445),
(484, '2967773', '2019-11-28', '', 'Coello Palomino Francisco Javier', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'El alumno está utilizando el móvil en clase.', 'Leve', 'No', 'No', 0, 446),
(485, '3913818', '2019-11-27', '', 'Blanco Domínguez Guillermo', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'Se le llama la atención por no parar de hablar. No hace caso y dice que no se va a callar. Está un rato profiriendo gritos racistas a un compañero llamándole inmigrante de manera repetitiva. Sigue sin hacer caso y dice que le da igual tener parte. Sigue interrumpiendo y molestando.', 'Grave', 'No', 'No', 0, 447),
(486, '3348606', '2019-11-28', '', 'Barroso Fernández Mª Carmen', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'En clase, de \"broma\" con el compás le quiere pinchar  la oreja del compañero.', 'Leve', 'Si', 'Si', 0, 448),
(488, '3363359', '2019-11-27', '', 'Pérez Ebrero María Dolores', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nExhibir el móvil en el centro escolar.\r\n', 'Se pasa gran parte de la hora de clase tumbado sobre la mesa, literalmente durmiendo. Despierta y echa mano del móvil para ver la hora.\r\nSe dirige a mí diciendo: \"Cucha, la víctima...\"', 'Leve', 'No', 'No', 0, 450),
(489, '3363359', '2019-11-28', '', 'Pérez Ebrero María Dolores', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nExhibir el móvil en el centro escolar.\r\n', 'Se pasa gran parte de la hora de clase tumbado sobre la mesa, literalmente durmiendo. Despierta y echa mano del móvil para mirar la hora.\r\nSe dirige a mí diciendo \"cucha, la víctima...\"', 'Leve', 'No', 'No', 0, 451),
(490, '2988184', '2019-10-18', '6', 'Ventura Fernández, Lourdes', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualuqier miembro de la comunidad escolar.\nReiteración de conductas contrarias a las normas de convivencia.\n', 'Injurias y ofensas hacia la profesora.', 'Grave', 'No', 'No', 0, 0),
(491, '4200865', '2019-11-28', '', 'Abad Ruiz Federico', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Ya le avisé que no debe usar el piano en modo juego pero sigue haciéndolo', 'Leve', 'No', 'No', 0, 452),
(492, '4085662', '2019-11-28', '', 'Abad Ruiz Federico', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\nIncumplimiento de las correcciones impuestas.\r\n', 'Desde la ventana del aula ha llamado \"mari...\" a un compañero. Lo llamo para que venga a mi aula a ponerle el parte el parte pero no baja.', 'Grave', 'No', 'No', 0, 453),
(493, '3914184', '2019-11-29', '', 'Quintana Ramos José Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No para de interrumpir, hablar alto, a pesar de la advertencias', 'Leve', 'No', 'Si', 0, 454),
(494, '3901292', '2019-11-29', '', 'Cortes Sánchez Ana María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Falta total de educación, haciendo ruidos continuamente e interrumpiendo la clase.', 'Leve', 'No', 'Si', 0, 455),
(495, '3825674', '2019-11-28', '', 'Cortes Sánchez Ana María', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Está interrumpiendo la clase continuamente. Falta total de educación, contestando continuamente.', 'Leve', 'Si', 'Si', 0, 456),
(496, '3913818', '2019-11-28', '', 'García Muñoz Marcos', 'No traer el parte firmado en el plazo de una semana.\r\n', 'No traer el parte firmado del día 14 de noviembre.', 'Leve', 'No', 'No', 0, 457),
(497, '3348606', '2019-11-28', '', 'Blanco Domínguez Guillermo', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No para de hablar, interrumpe continuamente a diario. Se pone a mandar silencio sin que nadie se lo pida. Silba en medio de la clase para pedir que se callen los demás.', 'Leve', 'Si', 'No', 0, 458),
(498, '3860095', '2019-11-28', '', 'García Muñoz Marcos', 'No traer el parte firmado en el plazo de una semana.\r\n', 'No ha traído el parte firmado del día 14 de noviembre.', 'Leve', 'No', 'No', 0, 459),
(499, '3871838', '2019-11-29', '', 'Sierra Martín Francisco Manuel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Después de media hora de clase no ha abierto la mochila. Le digo reiteradamente que se calle y no obedece.', 'Leve', 'Si', 'Si', 0, 460),
(500, '2340925', '2019-11-29', '', 'Huertas Fuentes Nicolás', 'Otros. Falta grave\r\n', 'REALIZA MANIOBRAS PELIGROSAS CON ELEMENTOS QUE PUEDEN SER DAÑINOS.\r\nEntro en el Aula de pastelería y me encuentro a Pedro Fernández empujando a la alumna Isabel Estela contra la estantería  jugando. Testigo MariNieves.\r\nGRAVE: Reiteración', 'Grave', 'No', 'No', 0, 461),
(501, '3871838', '2019-11-29', '', 'Muñoz Muñoz María Jesús', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'No se sienta en su sitio, molesta a su compañero dándole patadas. Me contesta de forma irrespetuosa (\"estoy hasta la polla\"). Dice que romperá el parte.', 'Leve', 'Si', 'Si', 0, 462),
(502, '3278125', '2019-12-02', '', 'Ramírez Oña Verónica', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'el alumno no hace nada, solo se dedica a charlar', 'Leve', 'No', 'No', 0, 463),
(503, '3067897', '2019-12-02', '', 'Ramírez Oña Verónica', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'el alumno no hace nada, le comento que le voy a poner un parte por ello y me contesta de mala manera faltándome al respeto', 'Leve', 'Si', 'No', 0, 464),
(504, '2956938', '2019-12-02', '', 'López Galiot Lidia', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'Estaba utilizando el móvil', 'Leve', 'Si', 'No', 0, 465),
(505, '3914184', '2019-12-02', '', 'Castro Luque Agustín', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Grita y alborota', 'Leve', 'No', 'Si', 0, 466),
(506, '3371476', '2019-12-02', '', 'Luengo López Juan Carlos', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'La alumna llega 15 minutos tarde, le digo que tiene retraso y contesta que no tiene ninguno. Se va a su sitio haciendo un comentario que no escucho. Cuando le digo que lo repita contesta: \"Deberías estar más atento\"', 'Grave', 'No', 'Si', 0, 467),
(507, '3517647', '2019-12-02', '', 'Lara Ruiz Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Le he avisado desde que entré en clase pero no para de hablar, levantarse y alterar la clase. Contesta de malos modales cuando le llamo la atención', 'Leve', 'Si', 'Si', 0, 468),
(508, '3903064', '2019-12-02', '', 'Sánchez Luque Rafael', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'Está lanzando gomas a un compañero, se le amonesta y no deja de hacerlo.El profesor se equivoca al llamr a un compañero y él le insulta llamándole \"tonto\".Manipula el tecladodel ordenador sin permiso.', 'Grave', 'Si', 'Si', 0, 469),
(509, '3046334', '2019-12-02', '', 'Lara Ruiz Ana', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Durante un examen pillo a Sergio hablando e intentando hablar con la compañera de delante,con la intención de copiarse.Lo veo hasta en 2 ocasiones en esa actitud, lo aviso de que como vuelva a verlo\r\nle quito el xamen y empieza acontestrame y dice cosas como \" Os creeis que por ser profesores teneis má derechos...\"', 'Leve', 'Si', 'No', 0, 470),
(510, '3914184', '2019-12-03', '', 'Quintana Ramos José Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Silba en clase', 'Leve', 'No', 'No', 0, 471),
(511, '4200865', '2019-12-03', '', 'Hernández Ovejero Ana Isabel', 'Causar pequeños daños en las instalaciones, materiales o documentos del centro (incluidos los partes de asistencia o de incidencia), o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'Rompe el cristal de un extintor.', 'Leve', 'No', 'No', 0, 472);
INSERT INTO `disciplina` (`id_disc`, `NIE`, `fecha`, `hora`, `profesor`, `motivos`, `descripcion`, `tipo`, `revisado`, `expulsion`, `id_medidas`, `numero`) VALUES
(512, '3827750', '2019-12-03', '', 'Muñoz Muñoz María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nCausar pequeños daños en las instalaciones, materiales o documentos del centro (incluidos los partes de asistencia o de incidencia), o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'No sigue mis indicaciones, habla, molesta, rompe el bolígrafo de un compañero', 'Leve', 'Si', 'Si', 0, 473),
(513, '4135049', '2019-12-03', '', 'Antúnez Alperiz María Isabel', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Se enfada con  un compañero mientras hace una ficha, le tira la mochila a la papelera, le quita las gafas y se las tira al pasillo. Este compañero miente, no es propio de él', 'Leve', 'No', 'No', 0, 474),
(514, '3251477', '2019-12-03', '', 'Muñoz Muñoz María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No deja de hablar durante la explicaciones.Se pasa gran parte de la hora hablando con el compañero y mirando para atrás.', 'Leve', 'No', 'No', 0, 475),
(515, '3515318', '2019-12-03', '', 'Muñoz Muñoz María Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No deja de hablar y de molestar durante las explicaciones.', 'Leve', 'No', 'No', 0, 476),
(516, '3255985', '2019-12-03', '', 'Muñoz Muñoz María Jesús', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'Utiliza el teléfono móvil en el aula de convivencia, durante su expulsión de dos días.', 'Leve', 'No', 'No', 0, 477),
(517, '3914184', '2019-12-03', '', 'Sánchez Luque Rafael', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\nUtilizar los ordenadores del aula sin permiso o de manera indebida.\r\n', 'ha puesto en el ordenador del aula el cara al sol, y tenía la pizarra digital encendida. Está usando el móvil en clase, mientras relleno el parte está cantando el inicio del cara al sol', 'Leve', 'No', 'Si', 0, 478),
(518, '3848291', '2019-12-04', '', 'Román Vázquez Alvaró Jesús', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se ríe cada vez que se le llama la atención a un compañero. Le había avisado que si lo seguía haciendo le pondría un parte.', 'Leve', 'Si', 'No', 0, 479),
(519, '3562460', '2019-12-04', '', 'Lara Ruiz Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Estar fuera del aula prácticamente toda la 4ª hora de clase. He tenido que avisar a los profesores de guardia para que lo busquen. Llega cuando falta 5 minutos para acabar la clase.', 'Leve', 'No', 'No', 0, 480),
(520, '3371476', '2019-12-04', '', 'Lara Ruiz Ana', 'Otros. Falta grave\r\n', 'A 4ª hora del martes 3 de diciembre: Raquel ha estado fuera de clase prácticamente toda la hora, sin permiso de ningún profesor. Tengo que avisar a los profesores de guardia para que la busquen. Llega a clase cuando faltan 10 minutos para que termine. Cuando llega monta un \"circo\", el resto de los alumnos están haciendo un examen y lógicamente su comportamiento impide que terminen el examen con tr', 'Grave', 'No', 'No', 0, 481),
(521, '3562460', '2019-12-04', '', 'Barroso Fernández Mª Carmen', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Después de reiteradas amonestaciones de pedir silencio, la alumna habla a distancia con otra compañera, haciendo caso omiso de la profesora.', 'Leve', 'No', 'Si', 0, 482),
(522, '3067897', '2019-12-04', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Entra tarde a clase sin pedir permiso. Se sienta con la espalda en la pared. Le digo que se siente bien y no hace caso. Le pido que se cambie de sitio y no lo hace. Contesta de mala forma.', 'Leve', 'Si', 'Si', 0, 483),
(523, '3903064', '2019-12-04', '', 'Núñez Granados Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No se sienta en su sitio, no me deja comenzar la clase. Cuando se sienta, lo hace en el sitio de un compañero.', 'Leve', 'Si', 'Si', 0, 484),
(524, '3516999', '2019-12-04', '', 'Parejo Navarro Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Le pido que me dé el cuaderno para que lo corrija y el alumno no me lo da. Lleva varios días en los que intenta no hacer lo que se le pide y se lo tengo que pedir en numerosas ocasiones para que lo haga.', 'Leve', 'No', 'No', 0, 485),
(525, '3903064', '2019-12-04', '', 'Antúnez Alperiz María Isabel', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nUtilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'Se encuentra en la escalera durante las clases con el móvil. Le digo que se vaya a clase y se niega, dice que se espera a que toque el timbre. Le vuelvo a decir que no puede estar en el pasillo y se niega a entrar en clase.', 'Leve', 'Si', 'No', 0, 486),
(526, '3898453', '2019-12-04', '', 'Blanco Domínguez Guillermo', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'Un alumno de otra clase se para a observar al grupo mientras hacen Ed. Física. Mª del Mar interrumpe la clase y se dirige a él de forma grosera gritándole delante de todos: \"¿Y a ti qué? ¿QUE TE PICA LA POLLA NENE?', 'Grave', 'Si', 'No', 0, 487),
(527, '3240055', '2019-12-04', '', 'Alcázar González Jorge', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No sacar el material, no trabajar en clase y no hacer caso del profesor', 'Leve', 'No', 'Si', 0, 488),
(528, '3067897', '2019-12-04', '', 'Alcázar González Jorge', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No sacar el material, no trabajar en clase y no hacer caso del profesor', 'Leve', 'Si', 'Si', 0, 489),
(530, '3275377', '2019-12-04', '', 'Blanco Pérez Manuel', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'usa el móvil en clase', 'Leve', 'No', 'No', 0, 491),
(531, '3266528', '2019-12-04', '', 'Muñoz Muñoz María Jesús', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'usa el móvil en clase', 'Leve', 'No', 'No', 0, 492),
(532, '3278125', '2019-12-05', '', 'Barroso Fernández Mª Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Llega más de media hora tarde.No saca el material ni se pone a trabajar tras varias amonestaciones y varios avisos de la profesora.', 'Leve', 'No', 'Si', 0, 493),
(533, '4084731', '2019-12-05', '', 'Abad Ruiz Federico', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Lleva 33 negativos. No hace nada; y además se dedia a charlar. Siempre está de lado', 'Leve', 'No', 'No', 0, 494),
(534, '3871838', '2019-12-05', '', 'Abad Ruiz Federico', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Se pasa toda la clase alborotando, y le he avisado varias veces ya. Se pone a saltar y arranca el atril del piano.', 'Leve', 'No', 'No', 0, 495),
(535, '4089903', '2019-12-05', '', 'Abad Ruiz Federico', 'Estar fuera del aula entre horas sin permiso.\r\nComer o beber en clase.\r\n', 'Se sale de clase antes de que le dé permiso y mastica chicle.', 'Leve', 'No', 'No', 0, 496),
(536, '3067897', '2019-12-05', '', 'Belmonte Pérez Antonio José', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No trabaja nada en clase , después de estar insistiéndole constantemente para que trabajara, incluso se niega a abrir la mochila.\r\nEste parte lo ha puesto Enrique Ayllon que comparte horario con Antonio Belmonte pero no aparece en el listado de profesores del programa.', 'Leve', 'Si', 'No', 0, 497),
(537, '4078714', '2019-12-05', '', 'Polonio Pino Cristóbal', 'Agresión física a un miembro de la comunidad educativa.\r\n', 'Agresión a un alumno durante el recreo del día 4/12/2019, le propinó dos puñetazos en el estómago -', 'Grave', 'No', 'No', 0, 498),
(538, '3903064', '2019-12-04', '', 'Domingo del Bosque Mª del Carmen', 'Incumplimiento de las correcciones impuestas.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'El alumno se niega a acompañarme al despacho de Dirección: grosero, desafiante y agresivo.', 'Grave', 'No', 'No', 0, 499),
(539, '3562460', '2019-12-05', '', 'Muñoz Muñoz Rosario', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No colabora, charla continuamente e interrumpe.', 'Leve', 'No', 'No', 0, 500),
