(550, '3828387', '2019-12-10', '', 'Sánchez Luque Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nNo disponer del material necesario para su aprendizaje.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'No trae el material necesario. Se levanta sin permiso, ignora las indicaciones que se le hacen y discute con el profesor en actitud chulesca, quedándose siempre por encima del profesor.', 'Leve', 'No', 'No', 0, 511),
(551, '3825674', '2019-12-10', '', 'Sánchez Luque Rafael', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\nPerjudicar gravemente el desarrollo de las actividades del centro.\r\nIncumplimiento de las correcciones impuestas.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'el alumno interrumpe constantemente las explicaciones del profesor. cuando se le amonesta entra en discusión con el profesor con la intención de seguir molestando. arroja papeles al suelo y se tira de la silla. su actitudes siempre la misma, incluye la burla cada vez que el profesor le dice algo', 'Grave', 'Si', 'No', 0, 512),
