(559, '4078714', '2019-12-10', '', 'Sánchez Luque Rafael', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Mientras el profesor está llamando la atención de otro compañero, Pablo está riéndose con total descaro del profesor. Cuando se le amonesta por su actitud se pone en actitud chulesca y reconoce que se está riendo de mí.', 'Leve', 'No', 'No', 0, 520),
