(605, '4089903', '2019-12-19', '', 'Camino Conde María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Hacer ruido constantemente al empezar la clase. cuando le llamo la atención se lo toma a risa y me habla en un tono muy poco respetuoso', 'Leve', 'No', 'Si', 0, 566),
(606, '4089903', '2019-12-19', '', 'Camino Conde María', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Después de ponerle un parte e irse al aula de convivencia da un portazo fuerte al salir.', 'Leve', 'No', 'No', 0, 567),
(607, '3907317', '2019-12-19', '', 'Abad Ruiz Federico', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Se marcha al aseo sin pedir permiso.', 'Leve', 'No', 'No', 0, 568),
(608, '3275377', '2019-12-20', '', 'Ruiz Gómez Clara Eugenia', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'Utiliza el móvil en clase', 'Leve', 'No', 'No', 0, 569),
(609, '3517085', '2019-12-20', '', 'Sierra Martín Francisco Manuel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Se niega a copiar. No tiene material y dice que no pide prestado porque hoy no \"ponen\" partes', 'Leve', 'No', 'Si', 0, 570),
(610, '3901292', '2020-01-08', '', 'Núñez Granados Miguel Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No deja de interrumpir en clase hablando y bromeando a pesar de mis llamadas de atención', 'Leve', 'Si', 'Si', 0, 571),
(611, '3914184', '2020-01-08', '', 'Castro Luque Agustín', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Al llamarle la atención por su conducta me responde textualmente: \"Que te güires\". Al salir de clase le da repetidamente al interruptor de la luz.', 'Leve', 'No', 'Si', 0, 572),
(612, '6668755', '2020-01-08', '', 'Guzmán Porras Expectación', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\nPerjudicar gravemente el desarrollo de las actividades del centro.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'Falta gravemente al respeto: \"ésta no se calla la puta boca\" (yo), desafiando y diciendo que el profesor anterior se va a enterar.', 'Grave', 'No', 'Si', 0, 573),
(613, '3311534', '2020-01-08', '', 'Castro Luque Agustín', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Estaba intentando decir algo cuando el alumno se pone a hablar bastante alto. Al decirle que se callase se ha golpeado con la cabeza en el cristal de la ventana.', 'Leve', 'No', 'No', 0, 574),
(614, '3517085', '2019-12-20', '', 'Sierra Martín Francisco Manuel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Se niega a copiar. No trae el material y dice que no pide prestado porque hoy no \"ponen\" partes.', 'Leve', 'No', 'No', 0, 575),
(615, '3828387', '2020-01-08', '', 'del Pino Cepelledo Antonio', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Desobedece las instrucciones del profesor, de forma reiterada. Incumple la instrucción de cambio de sitio en el aula', 'Leve', 'No', 'No', 0, 576),
(616, '3914184', '2020-01-09', '', 'Castro Luque Agustín', 'Reiteración de conductas contrarias a las normas de convivencia.\r\n', 'Hace todo lo posible para molestar. Grita y se levanta para apagar la luz...', 'Grave', 'No', 'No', 0, 577),
(617, '4117462', '2020-01-09', '', 'Polonio Pino Cristóbal', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'El lunes 16 de diciembre, el alumno en cuestión llama \"puta\" a una compañera de clase, existiendo testigos de dicha actuación y sin haber justificación alguna para ello, que tampoco hubiera sido justificación.', 'Leve', 'No', 'Si', 0, 578),
(618, '3903064', '2020-01-09', '', 'Blanco Domínguez Guillermo', 'Ignorar las llamadas de atención del personal docente y no docente.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'Le indico que tenemos que activar la cuenta de Classroom para poder trabajar este trimestre y me responde burlándose de mi. Le llamo para que se acerque y explicárselo despacio y me ignora repetidamente. Le cojo suavemente del brazo para que me escuche y se vuelve amenazándome:\"como me toques, te voy a dar\". Viene la jefa de estudios a por él porque no hace caso a nada.', 'Grave', 'No', 'Si', 0, 579),
(619, '3562460', '2020-01-09', '', 'Lara Ruiz Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Habla, se da la vuelta y cuando le llamo la atención me dice que no le chille.', 'Leve', 'Si', 'Si', 0, 580),
(620, '3914184', '2020-01-09', '', 'Blanco Domínguez Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Le llamo continuamente la atención por estar siempre de espaldas y no parar de charlar. Se levanta cuando quiere, interrumpe cuando quiere y sigue siempre de espaldas a la pizarra. No hace caso a nada. Sólo interrumpir y distraer a los compañeros.', 'Leve', 'No', 'Si', 0, 581),
(621, '3371476', '2020-01-09', '', 'Lara Ruiz Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No para de hablar ni de darse la vuelta molestando a los compañeros. No hace caso a las llamadas de atención y no tiene ninguna intención de cambiar de actitud.', 'Leve', 'Si', 'Si', 0, 582),
(622, '3914184', '2020-01-09', '', 'Abad Ruiz Federico', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Desde que entra en clase no para de incordia. Lo cambio de sitio y mantiene la misma actitud', 'Leve', 'No', 'Si', 0, 583),
(623, '4200865', '2020-01-09', '', 'Sánchez Luque Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nComer o beber en clase.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro d', 'Está comiendo chupa-chups en clase. Habla con los compañeros, interrumpe, le amonesto verbalmente y al segundo está lanzando objetos a una compañera.  Cuando se marcha me dice \"adiós guapo\".', 'Grave', 'No', 'Si', 0, 584),
(624, '3914184', '2020-01-09', '', 'Sánchez Luque Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\nIncumplimiento de las correcciones impuestas.\r\n', 'No saca el material de clase. Molesta, interrumpe, lanza objetos y me llama \"guapo\", me chulea cuando le amonesto verbalmente y se niega a irse del aula cuando le expulso. Se burla de mí mientras sale.', 'Grave', 'No', 'Si', 0, 585),
(625, '6668755', '2020-01-09', '', 'Barroso Fernández Mª Carmen', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Realiza gestos con la mano (obscenos) a otro compañero.', 'Leve', 'No', 'Si', 0, 586),
(626, '3903064', '2020-01-09', '', 'Abad Ruiz Federico', 'Incumplimiento de las correcciones impuestas.\r\n', 'Durante la 3a hora se ha metido en una clase que no le correspondía. En el recreo hace prácticas arriesgadas. Se le convoca a jefatura pero se niega', 'Grave', 'No', 'No', 0, 587),
(627, '3914184', '2020-01-09', '', 'Abad Ruiz Federico', 'Incumplimiento de las correcciones impuestas.\r\n', 'En el recreo, se dedica a hacer prácticas de riesgo en las escaleras y barandilla. Se le convoca a jefatura pero se niega a ir.', 'Grave', 'No', 'No', 0, 588),
(628, '4200865', '2020-01-09', '', 'Abad Ruiz Federico', 'Tirar objetos, papeles o basura al suelo en cualquier dependencia del centro.\r\n', 'Se ha encontrado en el patio de recreo el envoltorio de su bocadillo tirado en el suelo.', 'Leve', 'No', 'No', 0, 589),
(629, '3907317', '2020-01-10', '', 'Muñoz Muñoz María Jesús', 'Ignorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'No trabaja, habla y molesta continuamente. Llama \"pija\" a una compañera en mitad de clase y a voces.', 'Leve', 'No', 'No', 0, 590),
(630, '3828387', '2020-01-10', '', 'Polonio Pino Cristóbal', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'Rompe un parte de incidencias que le ha sido puesto por el tutor', 'Grave', 'No', 'No', 0, 591),
(631, '3828387', '2020-01-10', '', 'Polonio Pino Cristóbal', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nNo disponer del material necesario para su aprendizaje.\r\n', 'Iniciada la clase, el alumno permancece impasivo sin sacar material alguno.Cuando se le requiere que lo haga se niega a hacerlo y continua con la misma actitud', 'Leve', 'No', 'No', 0, 592),
(632, '3240055', '2020-01-10', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'El alumno no trabaja en clase y además está charlando con un compañero del final del aula en repetidas ocasiones', 'Leve', 'No', 'No', 0, 593),
(633, '3278125', '2020-01-10', '', 'Parejo Navarro Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Ela lumno no hace absolutamete nada, ni saca el libro de texto ni hace las actividades que se le mandan.', 'Leve', 'No', 'No', 0, 594),
(634, '6668755', '2020-01-10', '', 'Luengo López Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Molesta en clase y se cambia de sitio sin permiso. No atiende a las llamadas de atención.', 'Leve', 'No', 'Si', 0, 595),
(635, '3255863', '2020-01-10', '', 'Luengo López Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se dedica a dar voces cuando escribo en la pizarra.', 'Leve', 'No', 'Si', 0, 596),
(636, '3363996', '2020-01-10', '', 'Ruiz Gómez Clara Eugenia', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'La alumna se niega a copiar una serie de ideas fundamentales dadas por la profesora.', 'Leve', 'No', 'No', 0, 597),
(637, '3903064', '2020-01-10', '', 'Polonio Pino Cristóbal', 'Perjudicar gravemente el desarrollo de las actividades del centro.\r\n', 'El alumno permanece en un aula que no es la suya y cuando se le pide que salga, se niega a hacerlo.', 'Grave', 'No', 'No', 0, 598),
(638, '3903064', '2020-01-10', '', 'Polonio Pino Cristóbal', 'Incumplimiento de las correcciones impuestas.\r\n', 'Tras advertirle en varias ocasiones de su actitud, continúa desafiando al profesor, tomándole a guasa y pidiéndole más partes.', 'Grave', 'No', 'No', 0, 599),
(639, '3903064', '2020-01-10', '', 'Polonio Pino Cristóbal', 'Reiteración de conductas contrarias a las normas de convivencia.\r\n', 'Tras los dos partes anteriores, el alumno continúa desafiando al profesor, no siguiendo las instrucciones dadas, dando voces, jugando con las ventanas, etc.', 'Grave', 'No', 'No', 0, 600),
(640, '3903064', '2020-01-10', '', 'Polonio Pino Cristóbal', 'Incumplimiento de las correcciones impuestas.\r\n', 'Cuando ante la situación, el grupo cambia de aula y se le indica que se quede con el profesor de guardia -redactando estos partes- el chico se marcha con el grupo -que no es el suyo- a la otra aula.', 'Grave', 'No', 'No', 0, 601),
(641, '3903064', '2020-01-10', '', 'Polonio Pino Cristóbal', 'Perjudicar gravemente el desarrollo de las actividades del centro.\r\nIncumplimiento de las correcciones impuestas.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'Tras entregarle los cuatro partes, el alumno exclama ¡Qué guapo!, Ponme otro; razón por la que le pongo el 5º parte.', 'Grave', 'No', 'No', 0, 602),
(642, '3903064', '2020-01-10', '', 'Cruz Salido Pedro Javier', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'El alumno se encara con el profesor de forma violenta y gritándole que le diera el balón.', 'Grave', 'No', 'No', 0, 603),
(643, '3898453', '2020-01-10', '', 'Luengo López Juan Carlos', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Se niega a cambiarse de sitio y ponerse donde le corresponde según la cuadrícula de la tutora a pesar de amenazarla con expulsarla de clase.', 'Leve', 'No', 'Si', 0, 604),
(644, '3371476', '2020-01-10', '', 'Luengo López Juan Carlos', 'Ignorar las llamadas de atención del personal docente y no docente.\r\nNo traer el parte firmado en el plazo de una semana.\r\n', 'No deja de molestar desde que comienza la clase. Cuando le regaño responde que \"se enrolla mas que una persiana\".', 'Leve', 'No', 'Si', 0, 605),
(645, '3828387', '2020-01-10', '', 'Polonio Pino Cristóbal', 'Reiteración de conductas contrarias a las normas de convivencia.\r\n', 'Vuelve a desobedecer reiteradamente al profesor diciendo que no le da la gana hacer lo que se le manda.', 'Grave', 'No', 'Si', 0, 606),
(646, '6668755', '2020-01-10', '', 'Luengo López Juan Carlos', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'Me llama \"hijo de puta\" al salir del aula cuando ha sido expulsado de la misma por mal comportamiento', 'Grave', 'No', 'No', 0, 607),
(647, '3278125', '2020-01-13', '', 'Barroso Fernández Mª Carmen', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'El alumno no trabaja en clase normalmente ni trae materiales y hoy era la recuperación del primer trimestre. No trae agenda para comunicar a la familia que no entrega ninguna lámina.', 'Leve', 'No', 'No', 0, 608),
(648, '3860095', '2020-01-13', '', 'Barroso Fernández Mª Carmen', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nNo disponer del material necesario para su aprendizaje.\r\n', 'De manera reiterativa no trae materiales a clase, el día anterior se le da la lámina, hoy continuamos con ella, pero no la trae. Se le da por segunda vez la lámina (espero no la pierda) y no realiza recuperación de primera evaluación (nada).', 'Leve', 'Si', 'No', 0, 609),
(649, '3371476', '2020-01-09', '', 'Lara Ruiz Ana', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nCinco faltas injustificadas de puntualidad.\r\n', 'No para de hablar ni de darse la vuelta molestando a os compañeros. N0 hace caso a las llamadas de atención y no tiene ninguna intención de cambiar de actitud', 'Leve', 'No', 'No', 0, 610),
(650, '3898453', '2020-01-13', '', 'Muñoz Muñoz Rosario', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Le he pedido a la alumna hasta tres veces que s cambie de sitio y no ha querido', 'Leve', 'No', 'Si', 0, 611),
(651, '4200865', '2020-01-13', '', 'Hernández Ovejero Ana Isabel', 'Actuaciones perjudiciales para la salud y la integridad personal de los miembros de la comunidad educativa, o la incitación a las mismas. Consumo de alcohol o drogas.\r\n', 'Se echan desodorante y prenden fuego con el consiguiente peligro para ellos y para el centro', 'Grave', 'No', 'No', 0, 612);
