(654, '3860095', '2020-01-13', '', 'Toledano Rubio Miguel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No deja de reírse y molestar a pesar de los reiteradas llamadas del profesor', 'Leve', 'No', 'No', 0, 615),
(655, '4089903', '2020-01-13', '', 'Sierra Martín Francisco Manuel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Se niega a copiar lo dicho en clase', 'Leve', 'No', 'Si', 0, 616),
(656, '3828387', '2020-01-13', '', 'Sierra Martín Francisco Manuel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Se niega a copiar lo que dicto en clase', 'Leve', 'No', 'Si', 0, 617),
(657, '3562460', '2020-01-13', '', 'Blanco Domínguez Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Después de llamarle varias veces la atención sigue sintrabajar y al final acaba diciéndome \" Que no tengo ganas de hacer nada ,tío, déjame en paz ya..', 'Leve', 'No', 'Si', 0, 618),
(658, '3914184', '2020-01-14', '', 'Blanco Domínguez Guillermo', 'Agresión física a un miembro de la comunidad educativa.\r\n', 'con el canuto de un bolígrafo le tira una bolita de papel que le da en la cara', 'Grave', 'No', 'Si', 0, 619),
(659, '3516867', '2020-01-14', '', 'Reyes Amil José', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'interrumpe constantemente la clase, no hace caso a mis indicaciones. propongo una tarea y se echa a dormir en la mesa', 'Leve', 'Si', 'Si', 0, 620),
(660, '3545854', '2020-01-14', '', 'del Pino Cepelledo Antonio', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'tanto carlota como kevin se molestan mutuamente, interrumpiendo la clase', 'Leve', 'No', 'No', 0, 621),
(661, '3814625', '2020-01-14', '', 'del Pino Cepelledo Antonio', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'tanto carlota como kevin se molestan mutuamente, interrumpiendo la clase', 'Leve', 'No', 'No', 0, 622),
(662, '3914184', '2020-01-14', '', 'Sánchez Luque Rafael', 'Estar fuera del aula entre horas sin permiso.\r\nPerturbar el normal desarrollo de las actividades de clase o del centro.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'llega tarde, entra en el aula golpeando la puerta, burlándose del profesor como siempre', 'Leve', 'No', 'Si', 0, 623),
(663, '3517085', '2020-01-14', '', 'Sánchez Luque Rafael', 'Estar fuera del aula entre horas sin permiso.\r\nPerturbar el normal desarrollo de las actividades de clase o del centro.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'al expulsar del aula yerai me indica con su habitual actitud prepotente que se quiere ir con él expulsado', 'Leve', 'No', 'Si', 0, 624),
(664, '3371476', '2020-01-14', '', 'Jurado Gómez Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'no hace caso ni trabaja, llamadas múltiples de atención y continuamente molestando', 'Leve', 'No', 'Si', 0, 625),
(665, '3562460', '2020-01-14', '', 'Jurado Gómez Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'tras llamarle varias veces la atención y cambiarla de sitio, continúa interrumpiendo la clase', 'Leve', 'No', 'Si', 0, 626),
(666, '3898453', '2020-01-14', '', 'Jurado Gómez Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'no hace caso a las llamadas de atención. se gira y habla con los compañeros de atrás', 'Leve', 'No', 'Si', 0, 627),
