(677, '3371476', '2020-01-16', '', 'Lara Ruiz Ana', 'Reiteración de conductas contrarias a las normas de convivencia.\r\n', 'La tengo que echar todos los días de clase por perturbar constantemente el desarrollo de la clase.', 'Grave', 'No', 'Si', 0, 638),
(678, '3828387', '2020-01-14', '', 'Sánchez Luque Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nNo disponer del material necesario para su aprendizaje.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'El alumno está en el aula sin ningún material, se niega a sacarlo. Cuando se le amonesta, responde con burlas y actitud chulesca. Te diriges a él y  se queda de espaldas ignorando al profesor.', 'Leve', 'No', 'No', 0, 639),
(679, '3529727', '2020-01-16', '', 'Luengo López Juan Carlos', 'Ignorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nCausar pequeños daños en las instalaciones, materiales o documentos del centro (incluidos los partes de asistencia o de incidencia), o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'Le dejo ira ver al profesor de Biología para recoger los ejercicios de pendientes, pero cuando le veo que está hablando en la clase de al lado, le digo que vuelva a pasar,  entra en el aula dando un puñetazo a la caja del extintor y dando un portazo. Después se niega a trabajar en clase.', 'Leve', 'Si', 'Si', 0, 640),
(680, '3516999', '2020-01-16', '', 'Barroso Fernández Mª Carmen', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Encontrarse fuera del aula sin permiso. No contesta a la pregunta de porqué llegan tarde.', 'Leve', 'No', 'Si', 0, 641),
