(688, '3871838', '2020-01-17', '', 'Polonio Pino Cristóbal', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Se avisa hasta en 3 ocasiones al alumno de que debe estar callado en clase y sentado. Se pasea por la clase y habla en voz alta.', 'Leve', 'No', 'Si', 0, 649),
(689, '3371476', '2020-01-17', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Le llamo multitud de veces la atención, pero hace caso omiso. Le pido que se ponga derecha y me dice \"ya voy, cojones\". Le pido que no se dirija a mi en esos términos y continúa, con contestaciones desconsideradas.', 'Leve', 'No', 'Si', 0, 650),
