(691, '3371476', '2020-01-17', '', 'Romero García Alejandro', 'Tirar objetos, papeles o basura al suelo en cualquier dependencia del centro.\r\n', 'Tira el bocadillo a la calle mientras está en el patio durante el recreo.', 'Leve', 'No', 'No', 0, 652),
(692, '4089903', '2020-01-20', '', 'Alcázar González Jorge', 'Actuaciones perjudiciales para la salud y la integridad personal de los miembros de la comunidad educativa, o la incitación a las mismas. Consumo de alcohol o drogas.\r\nPerjudicar gravemente el desarrollo de las actividades del centro.\r\n', 'Tras haber tocado el timbre a última hora del viernes pasado (14:50 horas), un profesor sorprende al alumno saltando desde la ventana de un aula (128) hasta el patio. La altura desde la ventana hasta el suelo es de más de 2 metros, por lo que la acción podría haber causado al alumno al ser una caída considerable', 'Grave', 'No', 'Si', 0, 653),
(693, '3828387', '2020-01-20', '', 'Sánchez Luque Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nNo disponer del material necesario para su aprendizaje.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'El alumno llega a clase a las 8.35. No trae materiales, se sienta de espaldas y cuando se le amonesta verbalmente sigue con su habitual actitud chulesca haciendo lo que le da la gana', 'Leve', 'No', 'Si', 0, 654),
