(731, '3529727', '2020-01-21', '', 'Luengo López Juan Carlos', 'Perjudicar gravemente el desarrollo de las actividades del centro.\r\n', 'Al regañarle por dar un golpe en la puerta, reacciona de forma agresiva, gritando e increpándome delante de sus compañeros. Después de decirle en varias ocasiones que salga para ir a hablarlo en jefatura da un empujón a la mesa, un puñetazo a la puerta y un portazo', 'Grave', 'No', 'No', 0, 691),
