(756, '3363996', '2020-01-23', '', 'del Pino Cepelledo Antonio', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Cuando le pongo el parte por hablar repetidas veces después de llamarle la atención,  se me encara y me dice que para que le sirve la teoría, que cuando tenga trabajo ,ésto no le va a servir para nada', 'Leve', 'Si', 'No', 0, 716),
(757, '3527474', '2020-01-24', '', 'García Muñoz Marcos', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Insulta a un compañero además de no copiar los apuntes de la pizarra y molestar continuamente', 'Leve', 'No', 'Si', 0, 717),
(758, '3240055', '2020-01-24', '', 'Blanco Domínguez Guillermo', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Se le llama la atención por charlar varias veces. No hace caso e incluso se vuelve de espaldas y sigue charlando sin atender a lo que se le ha dicho.', 'Leve', 'No', 'No', 0, 718),
(759, '3807596', '2020-01-24', '', 'del Pino Cepelledo Antonio', 'No disponer del material necesario para su aprendizaje.\r\n', 'No ha traído las fichas proporcionadas en días anteriores, y por ello no puede aprovechar satisfactoriamente la clase. Me dice que no sabe dónde las ha dejado.', 'Leve', 'No', 'No', 0, 719),
(760, '3275377', '2020-01-24', '', 'del Pino Cepelledo Antonio', 'Estar fuera del aula entre horas sin permiso.\r\nSuplantación de la personalidad, falsificación o sustracción de documentos académicos.\r\n', 'Alumno de 3º A, se introduce en la clase de matemáticas de 4º A a 4ª hora. Está alrededor de 10 minutos hasta que el profesor se da cuenta de que el alumno no pertenece a la clase. Provoca risas al resto de la clase.', 'Grave', 'No', 'No', 0, 720),
(761, '3521620', '2020-01-24', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Coge un plátano, se lo pone en la oreja y hace como si hablara por teléfono, diciendo en voz alta: \"¿si, mamá?\"', 'Leve', 'No', 'No', 0, 721),
(762, '3275377', '2020-01-24', '', 'Ruiz Gómez Clara Eugenia', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Se enfada cuando no le pongo la recogida de un trabajo para cuando él quiere. Le llamo la atención y se burla de mi.', 'Leve', 'Si', 'Si', 0, 722),
(763, '3901292', '2020-01-24', '', 'Serrano Ruiz Gracia', 'Estar fuera del aula entre horas sin permiso.\r\nPerturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nNo disponer del material necesario para su aprendizaje.\r\n', 'No hace nada, no para de hablar, molesta continuamente; si le llamas la atención contesta de mala manera. No saca el material.', 'Leve', 'No', 'No', 0, 723),
(764, '3901292', '2020-01-24', '', 'Serrano Ruiz Gracia', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\r\nIncumplimiento de las correcciones impuestas.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'Al ponerle el primer parte, se muestra fuera de sí. Rompe el zumo de un compañero, golpea mesas y sillas y llora. Mancha libros, mesa, suelo, mochilas, etc.', 'Grave', 'No', 'No', 0, 724),
(765, '3016658', '2020-01-24', '', 'Ventura Fernández Lourdes', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'Usar el móvil como traductor en un exàmen, engañándome y engañándose. \r\n(Suena su móvil con una de las respuestas en medio del exámen )', 'Leve', 'No', 'No', 0, 725),
(766, '3562460', '2020-01-27', '', 'Muñoz Muñoz Rosario', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Llega tarde,no para de charlar, de reír y de faltar el respeto', 'Leve', 'No', 'Si', 0, 726),
(767, '3529727', '2020-01-27', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nTirar objetos, papeles o basura al suelo en cualquier dependencia del centro.\r\n', 'Habla en voz alta durante la clase y tira objetos ( bolígrafos). Hace caso omiso a los avisos', 'Leve', 'No', 'Si', 0, 727),
(768, '3256233', '2020-01-27', '', 'Hernández Ovejero Ana Isabel', 'Conductas leves en las que concurran las circunstancias de colectividad y/o publicidad intencionada.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\nUtilizar el móvil para fotografiar o grabar a cualquier miembro de la comunidad educativa.\r\n', 'Usa el móvil para apagar el proyector en clase de TIC y cuando el profesor le señala y baja a jefatura nos miente diciendo que no sabe nada. Hoy reconoce lo ocurrrido', 'Grave', 'No', 'Si', 0, 728),
(769, '3828387', '2020-01-27', '', 'Quintana Ramos José Ángel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se niega a sentarse derecho a pesar de las indicaciones. No se sienta bien en toda la hora.', 'Leve', 'No', 'Si', 0, 729),
