(784, '3267199', '2020-01-29', '', 'Román Vázquez Alvaró Jesús', 'Ignorar las llamadas de atención del personal docente y no docente.\r\nComer o beber en clase.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'Al comienzo de la clase le digo que tire el chicle. No lo tira durante toda la hora. Antes de terminar la clase pide que le den la sudadera y le digo que no, que no ha acabado la clase. Dice que entonces se levanta él. Le aviso de que en ese caso se le pondrá un parte grave. Al poco tiempo se levanta y, al decirle que tendrá un parte, me falta al respeto gravemente, llamándome \"amargado\" y que si ', 'Grave', 'No', 'Si', 0, 744),
