(787, '3627800', '2020-01-30', '', 'Ayllón Redondo Enrique', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Abandona el aula cuando le había castigado a quedarse para hablar con él por su comportamiento en clase y por recoger antes de tiempo.', 'Leve', 'No', 'No', 0, 747),
(788, '3275377', '2020-01-24', '', 'Ruiz Gómez Clara Eugenia', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Se enfada porque no le pongo la recogida de un trabajo para cuando él quiere. Le llamo la atención y se burla de mi.', 'Leve', 'Si', 'Si', 0, 748),
