(790, '3565077', '2020-01-30', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Charlar y repetirir Uho, Uho, en voz alta.', 'Leve', 'No', 'Si', 0, 750),
