(792, '3871838', '2020-01-30', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se le pide que no hable a voces en clase y dice que va a seguir con la misma actitud. Se de un golpe contra el cristal a propósito (con su cabeza) para llamar la atención', 'Leve', 'No', 'Si', 0, 752),
(793, '3530182', '2020-01-30', '', 'Rodríguez Díaz Belén', 'No disponer del material necesario para su aprendizaje.\r\nNo traer el parte firmado en el plazo de una semana.\r\n', 'Le puse un parte por falta de material hace una semana y ni trae el material ni el parte.', 'Leve', 'No', 'No', 0, 753),
