(795, '3348606', '2020-01-30', '', 'González de los Ríos  Guillén Abraham', 'Estar fuera del aula entre horas sin permiso.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se le avisa numerosas veces que no se sale al pasillo y hace caso omiso. Cuando se requiera que venga por estar fuera, no se presenta. No deja de protestar', 'Leve', 'Si', 'No', 0, 755);
