(801, '2725621', '2020-01-30', '', 'del Pino Cepelledo Antonio', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Hablar reiteradamente en alto sin pedir permiso para ello. Utilizar una expresión soez sin venir a cuento. Por último me anima a ponerle un parte, porque según él, \"le da igual\"', 'Leve', 'No', 'No', 0, 761),
(802, '3316292', '2020-01-30', '', 'del Pino Cepelledo Antonio', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Interrumpir continuamente con preguntas absurdas y sin sentido con el propósito consciente de llamar la atención', 'Leve', 'No', 'No', 0, 762),
(803, '3029371', '2020-01-31', '', 'Ramos López Inés', 'Cinco faltas injustificadas de puntualidad.\r\n', 'todos los días llega tarde a clase, es una decisión del equipo educativo por reiterar esta conducta', 'Leve', 'No', 'Si', 0, 763),
(804, '3545854', '2020-01-31', '', 'García Muñoz Marcos', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Insulta a un compañero', 'Leve', 'No', 'Si', 0, 764),
(805, '3516151', '2020-01-31', '', 'del Pino Cepelledo Antonio', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Se dirige indebidamente, en voz alta y en medio de la clase con expresiones incorrectas a un compañero', 'Leve', 'No', 'Si', 0, 765),
