(809, '4126525', '2020-01-31', '', 'Muñoz Muñoz Rosario', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Tiene muchas salidas de tono.Hoy les he puesto una canción y ha dicho que era \"un mojón\".', 'Leve', 'No', 'No', 0, 769),
(810, '3323951', '2020-01-31', '', 'Ruiz Gómez Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Interrumpe la clase con un comentario a una compañera que acaba de volver del recreo', 'Leve', 'Si', 'No', 0, 770),
(811, '3860095', '2020-01-31', '', 'Martínez Ruiz Rocío', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No hace caso, se levanta cuando quiere, sale de clase... no hace nada.', 'Leve', 'No', 'Si', 0, 771),
(812, '3871838', '2020-01-31', '', 'Barranco Hidalgo Rafael Ángel ', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\nSuplantación de la personalidad, falsificación o sustracción de documentos académicos.\r\n', 'Se identifica incorrectamente , se tira al suelo, dice palabrotas, amenaza a un compañero y lo intimida.', 'Grave', 'No', 'No', 0, 772),
(813, '3565077', '2020-01-31', '', 'Luengo López Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Interrumpe en numerosas ocasiones. Discute con su compañera Sara. Él dice que lo estaba molestando.', 'Leve', 'No', 'No', 0, 773),
(814, '3543365', '2020-01-31', '', 'Luengo López Juan Carlos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Interrumpe en numerosas ocasiones. Discute en voz alta con su compañero Javier', 'Leve', 'No', 'No', 0, 774),
(815, '3516867', '2020-02-03', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'El alumno se hace el aburrido e clase, le llamo la atención y no responde, le tengo que volver a llamar la atención para que se despierte y lo hace riendo. Tampoco entrega una nota firmada a sus padres. Estaba advertido de que si no lo hacía se le pondría un parte.', 'Leve', 'No', 'Si', 0, 775),
(816, '3517085', '2020-02-03', '', 'Antúnez Alperiz María Isabel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No trabaja ni saca nada para hacer. Lo cambio de sitio, se levanta cuando le da la gana para hablar con Ángel.', 'Leve', 'No', 'No', 0, 776),
(817, '3871838', '2020-02-03', '', 'Cortes Sánchez Ana María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'ha decidido no hacer nada hoy y molesta', 'Leve', 'No', 'Si', 0, 777),
(818, '3516867', '2020-02-03', '', 'Reyes Amil José', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Interrumpe constantemete la clase. No atiende a mis llamadas de atención. Le pido que venga a mi mesa para corregir unos ejercicios y tira de manera intencionada dos sillas', 'Leve', 'No', 'Si', 0, 778),
(819, '3515318', '2020-02-03', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se le avisa en varias ocasiones par que se calle y deje de molestar a sus compañeros y continúa con la misma actitud', 'Leve', 'No', 'No', 0, 779),
(820, '2978114', '2020-02-03', '', 'Castro Luque Agustín', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', '?o deja de hablar, reírse, a pesar de mis múltiples advertencias.', 'Leve', 'No', 'Si', 0, 780),
(821, '3255863', '2020-02-03', '', 'Ramírez Oña Verónica', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'La profesora ha visto al alumno con el móvil en la mano en clase.', 'Leve', 'No', 'No', 0, 781),
(822, '3322937', '2020-02-03', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No para de interrumpir hablando en voz alta. Le había avisado que de continuar así le pondría un parte.', 'Leve', 'Si', 'No', 0, 782),
(823, '3517085', '2020-02-04', '', 'Romero García Alejandro', 'Cinco faltas injustificadas de puntualidad.\r\n', 'Suele llegar tarde a clase. Se suele quedar de paseo y llega cuando le parece.', 'Leve', 'No', 'Si', 0, 783),
(824, '3835978', '2020-02-04', '', 'Romero García Alejandro', 'Cinco faltas injustificadas de puntualidad.\r\n', 'Suele llegar tarde a clase. Se suele quedar de paseo y llega cuando le parece.', 'Leve', 'No', 'No', 0, 784),
(825, '3278125', '2020-02-04', '', 'Alcázar González Jorge', 'Exhibir el móvil en el centro escolar.\r\n', 'Exhibe el móvil en el centro escolar', 'Leve', 'No', 'No', 0, 785),
(826, '3255885', '2020-02-04', '', 'del Pino Cepelledo Antonio', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Realizar un comentario impertinente, incorrecto y desconsiderado al profesor', 'Leve', 'No', 'No', 0, 786),
(827, '4085664', '2020-02-04', '', 'Sierra Martín Francisco Manuel', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Llega a clase y mientras enciendo el PC para pasar la lista se pone a golpear la mesa como si fuese un tambor durante un buen rato , hasta que le llamo la atención', 'Leve', 'No', 'Si', 0, 787),
(828, '3348606', '2020-02-04', '', 'del Pino Cepelledo Antonio', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No hace  caso a las indicaciones del profesor. Se enfada porque le llamo la atención y no quiere hablarme el resto de la clase', 'Leve', 'No', 'No', 0, 788),
(829, '3323951', '2020-02-04', '', 'del Pino Cepelledo Antonio', 'Estar fuera del aula entre horas sin permiso.\r\n', 'llega con diez minutos de retraso a clase. Dice que se ha quedado hablando con sus amigos en el patio', 'Leve', 'No', 'No', 0, 789),
(830, '3517085', '2020-02-03', '', 'Abad Ruiz Federico', 'No disponer del material necesario para su aprendizaje.\r\n', 'Acude a clase repetidamente sin material. No muestra nada de interés', 'Leve', 'No', 'No', 0, 790),
(831, '3311534', '2020-02-05', '', 'López Galiot Lidia', 'Causar pequeños daños en las instalaciones, materiales o documentos del centro (incluidos los partes de asistencia o de incidencia), o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'El alumno tira de la cuerda de la persiana hasta arrancarla, haciendo caso omiso a las llamadas de atención.', 'Leve', 'No', 'No', 0, 791),
(832, '3545934', '2020-02-05', '', 'López Galiot Lidia', 'Causar pequeños daños en las instalaciones, materiales o documentos del centro (incluidos los partes de asistencia o de incidencia), o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'El alumno tira de la persiana hasta romperla haciendo caso omiso de las llamadas de atención.', 'Leve', 'No', 'No', 0, 792),
(833, '3257159', '2020-02-05', '', 'García Castro Rosa María', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'Falta de respeto a la profesora. En una actividad oral en la clase de inglés emplea un vocabulario fuera de lugar y lejos de arrepentirse, no pide disculpas y no entiende la gravedad. La frase fue: \"le pintaría un pene a la profesora en la cara\". Pasa a parte grave por reírse cuando le entrego el parte y repetirlo.', 'Grave', 'No', 'No', 0, 793),
(834, '3559690', '2020-02-05', '', 'García Castro Rosa María', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Falta de respeto a la profesora permitiendo que sus compañeros de grupo (eran tres) escribieran en una actividad \"le pintaría un pene a la profesora en la cara\". No piden disculpas.', 'Leve', 'No', 'No', 0, 794),
(835, '3575934', '2020-02-05', '', 'García Castro Rosa María', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Falta de respeto a la profesora, bien siendo idea suya o permitiendo sin siquiera pedir disculpas. En una actividad de clase en grupos ponen: \"le pintaría un pene a la profesora en la cara\".', 'Leve', 'No', 'No', 0, 795),
(836, '3860095', '2020-02-05', '', 'Ayllón Redondo Enrique', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Dar golpes constantemente en la mesa. Le he avisado 8 veces.', 'Leve', 'No', 'Si', 0, 796),
(837, '4089713', '2020-02-05', '', 'Ponce de León Echevarría Augusto', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Levantarse del sitio en varias ocasiones y no hacer caso de las instrucciones del profesor.', 'Leve', 'No', 'Si', 0, 797),
(838, '3278125', '2020-02-06', '', 'Barroso Fernández Mª Carmen', 'No traer el parte firmado en el plazo de una semana.\r\n', 'No trae el parte firmado, después de perderlo. El primer parte, del 13 de enero, perdido. El segundo, del 23 de enero, perdido. El tercero, de 30 de enero,perdido. Viene sin materiales siempre y nunca hace nada.', 'Leve', 'No', 'Si', 0, 798),
(839, '3562460', '2020-02-04', '', 'Lara Ruiz Ana', 'Estar fuera del aula entre horas sin permiso.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Llega tarde a clase después del recreo unos 10 minutos. Dice que viene del servicio (no tiene permiso ninguno). Durante la clase no saca ni el libro.', 'Leve', 'No', 'No', 0, 799),
(840, '3898453', '2020-02-04', '', 'Lara Ruiz Ana', 'Estar fuera del aula entre horas sin permiso.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Llega 10 minutos tarde a clase (sin permiso) después del recreo. Durante la clase se dedica a hacer otra asignatura y le tengo que llamar la atención por ese motivo.', 'Leve', 'No', 'No', 0, 800),
(841, '3589228', '2020-02-06', '', 'Camino Conde María', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'El alumno se dedica a encender y apagar la luz de la clase cada vez que quiere. No es la primera vez que le llamo la atención por jugar con la luz. Además, cuando le riñes, no acepta las indicaciones, quejándose.', 'Leve', 'No', 'Si', 0, 801),
(842, '3898453', '2020-02-06', '', 'Muñoz Muñoz Rosario', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'No para de molestar, reírse, volverse hacia atrás... !Imposible dar clase con ella!', 'Leve', 'No', 'Si', 0, 802),
(843, '3823312', '2020-02-06', '', 'García Muñoz Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Habla mucho y se vuelve hacia atrás, motivo por el que lo cambio de sitio y se niega.', 'Leve', 'No', 'Si', 0, 803),
(844, '3292673', '2020-02-06', '6', 'Castillo Gomariz, Rafael del', 'Reiteración de conductas contrarias a las normas de convivencia.\nIncumplimiento de las correcciones impuestas.\n', 'No ha querido sacar las tareas para trabajar a pesar de habérselo dicho reiteradamente, ha estado hablando todo el rato con los compañeros, ha hecho caso omiso TODA la hora a las indicaciones que le ha dado el profesor.\r\n\r\nLe pongo la calificación de GRAVE en vez de LEVE porque su indisciplina ha sido reiterada.', 'Grave', 'No', 'No', 0, 0),
(845, '3301341', '2020-02-06', '6', 'Castillo Gomariz, Rafael del', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\nIgnorar las llamadas de atención del personal docente y no docente.\n', 'Después de pedirle que haga las tareas ha tardado mucho tiempo en sacarlas, no las ha estado haciendo y cuando se le ha pedido que se cambiara de sitio para que dejara de molestar a sus compañeros no se ha cambiado hasta que a los cinco minutos me he dado cuenta que no lo ha hecho, aún así ha estado intentando no hacerlo.', 'Leve', 'No', 'No', 0, 0),
(846, '3255885', '2020-02-06', '', 'del Pino Cepelledo Antonio', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Estoy hablando con una alumna y da un grito de tono impertinente y sin venir al caso. Le digo que le voy a poner un parte y protesta con vehemencia  Ne dice que le pongo el parte porque lo ha dicho el resto de la clase y que no tengo personalidad por ello', 'Leve', 'No', 'No', 0, 804),
(847, '3255985', '2020-02-07', '', 'Vidal Baena Fco Manuel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Estar fuera del aula.', 'Leve', 'No', 'No', 0, 805),
(848, '3527527', '2020-02-07', '', 'Vidal Baena Fco Manuel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Estar fuera del aula.', 'Leve', 'No', 'No', 0, 806),
(849, '3521620', '2020-02-07', '', 'Vidal Baena Fco Manuel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Estar fuera del aula.', 'Leve', 'No', 'No', 0, 807),
(850, '3587288', '2020-02-07', '', 'Vidal Baena Fco Manuel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Estar fuera del aula.', 'Leve', 'No', 'No', 0, 808),
(851, '3815289', '2020-02-07', '', 'Parejo Navarro Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Llevo toda la hora llamándole la atención porque no para de charlar, pero aún así continúa en su actitud de charlar.', 'Leve', 'Si', 'No', 0, 809),
(852, '3254483', '2020-02-07', '', 'Lara Ruiz Ana', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', ';olesta a los compañeros sentados delante suya y encima dice que \"está hasta los huevos de su co,pañero\"', 'Leve', 'No', 'No', 0, 810),
(853, '3255985', '2020-02-07', '', 'Ventura Fernández Lourdes', 'Cinco faltas injustificadas de puntualidad.\r\n', 'Llega tarde 15 minutos a clase sin justificación. Se repite la situación.', 'Leve', 'No', 'No', 0, 811),
(854, '3255985', '2020-02-07', '', 'Ventura Fernández Lourdes', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Cuando se le entrega el parte reacciona con malos modos y dice \"qué asco de instituto\".', 'Leve', 'No', 'Si', 0, 812),
(855, '3292759', '2020-02-10', '', 'Guzmán Porras Expectación', 'Otras (contempladas en el P.C.).\r\n', 'Hace una semana le puse una nota en la agenda por no aprovechar las clases como es debido. Todos los días se la pido y nunca la trae firmada', 'Leve', 'No', 'No', 0, 813),
(856, '3898453', '2020-02-10', '', 'Barroso Fernández Mª Carmen', 'No traer el parte firmado en el plazo de una semana.\r\n', 'Sin traer el parte firmado  con fecha del 15/01/20. Siempre se olvida. \"escrito\" en la agenda para recordar', 'Leve', 'No', 'No', 0, 814),
(857, '3323951', '2020-02-10', '', 'Ruiz Gómez Clara Eugenia', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Están explicando los compañeros una presentación. Mando callar. Después de llamarle la atención muchas veces lanza un bufido que interrumpe la exposición', 'Leve', 'Si', 'Si', 0, 815),
(858, '3527474', '2020-02-10', '', 'Ruiz Gómez Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Están explicando los compañeros una presentación. No deja de molestar en lugar de atender mira a las compañeras de atrás, molestándolas. Le llamo la atención varias veces. Hace ruidos con el pie y le vuelvo a llamar la atención', 'Leve', 'Si', 'Si', 0, 816),
(859, '3267199', '2020-02-10', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'El alumno no hace nada en clase y no trae el material', 'Leve', 'No', 'No', 0, 817),
(860, '4117462', '2020-02-07', '', 'Antúnez Alperiz María Isabel', 'Actuaciones perjudiciales para la salud y la integridad personal de los miembros de la comunidad educativa, o la incitación a las mismas. Consumo de alcohol o drogas.\r\n', 'El viernes al terminar las clases, empuja en el pasillo a un compañero que se cae de espaldas golpeándose fuertemente la cabeza. Lo juegos en los pasillos están prohibidos. Podría haber pasado algo grave.', 'Grave', 'No', 'No', 0, 818),
