(925, '3888510', '2020-02-17', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Interrumpe hablando continuamente y con risas el funcionamiento de la clase mientras los compañeros realizan sus presentaciones. No hace caso a los avisos', 'Leve', 'No', 'No', 0, 883),
(926, '3255863', '2020-02-17', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Durante el examen de Inglés se le llama la atención para que permanezca en silencio pero no deja de molestar', 'Leve', 'No', 'No', 0, 884),
(927, '3277909', '2020-02-17', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Durante el examen de Inglés molesta a sus compañeros haciendo ruido. Se le avisa en varias ocasiones y sigue molestando. Además mueve una mesa constantemente para molestar a propósito', 'Leve', 'No', 'No', 0, 885),
(928, '3833386', '2020-02-17', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'No para de charlar mientras explico', 'Leve', 'No', 'No', 0, 886),
(929, '3278125', '2020-02-17', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'No para de charlar mientras explico', 'Leve', 'No', 'No', 0, 887),
(930, '3514901', '2020-02-17', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'No para de charlar mientras explico', 'Leve', 'No', 'No', 0, 888),
(931, '3913818', '2020-02-17', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'No para de charlar mientras explico', 'Leve', 'No', 'No', 0, 889),
(932, '3267199', '2020-02-17', '', 'Parejo Navarro Francisco Javier', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No para de charlar mientras explico. No hace absolutamente nada de las tareas propuestas', 'Leve', 'No', 'No', 0, 890),
(933, '3821352', '2020-02-17', '', 'Quintana Ramos José Ángel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Sale de clase sin permiso de la profesora.La encuentro por el pasillo y me miente diciendo que si lo tenía', 'Leve', 'No', 'No', 0, 891),
(934, '2969766', '2020-02-17', '', 'Quintana Ramos José Ángel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Sale de clase en el intercambio (de ahí los retrasos).Le pregunto a la profesora si le ha dado permiso y me dice que no.Me ha mentido', 'Leve', 'No', 'No', 0, 892),
(935, '3334251', '2020-02-17', '', 'Quintana Ramos José Ángel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Sale de clase entre hora y hora,sin permiso de la profesora.Me dice que le dio permiso y no era cierto', 'Leve', 'No', 'No', 0, 893),
(936, '3241062', '2020-02-17', '', 'Quintana Ramos José Ángel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Está fuera del aula entre clases.Cuando le digo si le ha dado permiso la profesora,me dice que sí.La profesora no le ha dado permiso, luego me ha mentido', 'Leve', 'No', 'No', 0, 894),
(937, '3562460', '2020-02-17', '', 'Blanco Domínguez Guillermo', 'Estar fuera del aula entre horas sin permiso.\r\n', 'LLega tarde a clase y además se cambia de sitio sin permiso', 'Leve', 'No', 'No', 0, 895),
(938, '3562460', '2020-02-17', '', 'Blanco Domínguez Guillermo', 'Estar fuera del aula entre horas sin permiso.\r\n', 'LLega tarde a clase y además se cambia de sitio sin permiso', 'Leve', 'No', 'No', 0, 896),
(939, '3898453', '2020-02-17', '', 'Blanco Domínguez Guillermo', 'Estar fuera del aula entre horas sin permiso.\r\n', 'Llega tarde a clase y además se cambia de sitio sin permiso', 'Leve', 'No', 'No', 0, 897),
(940, '3255863', '2020-02-17', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Durante el examen de inglés se le llama la atención para que permanezca en silencio pero no deja de molestar.', 'Leve', 'No', 'No', 0, 898),
(941, '3277909', '2020-02-18', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Durante el examen de inglés molesta a sus compañeros haciendo ruido. Se le avisa en varias ocasiones y sigue molestando. Además, mueve una mesa constantemente para molestar a propósito.', 'Leve', 'No', 'No', 0, 899),
(942, '3311534', '2020-02-17', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Dice en voz alta, sin referirse a nadie en concreto, \"me cago en tus muertos\"', 'Leve', 'Si', 'No', 0, 900);
INSERT INTO `disciplina` (`id_disc`, `NIE`, `fecha`, `hora`, `profesor`, `motivos`, `descripcion`, `tipo`, `revisado`, `expulsion`, `id_medidas`, `numero`) VALUES
(943, '3323287', '2020-02-17', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No para de hablar y volverse hacia atrás. Ya se le ha advertido varias veces', 'Leve', 'No', 'No', 0, 901),
(944, '3545934', '2020-02-17', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Hace bromas con el apellido del tutor en voz alta. No para de hablar en clase', 'Leve', 'Si', 'No', 0, 902),
(945, '3898453', '2020-02-18', '', 'Luengo López Juan Carlos', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No hace nada en clase y se dedica a reírse.', 'Leve', 'No', 'No', 0, 903),
(946, '3828387', '2020-02-18', '', 'Sánchez Luque Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nNo disponer del material necesario para su aprendizaje.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'No trae el material, se niega a sacarlo, interrumpe la clase. Y amenaza al compañero que lo acompaña al aula de convivencia \" te voy a arrancar la cabeza', 'Grave', 'No', 'Si', 0, 904),
(947, '3828387', '2020-02-18', '', 'García Muñoz Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'le digo que tire un avión de papel, me contesta con malos modos y no me hace caso. Llama a su compañero mofeta', 'Leve', 'No', 'Si', 0, 905),
(948, '3371476', '2020-02-18', '', 'Jurado Gómez Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nAbandonar el centro de manera injustificada durant', 'ha llegado tarde a clase. le he entregado el parte de física y química. quería salir de clase, no le he dado permiso y se ha ido, sin más', 'Leve', 'No', 'Si', 0, 906),
(949, '3267199', '2020-02-18', '', 'Román Vázquez Alvaró Jesús', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'al entrar en clase le digo que tire el chicle. lo tira, pero contesta diciendo que no empiece ya a decirle lo que tiene que hacer. le digo que yo que yo soy el que decide lo que tiene que hacer y sigue contestando y diciendo que no me repita con lo que tiene que hacer', 'Leve', 'No', 'Si', 0, 907),
(950, '3255985', '2020-02-18', '', 'Ruiz Gómez Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'está molesto y no deja de molestar en clase', 'Leve', 'No', 'Si', 0, 908),
(951, '3898453', '2020-02-19', '', 'Jurado Gómez Carmen', 'No traer el parte firmado en el plazo de una semana.\r\n', 'No traer el parte firmado.', 'Leve', 'No', 'No', 0, 909),
(952, '3371476', '2020-02-19', '', 'Lara Ruiz Ana', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Cuando entro en la clase la llamo para hablar con ella y ni se para para contestarme: \"yo contigo no hablo\". Se dedica toda la clase a doblar papeles.', 'Leve', 'No', 'No', 0, 910),
(953, '3249315', '2020-02-19', '', 'Parejo Navarro Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nUtilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'Le pido que responda a una actividad, me dice que no. Le pregunto si la tiene hecha y me dice que sí. Voy a corregirla y me dice \"búscala\", y no la tiene hecha,', 'Leve', 'No', 'Si', 0, 911),
(954, '4137158', '2020-02-19', '', 'Blanco Domínguez Guillermo', 'Ignorar las llamadas de atención del personal docente y no docente.\r\nCausar pequeños daños en las instalaciones, materiales o documentos del centro (incluidos los partes de asistencia o de incidencia), o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'Se dedica a darle patadas a los balones de voleibol. Se le advierte varias veces y continúa haciéndolo.', 'Leve', 'No', 'Si', 0, 912),
(955, '3322937', '2020-02-19', '', 'Román Vázquez Alvaró Jesús', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Después de ponerle un parte me protesta en un tono excesivamente elevado y de mala forma diciendo que siempre se le pone el parte a las mismas personas.', 'Leve', 'No', 'Si', 0, 913),
(956, '3278506', '2020-02-19', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No trabaja nada. Habla a voces con un compañero que está en la otra punta.', 'Leve', 'No', 'Si', 0, 914),
(957, '3322937', '2020-02-19', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Habla a voces con un compañero que está en la otra punta de la clase. Es habitual que haga comentarios en voz alta que no vienen a cuento.', 'Leve', 'No', 'Si', 0, 915),
(958, '3807596', '2020-02-19', '', 'Blanco Domínguez Guillermo', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nNo guardar las debidas normas de seguridad establecidas para el uso de material o el funcionamiento de determinados aparatos eléctricos.\r\n', 'Se dedica a pegar patadones a los balones de voleibol. Se le avisa varias veces, continúa haciéndolo hasta que lo echo fuera del recinto. Uno de los pelotazos alcanza a un compañero en el pecho haciéndole bastante daño y provocando que llore de dolor.', 'Leve', 'Si', 'Si', 0, 916),
(959, '3835978', '2020-02-19', '', 'Romero García Alejandro', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'En clase de tutoría, hablando de un asunto de convivencia y material de la clase, se dirige a una niña así: \"Miente como una perra. Cuando la pille en la calle la voy a machacar\".', 'Grave', 'No', 'Si', 0, 917),
(960, '3517085', '2020-02-19', '', 'Romero García Alejandro', 'Injurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier miembro de la comunidad escolar.\r\n', 'En clase de tutoría se dirige al profesor en términos despectivos: \"Que te esperes\", \"Que te calles ya, illo\", \"Estoy hasta los cojones\".', 'Grave', 'No', 'Si', 0, 918),
(961, '3517085', '2020-02-19', '', 'Romero García Alejandro', 'Incumplimiento de las correcciones impuestas.\r\n', 'Le digo que se vaya a jefatura y que me espere allí cuando toque para el recreo. Cuando voy, no está.', 'Grave', 'No', 'Si', 0, 920),
(962, '3277909', '2020-02-19', '', 'Luengo López Juan Carlos', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No hace nada y dice que no lo va a hacer pese a advertírselo repetidamente.', 'Leve', 'No', 'No', 0, 921),
(963, '3860095', '2020-02-18', '', 'Ramírez Oña Verónica', 'Causar graves daños en las instalaciones, materiales o documentos del centro, o en las pertenencias de otros miembros de la comunidad educativa.\r\n', 'El alumno lanza un pedazo de pegamento a la pizarra, ocasionando un desperfecto en tal objeto.', 'Grave', 'No', 'No', 0, 922),
(964, '2977850', '2020-02-19', '', 'Blanco Pérez Manuel', 'Utilizar aparatos grabadores o reproductores, cámara de fotos y teléfonos móviles.\r\n', 'usar el móvil en clase', 'Leve', 'No', 'No', 0, 923),
(965, '3819178', '2020-02-20', '', 'Blanco Domínguez Guillermo', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Se le llama la atención en repetidas ocasiones y no para de charlar, haciendo caso omiso de las indicaciones.', 'Leve', 'No', 'No', 0, 924),
(966, '3903064', '2020-02-20', '', 'Blanco Domínguez Guillermo', 'Estar fuera del aula entre horas sin permiso.\r\nPerturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nInjurias, ofensas, vejaciones, humillaciones, amenazas o coacciones contra cualquier', 'No ha trabajado en toda la hora. Al finalizar la clase, se mete en otro aula, le digo que no haga tonterías y me contesta: \"Me parezco a ti de tonto, aquí los únicos tontos son los maestros\".', 'Grave', 'No', 'No', 0, 925),
(967, '3898453', '2020-02-10', '', 'Muñoz Muñoz Rosario', 'Cinco faltas injustificadas de puntualidad.\r\n', 'Llega 10 minutos tarde a clase porque sí.', 'Leve', 'No', 'Si', 0, 926),
(968, '4137158', '2020-02-18', '', 'Abad Ruiz Federico', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'En lugar de estar leyendo la partitura con el resto del grupo, está hablando, distrayendo y riéndose.', 'Leve', 'No', 'No', 0, 927),
(969, '3267199', '2020-02-20', '', 'Camino Conde María', 'Estar fuera del aula entre horas sin permiso.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Aparece 5 minutos antes de que termine la clase. Cuando le pregunto de dónde viene me contesta que ha estado por ahí con sus amigos. Además me dice que a mí lo mismo me da donde esté él. Sigue desafiándome cuando le doy el parte. Por esta razón, el parte pasa de 4 puntos a 8.', 'Leve', 'No', 'No', 0, 928),
(970, '3823312', '2020-02-19', '', 'Camino Conde María', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Mientras le llamo la atención a sus compañeros para que se sienten y guarden silencio, se pone a gritar por encima de mi voz intentando silenciarme. Cuando me dirijo hacia él, se ríe. Como después pide disculpas el parte pasa de 5 puntos a 2.', 'Leve', 'No', 'No', 0, 929),
(971, '3828387', '2020-02-20', '', 'Abad Ruiz Federico', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Le indico que tire el chicle en la basura antes de entrar en clase y se niega repetidamente.', 'Leve', 'No', 'Si', 0, 930),
(972, '3255985', '2020-02-20', '', 'Ventura Fernández Lourdes', 'Incumplimiento de las correcciones impuestas.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'Tercer parte en una hora. Se burla haciendo y repitiendo en tono inapropiado el ejercicio que hacíamos en clase', 'Grave', 'No', 'No', 0, 931),
(973, '2972716', '2020-02-20', '', 'Cabrero Doncel Carmen', 'Otras (contempladas en el P.C.).\r\n', 'El móvil de la alumna ha sonado fuertemente en clase', 'Leve', 'Si', 'No', 0, 932),
(974, '3913818', '2020-02-20', '', 'Muñoz Muñoz Rosario', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'Está toda la hora charlando, sin hacer nada y sin parar de reír. Llamo la atención a un compañero y sigue riendo.', 'Leve', 'No', 'No', 0, 933),
(975, '3255985', '2020-02-20', '', 'Ventura Fernández Lourdes', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nCinco faltas injustificadas de puntualidad.\r\n', 'No hace caso alguno a las normas e indicaciones. Habitualmente tengo que interrumpir la clase para llamarle la atención. Reiteración de retraso.', 'Leve', 'No', 'No', 0, 934),
(976, '3860095', '2020-02-20', '', 'García Muñoz Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Se levanta, perturba el funcionamiento del aula, le aviso, le perdono y sigue igual.', 'Leve', 'No', 'Si', 0, 935),
(977, '3255985', '2020-02-20', '', 'Ventura Fernández Lourdes', 'No traer el parte firmado en el plazo de una semana.\r\n', 'No trae partes firmados', 'Leve', 'No', 'No', 0, 936),
(978, '3574304', '2020-02-21', '', 'Blanco Domínguez Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se niega a hacer el trabajo. Se le avisa varias veces y al decirle que puede tener un parte me contesta: \"Pués pónmelo ya, macho !! Se va al servicio ...', 'Leve', 'No', 'Si', 0, 937),
(979, '3537821', '2020-02-21', '', 'Jurado Gómez Carmen', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nTirar objetos, papeles o basura al suelo en cualquier dependencia del centro.\r\nIncorrección y desconsideración hacia otros miembros', 'Ha tirado un avión contra la pizarra. Ha entrado de manera desconsiderada en dos ocasiones. (Estoy de guardia)', 'Leve', 'No', 'Si', 0, 938),
(980, '3801253', '2020-02-21', '', 'Parejo Navarro Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'El alumno no trae firmada una nota de hace dos días a pesar de estar advertido de que si no lo hacia se le pondría un parte.', 'Leve', 'Si', 'No', 0, 939),
(981, '3255863', '2020-02-21', '', 'Guzmán Porras Expectación', 'Reiteración de conductas contrarias a las normas de convivencia.\r\nOtros. Falta grave\r\n', 'No saca el cuaderno, no atiende y charla, molestando durante todas las clases. Hoy, por reiteración, le voy a poner un parte y le pregunto su segundo apellido. Contesta desde el fondo de la clase muy bajo, y le digo que hable más alto y contesta: \"estás sorda\", esto ya en tono alto.', 'Grave', 'No', 'No', 0, 940),
(982, '3860095', '2020-02-21', '', 'Parejo Navarro Francisco Javier', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'El alumno no trae firmada una nota a sus padres que le puse el lunes. Estaba advertido que de no traerla tendría un parte.', 'Leve', 'No', 'No', 0, 941),
