(1053, '4089615', '2020-03-05', '', 'Ponce de León Echevarría Augusto', 'Agresión física a un miembro de la comunidad educativa.\r\n', 'Engancha por el cuello a otro alumno en el pasillo. Ha habido mas quejas previas de agresión sobre él', 'Grave', 'No', 'Si', 0, 1012),
(1054, '2981593', '2020-03-05', '', 'García Muñoz Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Se levanta sin permiso y se pone a mirar debajo de la mesa del otro compañero.', 'Leve', 'No', 'No', 0, 1013),
(1055, '3566553', '2020-03-05', '', 'García Muñoz Marcos', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Grita en clase y dice \"Fuera\".', 'Leve', 'No', 'No', 0, 1014),
(1056, '3819114', '2020-03-06', '', 'Rodríguez Díaz Belén', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se le llama la atención en varias ocasiones, responde y sigue sin tomarse en serio la clase. No se calla, se levanta sin permiso.', 'Leve', 'No', 'No', 0, 1015),
(1057, '3786603', '2020-03-09', '', 'Huertas Fuentes Nicolás', 'Abandonar el centro de manera injustificada durante la jornada escolar.\r\n', 'Aparte de no traer las fichas y actividades, se marcha en la hora del recreo', 'Leve', 'No', 'No', 0, 1016),
(1058, '3828963', '2020-03-09', '', 'López Galiot Lidia', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No respeta las normas. Se distrae con la compañera y charla en clase, en mitad de la explicación.', 'Leve', 'No', 'No', 0, 1017),
(1059, '7610087', '2020-03-09', '', 'Alcázar González Jorge', 'Utilizar los ordenadores del aula sin permiso o de manera indebida.\r\n', 'En ausencia del profesor utiliza el ordenador del aula para poner música', 'Leve', 'No', 'No', 0, 1018),
(1060, '3254483', '2020-03-09', '', 'Muñoz Muñoz Rosario', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Se dedica a atarle los cordones de los zapatos a una silla a su compañero', 'Leve', 'Si', 'Si', 0, 1019),
(1061, '3901292', '2020-03-09', '', 'Del Castillo Gomariz Rafael', 'Exhibir el móvil en el centro escolar.\r\n', 'Usa el móvil durante la guardia, cuando se le pide lo da.', 'Leve', 'No', 'No', 0, 1020),
(1062, '3891888', '2020-03-09', '', 'López Galiot Lidia', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Charla y se distrae continuamente a pesar de las indicaciones dadas', 'Leve', 'No', 'No', 0, 1021),
(1063, '3255885', '2020-03-09', '', 'Ponce de León Echevarría Augusto', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Estar fuera de su clase e interrumpir otra clase con voces y expresiones insultantes .Desobedecer las instrucciones del profesor para que volviera a clase', 'Leve', 'No', 'No', 0, 1022),
(1064, '3515318', '2020-03-09', '', 'Muñoz Muñoz María Jesús', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Al comienzo de la clase le digo que se cambie de sitio.Cuando ha pasado rato observo que no lo ha hecho', 'Leve', 'No', 'No', 0, 1023),
(1065, '3249315', '2020-03-09', '', 'Blanco Domínguez Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Se niega a hacer el examen práctico. Cuando se le pregunta por qué, contesta  \"porque no quiero\". No es la primera vez que se niega a trabajar.', 'Leve', 'No', 'No', 0, 1024),
(1066, '3255985', '2020-03-10', '', 'Castro Luque Agustín', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'No deja de hablar y distraer a pesar de las advertencias.', 'Leve', 'No', 'Si', 0, 1025),
(1067, '3537160', '2020-03-10', '', 'Castro Luque Agustín', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nTirar objetos, papeles o basura al suelo en cualquier dependencia del centro.\r\n', 'Tira papeles a compañeros con el objeto de perturbar el ritmo de la clase.', 'Leve', 'No', 'No', 0, 1026),
(1068, '3249315', '2020-03-10', '', 'Lara Ruiz Ana', 'Incorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Llega tarde a clase. Entra sin dar ningún tipo de explicación. Le pregunto por qué llega tarde y me contesta \" estaba fuera, como tú llegas siempre tarde\". Últimamente tiene continuas faltas de respeto', 'Leve', 'No', 'Si', 0, 1027),
(1069, '3514231', '2020-03-10', '', 'Muñoz Muñoz María Jesús', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Me pide permiso para coger de mi mesa el cuaderno de otra materia y e digo que al final de clase. Cuando paso por su sitio observo que lo ha cogido y está haciendo la tarea de dicha materia', 'Leve', 'No', 'No', 0, 1028),
(1070, '3807596', '2020-03-10', '', 'Sánchez Luque Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Durante el visionado de un documental está jugando con la capucha, vuelto de espaldas, charlando con otros compañeros y distrayendo a otros que tiene cerca. Lo último es golpear una botella de agua.', 'Leve', 'No', 'No', 0, 1029),
(1071, '4117462', '2020-03-10', '', 'Sánchez Luque Rafael', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\nComer o beber en clase.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\n', 'Durante el visionado de un documental está mascando chicle toda la hora, hablando con otros compañeros, riéndose y con los pies en la cajonera de la mesa. Le he advertido más de 5 veces y sigue. También gesticula para llamar la atención y causar burlas.', 'Leve', 'No', 'No', 0, 1030),
(1072, '4089617', '2020-03-10', '', 'López Galiot Lidia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Lego a clase. Sigue jugando y le da patadas al compañero.', 'Leve', 'No', 'No', 0, 1031),
(1073, '3854636', '2020-03-10', '', 'Luengo López Juan Carlos', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'de forma reiterada habla en clase con los compañeros a pesar de llevar varios días llamándole la atención', 'Leve', 'No', 'No', 0, 1032),
(1074, '3545934', '2020-03-11', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Se pasa el examen charlando y riéndose.', 'Leve', 'No', 'No', 0, 1033),
(1075, '3278506', '2020-03-11', '', 'Román Vázquez Alvaró Jesús', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Se pasa el examen charlando y riéndose.', 'Leve', 'No', 'No', 0, 1034),
(1076, '4077396', '2020-03-11', '', 'Romero García Alejandro', 'Exhibir el móvil en el centro escolar.\r\n', 'Está usando el móvil en clase mientras el profesor explica.', 'Leve', 'No', 'Si', 0, 1035),
(1077, '3527474', '2020-03-11', '', 'Cortes Sánchez Ana María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No deja dar clase, molesta y protesta sin sentido cuando le llamo la atención', 'Leve', 'Si', 'Si', 0, 1036),
(1078, '4089619', '2020-03-12', '', 'Sierra Martín Francisco Manuel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No obedece cuando se le dice que no se habla en clase. Lleva todo el curso haciendo caso omiso de las llamadas de atención.', 'Leve', 'No', 'No', 0, 1037),
(1079, '4256809', '2020-03-12', '', 'Sierra Martín Francisco Manuel', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'No obedece cuando se le dice que no se habla en clase. Lleva todo el curso haciendo caso omiso de las llamadas de atención.', 'Leve', 'No', 'No', 0, 1038),
(1080, '3385032', '2020-03-12', '', 'Cabrero Doncel Carmen', 'Exhibir el móvil en el centro escolar.\r\n', 'Ha sonado el móvil de la alumna fuertemente en clase.', 'Leve', 'No', 'No', 0, 1039),
(1081, '3586147', '2020-03-12', '', 'Abad Ruiz Federico', 'Tirar objetos, papeles o basura al suelo en cualquier dependencia del centro.\r\n', 'Ha dejado el papel de aluminio del bocadillo en el contrapeso de una canasta de baloncesto, en lugar de depositarlo en la papelera.', 'Leve', 'No', 'No', 0, 1040),
(1082, '2685223', '2020-03-12', '', 'Ponce de León Echevarría Augusto', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Interrumpe presentación de compañera con risas y comentarios.', 'Leve', 'No', 'Si', 0, 1041),
(1083, '3875485', '2020-03-12', '', 'Abad Ruiz Federico', 'Tirar objetos, papeles o basura al suelo en cualquier dependencia del centro.\r\n', 'Ha tirado el tetrabrick del zumo al exterior de las vallas, donde se está formando un estercolero pese a que limpiamos hace un año, en lugar de depositarlo en la papelera.', 'Leve', 'No', 'No', 0, 1042),
(1084, '3901292', '2020-03-12', '', 'Abad Ruiz Federico', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Además de pasarse la hora molestando, se va del aula antes de que le dé permiso el profesor, y no devuelve los auriculares que le presté.', 'Leve', 'No', 'No', 0, 1043),
(1085, '3033134', '2020-03-11', '', 'Muñoz Muñoz María Jesús', 'Ignorar las llamadas de atención del personal docente y no docente.\r\n', 'A última hora de clase, sale de la misma antes de que toque el timbre, sin permiso y sabiendo que no se puede salir.', 'Leve', 'No', 'No', 0, 1044),
(1086, '3348606', '2020-03-12', '', 'del Pino Cepelledo Antonio', 'No disponer del material necesario para su aprendizaje.\r\n', 'Dice que se le ha olvidado el libro y el cuaderno de matemáticas, pero no saca ni un bolígrafo ni papel para hacer algo en clase.', 'Leve', 'No', 'No', 0, 1045),
(1087, '7197686', '2020-03-13', '', 'Cortés Guimerá Joaquín ', 'Ignorar las llamadas de atención del personal docente y no docente.\r\nIncorrección y desconsideración hacia otros miembros de la comunidad educativa.\r\nReiteración de conductas contrarias a las normas de convivencia.\r\n', 'Falta de respeto al docente', 'Grave', 'Si', 'No', 0, 1046),
(1088, '3515318', '2020-03-13', '', 'Martínez Ruiz Rocío', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Rocía a un compañero con un espray y le  dice \"infectado ...\"', 'Leve', 'No', 'Si', 0, 1047),
(1089, '3807462', '2020-03-12', '', 'Camino Conde María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Juega con una botella en clase. Cuando le digo que la guarde, me contesta de manera chulesca.', 'Leve', 'No', 'No', 0, 1048),
(1090, '4082648', '2020-03-12', '', 'Camino Conde María', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\nFalta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Contestar con actitud chulesca cuando le doy instrucciones para que realice una actividad de clase', 'Leve', 'No', 'No', 0, 1049);
INSERT INTO `disciplina` (`id_disc`, `NIE`, `fecha`, `hora`, `profesor`, `motivos`, `descripcion`, `tipo`, `revisado`, `expulsion`, `id_medidas`, `numero`) VALUES
(1091, '3870045', '2020-03-13', '', 'Blanco Domínguez Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No hace nada en clase y cuando se le llama la atención se ríe y sigue con la misma actitud.', 'Leve', 'No', 'No', 0, 1050),
(1092, '3913818', '2020-03-13', '', 'Blanco Domínguez Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'Se niega a trabajar. No hace nada en toda la hora. Se excusa de que tiene una muñeca mala, pero hay ejercicios que si puede hacerlos y no quiere.', 'Leve', 'No', 'No', 0, 1051),
(1093, '3514901', '2020-03-13', '', 'Blanco Domínguez Guillermo', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\nIgnorar las llamadas de atención del personal docente y no docente.\r\n', 'No hace nada en clase. Cuando se le llama la atención se ríe y sigue igual. Dice que no sabe hacer nada porque no practica nada.', 'Leve', 'No', 'No', 0, 1052),
(1094, '3363996', '2020-03-13', '', 'Ruiz Gómez Clara Eugenia', 'Falta de colaboración sistemática en la realización de actividades y en el seguimiento de las orientaciones del profesorado.\r\n', 'Le pido que se cambie de sitio y no deja de discutir.', 'Leve', 'No', 'No', 0, 1053),
(1095, '3323951', '2020-03-13', '', 'Ruiz Gómez Clara Eugenia', 'Perturbar el normal desarrollo de las actividades de clase o del centro.\r\n', 'Dice tonterías en clase y no deja dar la clase.', 'Leve', 'No', 'No', 0, 1054),
(1096, '4085662', '2020-03-13', '', 'Serrano Ruiz Gracia', 'Actuaciones perjudiciales para la salud y la integridad personal de los miembros de la comunidad educativa, o la incitación a las mismas. Consumo de alcohol o drogas.\r\n', 'Lanza un estuche de más de medio kilo de peso contra la pizarra desde atrás rozando las cabezas de varios compañeros. Todo, después de estar hablando durante toda la hora, sin sacar el material y haciendo caso omiso a cualquier indiación o toque de atención.', 'Grave', 'No', 'No', 0, 1055),
(1097, '4117462', '2020-03-13', '', 'Toledano Rubio Miguel', 'Agresión física a un miembro de la comunidad educativa.\r\n', 'El alumno molesta, insulta y agrede a un compañero.', 'Grave', 'No', 'No', 0, 1056),
(0, '4075071', '2020-06-08', '', 'Godoy Triviño Miguel', 'Estar fuera del aula entre horas sin permiso.\r\n', 'dfgsdfg', 'Leve', 'Si', 'No', 0, 1058);
