(1, '2019-09-18 09:25:43', 'Después de expulsarlo al aula de convivencia el alumno me llama \"chupapollas\" y \"asqueroso\" delante de toda la clase.', NULL, '09:21:17', '09:21:17', NULL, '', 10, 3, 260, 121, 1, 0, NULL, '18/09/2019', 0),
(2, '2019-09-18 09:25:25', 'El alumno llega tarde a clase y llega comiendo, cuando le digo que deje de comer no lo hace y le da una colleja a un compañero. Después le digo que espere fuera del aula y no lo hace.', 'Hacer prueba de evaluación inicial.', '09:25:25', '09:25:25', NULL, '', 2, 1, 260, 121, 1, 0, NULL, '20/09/2019', 0),
(3, '2019-09-17 09:27:39', 'Llega a clase tarde y dice que ha estado hablando con la orientadora. Mando a una alumna a que pregunte a la orientadora y allí no saben nada de la entrevista.', NULL, '09:27:39', '09:27:39', NULL, '', 1, 1, 379, 91, 1, 0, NULL, '20/09/2019', 0),
(4, '2019-09-19 13:38:58', 'El alumno está comiendo chicle en clase. Luego se tira al suelo e introduce la cabeza en el habitáculo de la mesa donde estaba el ordenador. No deja de habar e interrumpe al profesor.', NULL, '09:30:21', '09:30:21', NULL, '', 2, 1, 112, 124, 3, 0, '01/10/2019', '19/09/2019', 0),
(5, '2019-09-20 13:04:56', 'Cuando entro en clase (A-103/1º C) me encuentro a este alumno en su interior. Le informo que no puede salir entre horas sin estar en una clase que no sea la suya bajo posibilidad de parte, a lo que me responde que le da igual y que mientras antes... mejor. A continuación me invita \"con movimientos\" detrás de mi y ante el aviso de una nueva sanción me indica: \"vale\" \"mejor\".', 'Sin expulsar.', '10:42:04', '10:42:04', NULL, '', 10, 3, 45, 79, 3, 1, '24/10/2019', '20/09/2019', 0),
(6, '2019-09-23 09:40:15', 'Se mete en mi clase siendo de otro grupo, tira la chaqueta a un compañero y cuando le llamo la atención me contesta de forma chulesca y diciendo que le dan igual los partes. Al salir de la clase se demora intencionadamente.', NULL, '09:39:06', '09:39:06', NULL, '', 3, 1, 45, 21, 3, 0, '24/09/2019', '24/09/2019', 0),
(11, '2019-09-24 12:24:34', 'Durante el recreo pone la zancadilla en las escaleras interiores a un compañero, estando a punto este compañero de caerse. No solo no se disculpa sino que además cuando el compañero pide explicaciones, Adrián responde que lo ha hecho porque le ha dado la gana.', NULL, '12:24:34', '12:24:34', NULL, '', 10, 3, 64, 5, 1, 0, NULL, '24/09/2019', 0),
(14, '2019-09-24 13:59:12', 'no deja de molestar en clase, no trabaja', NULL, '13:59:12', '13:59:12', NULL, '', 2, 1, 408, 91, 1, 0, NULL, '24/09/2019', 0),
(15, '2019-09-24 11:52:31', 'interrumpe continuamente, se enfrenta al profesor y hace caso omiso a las indicaciones. después de advertirle en numerosas ocasiones acaba por insultarme, primero dice \"al payaso este\" y luego me llama \"fantasma\"', NULL, '14:02:03', '14:02:03', NULL, '', 10, 3, 112, 17, 3, 0, '26/09/2019', '24/09/2019', 0),
(16, '2019-09-25 09:03:28', 'Ĺo he cambiado de sitio pero no deja de hablar, molestar, hacer comentarios improcedentes etc', 'Fichas de B y G', '12:43:03', '12:43:03', NULL, '', 2, 1, 120, 24, 3, 0, '23/10/2019', '25/09/2019', 0),
(17, '2019-09-20 11:59:57', 'Durante el cambio de clase en los desdobles se mete en mi clase estando yo dentro. Le aviso de que no lo vuelva a hacer y entra de nuevo.', NULL, '11:59:57', '11:59:57', NULL, '', 2, 1, 74, 21, 1, 0, NULL, '26/09/2019', 0),
(18, '2019-09-24 09:29:50', 'Se le advierte al alumno que no coma en clase, 10 minutos después se levanta sin pedir permiso, se acerca a la papelera terminando de comerse lo que le quedaba y tira a la papelera el plástico.', NULL, '09:29:50', '09:29:50', NULL, '', 2, 1, 248, 128, 1, 0, NULL, '27/09/2019', 0),
(19, '2019-09-27 13:10:17', 'La alumna está en clase charlando y molestando. Le advierto de que si continúa le pondré un parte y sigue haciéndolo. Así que se le impone la sanción.', NULL, '10:03:58', '10:03:58', NULL, '', 2, 1, 267, 121, 3, 0, '02/10/2019', '27/09/2019', 0),
(20, '2019-09-27 09:40:27', 'No trae material, se negaba a cambiarse de sitio. Continuamente interrumpe y llama la atención.', 'Hacer ejercicios de la primera página del libro que hay en convivencia de 1º ESO Inglés.', '10:50:27', '10:50:27', NULL, '', 3, 1, 120, 69, 3, 0, '27/09/2019', '27/09/2019', 0),
(21, '2019-09-26 13:38:03', 'Ha hecho un comentario grosero en clase', NULL, '13:01:22', '13:01:22', NULL, '', 3, 1, 112, 2, 3, 0, '01/10/2019', '30/09/2019', 0),
(22, '2019-09-30 13:31:53', 'Tengo que llamarle la atención en repetidas ocasiones por hablar con Brenda. Al ponerle el parte a su compañera elijo a otro alumno para que la acompañe a Jefatura. Se levante de su sitio de forma desafiante diciendo que debería ser ella quien vaya. Ni con la amenaza del parte se sienta.', 'NO HACE LAS ACTIVIDADES PORQUE DICE QUE NO TIENE EL LIBRO', '13:31:53', '13:31:53', NULL, '', 3, 1, 278, 119, 1, 0, NULL, '30/09/2019', 0),
(23, '2019-09-30 13:10:01', 'No trabaja e interrumpe constantemente, pese a haber sido cambiada de sitio', 'NO HACE LAS TAREAS PORQUE DICE QUE NO TIENE EL LIBRO', '13:33:55', '13:33:55', NULL, '', 2, 1, 267, 119, 3, 0, '02/10/2019', '30/09/2019', 0),
(24, '2019-09-30 13:36:32', 'SE TIRA POR LA VENTANA DESDE LA PRIMERA PLANTA HASTA EL PATIO', NULL, '14:03:01', '14:03:01', NULL, '', 10, 3, 112, 42, 3, 0, '01/10/2019', '30/09/2019', 0),
(25, '2019-09-30 11:09:59', 'El alumno se cuela en el aula de 1º ESO E y se hace pasar por alumno de esta clase.', NULL, '09:27:31', '09:27:31', NULL, '', 10, 3, 225, 124, 3, 0, '05/12/2019', '30/09/2019', 0),
(28, '2019-10-01 11:09:38', 'Le dice el profesor en repetidas ocasiones que tire a la papelera un avión. Se niega y lo vueleve a sacar en repetidas ocasiones.', 'Copiar páginas 32 y 33 del libro.', '13:04:57', '13:04:57', NULL, '', 2, 1, 225, 36, 3, 0, '05/12/2019', '01/10/2019', 0),
(29, '2019-10-01 13:12:21', 'No trae material, no trabaja después de entregárselo. Cuando hay una prueba oral y manda silencio \"se ríe\"', 'Fotocopias nº 4, 5 y 10.', '13:12:21', '13:12:21', NULL, '', 2, 1, 256, 15, 1, 0, NULL, '01/10/2019', 0),
(30, '2019-10-01 13:09:10', 'No para de molestar en clase a pesar de mis llamadas de atención. Bromea y se ríe cuando lo expulso.', 'Actividades 2.1, 2.2 y 2.3. Copiar apartado 2.2 del tema 1.', '13:43:55', '13:43:55', NULL, '', 2, 1, 7, 71, 3, 0, '03/10/2019', '01/10/2019', 0),
(31, '2019-10-01 11:02:47', 'Se ríe y bromea cuando decido expulsar a un compañero. Lo sigue haciendo a pesar de que le advierto varias veces', 'actividades 21,22,23. Copiado apartado 22 tema 1', '14:02:34', '14:02:34', NULL, '', 2, 1, 18, 71, 3, 0, '02/10/2019', '01/10/2019', 0),
(32, '2019-10-01 14:06:58', 'Se levanta, se coloca en mitad de la clase y lanza a la papelera un papel intentando encestar', 'copiar páginas 26 y 27 del libro de tecnología', '14:06:58', '14:06:58', NULL, '', 2, 1, 331, 36, 1, 0, NULL, '01/10/2019', 0),
(33, '2019-10-02 11:09:20', 'Se encuentra a la hora de clase en otro aula. Permanece en el otro aula. Permanece en el otro aula  (tecnología) hasta que el profesor se da cuenta y lo acompaña a su clase. Ya lo he hecho en otras ocasiones.', 'Ninguna', '11:03:42', '11:03:42', NULL, '', 2, 1, 225, 88, 3, 0, '05/12/2019', '02/10/2019', 0),
(34, '2019-10-02 08:30:19', 'se dedica a tirar gomitas al compañero desde la otra punta de la clase. No trabaja y se pasa parte de la clase riéndose.', 'página 18, actividades 6, 7 y 8', '12:32:29', '12:32:29', NULL, '', 2, 1, 8, 68, 3, 0, '07/10/2019', '02/10/2019', 0),
(35, '2019-10-02 11:01:41', 'Habla de manera irrespetuosa a sus compañeros, gritándoles. No deja de molestar y reírse. Al recriminarle dice \"cuando lo vea salir del instituto, lo mato\", refiriéndose a un compañero.', 'pag 18, act 6, 7 y 8', '12:37:39', '12:37:39', NULL, '', 2, 1, 18, 68, 3, 0, '02/10/2019', '02/10/2019', 0),
(36, '2019-10-02 14:07:58', 'Llego a clase y la empiezo y Villodres llega tarde. Dice que quiere que lo cambien de clase.', NULL, '12:53:53', '12:53:53', NULL, '', 1, 1, 316, 91, 3, 0, '21/10/2019', '02/10/2019', 0),
(37, '2019-10-02 13:42:08', 'Se levanta sin permiso, molesta, \"hace chistes\" y en general se toma la clase a pitorreo. Persiste en las bromas con una botella de agua.', 'Actividad 1 de la página 50.', '13:42:08', '13:42:08', NULL, '', 2, 1, 331, 36, 1, 0, NULL, '02/10/2019', 0),
(38, '2019-10-02 14:17:51', 'Se hace el gracioso cada vez que paso lista y lo nombro. A pesar de darle unas cuantas indicaciones para corregir su comportamiento, lo ignora. Hoy ha llegado 10 minutos tarde a clase', NULL, '14:17:51', '14:17:51', NULL, '', 2, 1, 64, 21, 1, 0, NULL, '02/10/2019', 0),
(39, '2019-10-04 09:40:29', 'Retraso entrada en clase', 'Realización fichas técnicas.', '09:40:29', '09:40:29', NULL, '', 1, 1, 629, 13, 1, 0, NULL, '04/10/2019', 0),
(40, '2019-10-04 09:44:53', 'Retraso entrada a clase', 'Realización fichas técnicas', '09:44:53', '09:44:53', NULL, '', 1, 1, 601, 13, 1, 0, NULL, '04/10/2019', 0),
