(42, '2019-10-04 09:50:04', 'Retraso entrada en clase', 'Realización fichas técnicas', '09:50:04', '09:50:04', NULL, '', 1, 1, 617, 13, 1, 0, NULL, '04/10/2019', 0),
(43, '2019-10-04 09:51:20', 'Retraso entrada a clase', 'Realización fichas técnicas', '09:51:20', '09:51:20', NULL, '', 1, 1, 586, 13, 1, 0, NULL, '04/10/2019', 0),
(44, '2019-10-04 09:53:43', 'En clase se quita el zapato y el calcetín y le enseña el pie a su compañero. Le digo que si es tonto y me responde que la tonta soy yo.', 'Copiar un texto del libro', '09:53:43', '09:53:43', NULL, '', 2, 1, 398, 91, 1, 0, NULL, '04/10/2019', 0),
(47, '2019-10-01 11:07:12', 'Estando en clase escucho un golpe que suena como una colleja. La clase se sorprende de como ha sonado. Ha sido un grupo de cuatro alumnos. Les pido que salga el que ha sido, de lo contrario se le pondrá un parte a los cuatro.', NULL, '11:07:12', '11:07:12', NULL, '', 10, 3, 210, 121, 1, 0, NULL, '04/10/2019', 0),
(49, '2019-10-03 12:23:33', 'Entre clases me la encuentro fuera del aula.Interrumpe la clase constantemente pidiendo ir al baño,hablando a voces y de forma poco correcta.Finalmente, se va del aula sin permiso.Antes de csalir dice \"si me vas a poner un parte por no poder ir al baño, vaya mierda de parte\".', 'Ejercicios p.17.', '12:23:33', '12:23:33', NULL, '', 2, 1, 278, 119, 1, 1, NULL, '04/10/2019', 0),
(50, '2019-10-01 12:30:37', 'estaba usando el móvil en clase', NULL, '12:30:37', '12:30:37', NULL, '', 4, 1, 112, 19, 1, 0, NULL, '01/10/2019', 0),
(51, '2019-10-04 13:46:07', 'Sale del centro en el recreo sin permiso, suplantando la identidad de una alumna con el carnet que habilita este permiso', NULL, '13:46:07', '13:46:07', NULL, '', 10, 3, 430, 5, 1, 0, NULL, '04/10/2019', 0),
(52, '2019-10-04 09:05:31', 'Molesta durante la clase. Se levanta, se tumba encima de la mesa. Le dice al compañero comentarios desde la otra punta de la clase.', 'Copiar página 15 del libro.', '14:26:57', '14:26:57', NULL, '', 3, 1, 18, 68, 3, 0, '23/10/2019', '04/10/2019', 0),
(53, '2019-10-07 09:43:04', 'Ivan , alumno de 4º ESO A, abrió la puerta y entró en la clase de 4º ESO B sin permiso, a las 14,40 horas del pasado viernes 4 de octubre. Con gestos, el dedo indice de la mano izquierda sobre la muñeca de la mano derecha me indicó que la clase había terminado. Todo esto mientras yo impartía clase en 4º B. Salió del aula , salí tras él\"y le dije que le pondría un parte.Sacó pecho\" literalmente y me dijo que NO PODÍA y se fue hacia la escalera de la primera planta.', NULL, '09:43:04', '09:43:04', NULL, '', 10, 3, 433, 67, 1, 0, NULL, '07/10/2019', NULL),
(54, '2019-10-07 13:37:59', 'Entra clase tarde. Le digo que tire el chicle y al rato tiene otro en la boca. Cuando le aviso que le voy a poner un parte contesta mal. le digo que hable con respeto y dice que habla como le sale de la polla. Continúa su comportamiento mientras escribo el parte', NULL, '13:37:59', '13:37:59', NULL, '', 10, 3, 260, 88, 1, 0, NULL, '07/10/2019', NULL),
(55, '2019-10-07 13:42:10', 'Cuando le digo que saque material para trabajar no hace caso y no para de contestar con comentarios \"graciosos\": le aviso que le voy a poner un parte y sigue igual. Sigue con la misma actitud', NULL, '13:42:10', '13:42:10', NULL, '', 3, 1, 252, 88, 1, 0, NULL, '07/10/2019', NULL),
(56, '2019-10-01 14:00:31', 'estaa usando el movil en clase', NULL, '14:00:31', '14:00:31', NULL, '', 4, 1, 113, 19, 3, 0, '07/10/2019', '01/10/2019', NULL),
(57, '2019-10-07 10:57:56', 'el alumno no trae firmads 2 notas a los padres a pesar de estar advertido de que no hacerlo supondria un parte', NULL, '14:04:17', '14:04:17', NULL, '', 2, 1, 200, 121, 3, 0, '09/10/2019', '07/10/2019', NULL),
(58, '2019-10-08 10:56:26', 'No trae firmada una nota para la casa, después de advertírselo.', 'No va al aula', '10:56:26', '10:56:26', NULL, '', 2, 1, 219, 121, 1, 0, NULL, '08/10/2019', NULL),
