(65, '2019-10-08 14:33:16', 'Amenaza a un compañero \"como diga algo de mí, lo reviento\"', NULL, '14:33:16', '14:33:16', NULL, '', 10, 3, 260, 119, 1, 0, NULL, '08/10/2019', NULL),
(66, '2019-10-08 09:32:50', 'La alumna no trae firmada una nota a sus padres a pesar de estar advertida de que no hacerlo le supondría un parte.', NULL, '09:32:50', '09:32:50', NULL, '', 2, 1, 219, 121, 1, 0, NULL, '09/10/2019', NULL),
(67, '2019-10-09 09:55:12', 'Está haciendo ruiditos toda la clase. Intensifica los ruidos con llaves. Pone el móvil en la mesa. Le llamo la atención varias veces y le pido que se vaya al pasillo a hacer ruidos. Coge las llaves y el teléfono golpeando con ellos la mesa. Sale de clase dando patadas a las puertas. Me asomo al pasillo y ha desaparecido.', NULL, '09:55:12', '09:55:12', NULL, '', 10, 3, 552, 93, 1, 0, NULL, '09/10/2019', NULL),
(68, '2019-10-09 09:38:14', 'Suele llegar siempre tarde cuando le he dicho que 5 faltas de puntualidad son motivo de parte, me ha dicho que eso es mentira.', NULL, '10:27:42', '10:27:42', NULL, '', 2, 1, 139, 69, 3, 0, '09/10/2019', '09/10/2019', NULL),
(69, '2019-10-09 10:25:18', 'El alumno después de reiteradas amonestaciones orales está sin atender,  hablando en voz alta con comentarios fuera de lugar, no admisibles en el aula.', NULL, '12:38:46', '12:38:46', NULL, '', 2, 1, 193, 15, 3, 0, '11/10/2019', '09/10/2019', NULL),
(70, '2019-10-09 12:42:14', 'Le dice al profesor: \"Que te calles ya bizco de mierda\". Al salir del aula dice \"a ver si te operan el ojo un poco y no seas como Roberto, que llora\"', NULL, '12:42:14', '12:42:14', NULL, '', 10, 3, 260, 119, 1, 0, NULL, '09/10/2019', NULL),
