(74, '2019-10-09 13:57:43', 'Después de que el profesor llame la atención a gritos a todo el grupo, el alumno se ríe', NULL, '13:57:42', '13:57:42', NULL, '', 3, 1, 379, 54, 1, 0, NULL, '09/10/2019', NULL),
(75, '2019-10-09 10:10:29', 'El profesor le llama la atención y el alumno se ríe en su cara', NULL, '13:59:56', '13:59:56', NULL, '', 3, 1, 378, 54, 3, 0, '09/10/2019', '09/10/2019', NULL),
(76, '2019-10-10 09:49:44', 'Brenda continuamente altera el normal desarrollo de la clase, protesta porque le llamo la atención por distraerse con la compañera', 'Ficha de actividades', '09:49:44', '09:49:44', NULL, '', 2, 1, 267, 48, 1, 1, NULL, '10/10/2019', NULL),
(77, '2019-10-09 10:06:01', 'Interrumpe continuamente el proceso de enseñanza-aprendizaje', 'Realización fichas técnicas y estudio de la materia (PYC/TCV)', '10:06:00', '10:06:00', NULL, '', 2, 1, 596, 13, 1, 0, NULL, '09/10/2019', NULL),
(78, '2019-10-10 12:12:44', 'Estando explicando, de espaldas, en la pizarra oigo un sonido similar a un \"guantazo/tortazo\". Cuando me vuelvo,observo que Felipe ha salido de su asiento, pasando bajo la mesa y golpeado \"de broma\" a un compañero (Diego) en la espalda.', 'Ninguna. No se expulsa al aula de convivencia.', '12:12:44', '12:12:44', NULL, '', 3, 1, 61, 79, 1, 0, NULL, '10/10/2019', NULL),
(79, '2019-10-10 12:21:26', 'Interrumpe la clase en repetidas ocasiones sin hacer caso de mis llamadas de atención.', 'Copiar páginas 34 y 35.', '12:21:26', '12:21:26', NULL, '', 2, 1, 301, 36, 1, 0, NULL, '10/10/2019', NULL),
(80, '2019-10-08 13:17:51', 'No para de hablar. Se le avisa varias veces y sigue. Le digo que copie del libro y no hace nada. Sigue charlando.', NULL, '13:17:51', '13:17:51', NULL, '', 2, 1, 210, 88, 1, 0, NULL, '10/10/2019', NULL),
(81, '2019-09-30 13:22:19', 'El alumno pide ir a beber agua. Le contesto que no y responde \"joder\".', 'Estudiar lo explicado en clase.', '13:22:19', '13:22:19', NULL, '', 2, 1, 504, 16, 3, 0, '08/10/2019', '10/10/2019', NULL),
(82, '2019-10-10 10:44:50', 'Se pasa la clase hablando , hace ruido vaciando un típex, le llamo la atención y continúa haciendo ruido', NULL, '09:11:46', '09:11:46', NULL, '', 2, 1, 500, 68, 3, 0, '15/10/2019', '11/10/2019', NULL),
(83, '2019-10-11 13:08:54', 'la veo  inflando una bolsa con la intención de explotarla , lo miro y le digo que no lo haga y se levanta y lo hace.\r\n(no trae tareas puestas , se le da permiso para subir a clase y pedir tareas)', 'pagina 17 y 19', '12:12:35', '12:12:35', NULL, '', 2, 1, 200, 68, 3, 0, '25/10/2019', '11/10/2019', NULL),
