(200, '2019-10-28 11:07:33', 'No se sienta en clase. Me pone el brazo encima en actitud chulesca.Le amonesto y continua chuleando.Cuando le expulso del aula sigue insultando y se va dando un portazo.\r\n(el alumno llega al aula de convivencia sin parte alguno. Le mando subir y se niega.Insulta al profesor quie le ha puesto el parte \"Mr.Bean\"\r\nBaja con el parte al aula y en actitud de pasarlo muy bien en el aula, riendo y liandola con adrian y angel.Le mando con Juan Ribera a su despacho para evitar mas faltas de disciplina.Lourdes Ventura, de guardia a 6 hora del lunes)', NULL, '14:23:06', '14:23:06', NULL, '', 10, 3, 45, 124, 3, 0, '05/12/2019', '28/10/2019', NULL),
(201, '2019-10-28 12:56:59', 'Hace semanas le escribi una nota en la agenda para informar a sus padres de su comportamiento en clase.Al pedirselo firmada me dice que no le he escrito ninguna nota y posteriormente observo que ha arrancado la hoja', NULL, '14:28:08', '14:28:08', NULL, '', 2, 1, 189, 68, 3, 0, '29/10/2019', '28/10/2019', NULL),
