(278, '2019-11-11 10:03:00', 'Raquel ha llegado tarde, se sienta con los libros encima de la mesa y cerrados. Se dedica a distraer a la compañera de al lado y a los de atrás. Le aviso muchas veces de que no distraiga a los compañeros y que copie los ejercicios de la pizarra. se niega y me dice que soy una pesada.\r\nRaquel estuvo el último día de clase protestando porque según ella no veía y por esa razón no trabajaba. Hoy está sentada más cerca de la pizarra y no tiene excusa ninguna para no copiar los ejercicios de la pizarra. Raquel molesta, distrae y se enfrenta cuando se le llama la atención. Se niega a aceptar las normas mínimas de convivencia. No hace caso ninguno cuando le llamo la atención y se niega a cambiarse de sitio si se lo propongo.\r\nDespués de clase la llamo para hablar con ella y me dice que \"soy una pesada\" que \"no tiene ganas de hablar\" .', 'No ha sido expulsada al aula de convivencia', '10:01:28', '10:01:28', NULL, '', 10, 3, 278, 48, 1, 0, NULL, '11/11/2019', NULL),
