(422, '2019-11-22 09:07:27', 'Tras llamarle la atención e indicarle que se metiese en el aula, se encara con su profesora Lola Pérez, se le indica que baje a Jefatura y busca el enfrentamiento con comentarios como \"no eres nadie para decirme nada\", \"el centro tendría que explotar\", \"tendría que venir un colgado a prenderte fuego\".', NULL, '09:07:27', '09:07:27', NULL, '', 10, 3, 379, 44, 1, 0, NULL, '22/11/2019', NULL),
(423, '2019-11-26 09:10:09', 'Está en todos los cambios de clase fuera. A pesar de ordenar el profesor que entre en clase, sigue fuera. Grita en los pasillos y se empuja mutuamente con Adrián Arévalo. Hace el comentario \"Voy a poner una bomba\"', NULL, '09:10:09', '09:10:09', NULL, '', 10, 3, 379, 29, 1, 0, NULL, '22/11/2019', NULL),
(424, '2019-11-26 09:11:48', 'Está en todos los cambios de clase fuera. A pesar de las llamadas de atención, sigue fuera, grita en los pasillos y empuja a Salvador León.', NULL, '09:11:48', '09:11:48', NULL, '', 10, 3, 371, 29, 1, 0, NULL, '22/11/2019', NULL),
(425, '2019-11-25 09:13:21', 'Se lleva parte de una instalación hecha para conmemorar el día contra la Violencia de Género.', NULL, '09:13:21', '09:13:21', NULL, '', 10, 3, 418, 42, 1, 0, NULL, '25/11/2019', NULL),
(426, '2019-11-25 09:15:40', 'El conserje le señala que no puede estar en el hueco de la escalera y le contesta que no quiere irse, formas inapropiadas.', NULL, '09:15:40', '09:15:40', NULL, '', 3, 1, 433, 42, 1, 0, NULL, '25/11/2019', NULL),
(428, '2019-11-25 10:15:44', 'Estoy todo el rato mandándolo callar. Cuando lo saco fuera para charlar con él, me reta y se ríe. Al final de la clase he intentado que se disculpe y olvidar el parte, pero sigue \"riendo\"', NULL, '10:15:44', '10:15:44', NULL, '', 10, 3, 208, 69, 1, 0, NULL, '26/11/2019', NULL),
(429, '2019-11-26 11:58:10', 'No ha devuelto el parte que le puse hace mucho tiempo', NULL, '11:58:10', '11:58:10', NULL, '', 2, 1, 331, 36, 1, 0, NULL, '26/11/2019', NULL),
(430, '2019-11-26 12:59:37', 'No obedece, no trabaja en clase.', NULL, '12:59:37', '12:59:37', NULL, '', 2, 1, 353, 53, 1, 0, NULL, '26/11/2019', NULL),
(432, '2019-11-26 13:42:11', 'Sin entregar el parte del día 14 de noviembre (sin firmar). Anotación en la agenda el día 21.', NULL, '13:39:52', '13:39:52', NULL, '', 2, 1, 252, 15, 3, 0, '13/01/2020', '26/11/2019', NULL),
(433, '2019-11-26 13:50:53', 'le he llamado la atención de forma reiterada y la última vez lo he encontrado jugando en el suelo', NULL, '13:50:53', '13:50:53', NULL, '', 2, 1, 371, 131, 1, 0, NULL, '26/11/2019', NULL),
(434, '2019-11-26 14:13:49', 'Molesta en clase en un examen', NULL, '14:13:49', '14:13:49', NULL, '', 2, 1, 379, 91, 1, 0, NULL, '26/11/2019', NULL),
(435, '2019-11-26 14:39:17', 'pone el pie en la pared y la ensucia', NULL, '14:39:17', '14:39:17', NULL, '', 4, 1, 371, 91, 1, 0, NULL, '26/11/2019', NULL),
(436, '2019-11-27 09:14:57', 'Accede al centro tarde (8:34 h) diciendo que es alumno de FPB y enfrentándose a los conserjes, pues es alumno de 3º ESO', NULL, '09:14:57', '09:14:57', NULL, '', 1, 1, 408, 5, 1, 0, NULL, '27/11/2019', NULL),
(437, '2019-11-27 09:17:12', 'De forma reiterada accede tarde al centro. Tras haberle advertido en reiteradas ocasiones reincide en su actitud', NULL, '09:17:12', '09:17:12', NULL, '', 1, 1, 371, 5, 1, 0, NULL, '27/11/2019', NULL),
(438, '2019-11-27 10:35:57', 'Uso del teléfono durante la clase. La última vez le he encontrado en el suelo jugando.', NULL, '10:35:57', '10:35:57', NULL, '', 2, 1, 371, 131, 1, 0, NULL, '27/11/2019', NULL),
(439, '2019-11-27 09:58:05', 'El alumno lleva dos días sin traer firmada una nota a sus padres a pesar de estar advertido de que no hacerlo le supondría un parte.', NULL, '10:40:08', '10:40:08', NULL, '', 2, 1, 251, 121, 3, 0, '04/12/2019', '27/11/2019', NULL),
(440, '2019-11-27 09:58:29', 'El alumno lleva dos días sin traer firmada una nota de sus padres, a pesar de estar advertido de que no hacerlo le supondría un parte.', NULL, '10:42:16', '10:42:16', NULL, '', 2, 1, 244, 121, 3, 0, '04/12/2019', '27/11/2019', NULL),
(441, '2019-11-27 10:51:54', 'Le he avisado en repetidas ocasiones y sigue molestando. Al intentar explicar yo, me ha dicho \"tiene premio\".', 'Ficha 2 de dibujo técnico del libro Tecnología del aula de convivencia.', '10:51:53', '10:51:53', NULL, '', 2, 1, 143, 36, 1, 0, NULL, '27/11/2019', NULL);
INSERT INTO `partes` (`id`, `fecha`, `descripcion`, `tareas`, `horaSalidaAula`, `horaLlegadaJefatura`, `formato`, `observacion`, `puntos`, `idTipo`, `idAlumno`, `idProfesor`, `idEstado`, `recupera`, `fechaConfirmacion`, `fechaComunicacion`, `numero`) VALUES
(442, '2019-11-27 10:53:13', 'No trabaja nada, no para de hablar con la compañera y, aunque se le advierte, sigue charlando sin parar', NULL, '11:48:37', '11:48:37', NULL, '', 2, 1, 204, 88, 3, 0, '13/12/2019', '27/11/2019', NULL),
(443, '2019-11-27 09:46:13', 'Llega después del recreo, no trae uniforme para las horas de taller, se va de clase sin permiso.', NULL, '12:21:37', '12:21:37', NULL, '', 2, 1, 555, 72, 3, 0, '28/11/2019', '27/11/2019', NULL),
(444, '2019-11-26 12:59:53', 'Arranca parte de una instalación hecha en el Centro para conmemorar el día contra la Violencia de Género.', NULL, '12:59:53', '12:59:53', NULL, '', 10, 1, 331, 42, 1, 0, NULL, '27/11/2019', NULL),
(445, '2019-11-27 09:39:04', 'El alumno contesta de forma irrespetuosa continuamente, en tono de burla e ironía. Se ríe durante las clases, si se le llama la atención contesta de forma altiva, se sienta donde quiere sin permiso, etc', NULL, '09:39:04', '09:39:04', NULL, '', 10, 1, 504, 68, 1, 0, NULL, '27/11/2019', NULL),
(446, '2019-11-28 09:41:51', 'El alumno está utilizando el móvil en clase.', NULL, '09:41:51', '09:41:51', NULL, '', 4, 1, 443, 131, 1, 0, NULL, '28/11/2019', NULL),
(447, '2019-11-27 09:45:22', 'Se le llama la atención por no parar de hablar. No hace caso y dice que no se va a callar. Está un rato profiriendo gritos racistas a un compañero llamándole inmigrante de manera repetitiva. Sigue sin hacer caso y dice que le da igual tener parte. Sigue interrumpiendo y molestando.', NULL, '09:45:21', '09:45:21', NULL, '', 10, 1, 219, 17, 1, 0, NULL, '27/11/2019', NULL),
(448, '2019-11-28 12:51:43', 'En clase, de \"broma\" con el compás le quiere pinchar  la oreja del compañero.', 'Lámina nº 62', '10:01:00', '10:01:00', NULL, '', 3, 1, 167, 15, 3, 0, '05/12/2019', '28/11/2019', NULL),
(449, '2019-11-26 11:08:52', 'Tira parte de una instalación puesta para celebrar e día contra la violencia de género', NULL, '11:08:52', '11:08:52', NULL, '', 10, 1, 145, 130, 3, 0, '26/11/2019', '28/11/2019', NULL),
(450, '2019-11-27 12:39:52', 'Se pasa gran parte de la hora de clase tumbado sobre la mesa, literalmente durmiendo. Despierta y echa mano del móvil para ver la hora.\r\nSe dirige a mí diciendo: \"Cucha, la víctima...\"', NULL, '12:04:57', '12:04:57', NULL, '', 3, 1, 331, 76, 1, 0, NULL, '28/11/2019', NULL),
(452, '2019-11-28 14:31:25', 'Ya le avisé que no debe usar el piano en modo juego pero sigue haciéndolo', NULL, '14:31:25', '14:31:25', NULL, '', 2, 1, 113, 2, 1, 0, NULL, '28/11/2019', NULL),
(453, '2019-11-28 14:34:47', 'Desde la ventana del aula ha llamado \"mari...\" a un compañero. Lo llamo para que venga a mi aula a ponerle el parte el parte pero no baja.', NULL, '14:34:47', '14:34:47', NULL, '', 10, 1, 31, 2, 1, 0, NULL, '28/11/2019', NULL),
(454, '2019-11-29 12:43:45', 'No para de interrumpir, hablar alto, a pesar de la advertencias', 'Terminar fichas', '12:43:45', '12:43:45', NULL, '', 2, 1, 112, 81, 1, 0, NULL, '29/11/2019', NULL),
(455, '2019-11-28 13:00:36', 'Falta total de educación, haciendo ruidos continuamente e interrumpiendo la clase.', NULL, '12:59:42', '12:59:42', NULL, '', 2, 1, 36, 28, 1, 0, NULL, '29/11/2019', NULL),
(456, '2019-11-28 13:41:26', 'Está interrumpiendo la clase continuamente. Falta total de educación, contestando continuamente.', NULL, '13:02:59', '13:02:59', NULL, '', 2, 1, 29, 28, 3, 0, '02/12/2019', '28/11/2019', NULL),
(457, '2019-11-28 13:05:00', 'No traer el parte firmado del día 14 de noviembre.', NULL, '13:05:00', '13:05:00', NULL, '', 2, 1, 219, 36, 1, 0, NULL, '28/11/2019', NULL),
(458, '2019-11-28 14:10:19', 'No para de hablar, interrumpe continuamente a diario. Se pone a mandar silencio sin que nadie se lo pida. Silba en medio de la clase para pedir que se callen los demás.', NULL, '13:08:10', '13:08:10', NULL, '', 2, 1, 167, 17, 3, 0, '05/12/2019', '29/11/2019', NULL),
(459, '2019-11-28 13:09:42', 'No ha traído el parte firmado del día 14 de noviembre.', NULL, '13:09:42', '13:09:42', NULL, '', 2, 1, 208, 36, 1, 0, NULL, '29/11/2019', NULL),
(460, '2019-11-29 12:54:49', 'Después de media hora de clase no ha abierto la mochila. Le digo reiteradamente que se calle y no obedece.', 'Pintar un mandala.', '13:33:41', '13:33:41', NULL, '', 2, 1, 18, 94, 3, 0, '02/12/2019', '29/11/2019', NULL),
(461, '2019-11-29 14:14:32', 'REALIZA MANIOBRAS PELIGROSAS CON ELEMENTOS QUE PUEDEN SER DAÑINOS.\r\nEntro en el Aula de pastelería y me encuentro a Pedro Fernández empujando a la alumna Isabel Estela contra la estantería  jugando. Testigo MariNieves.\r\nGRAVE: Reiteración', NULL, '14:14:32', '14:14:32', NULL, '', 10, 1, 596, 44, 1, 0, NULL, '29/11/2019', NULL),
(462, '2019-11-29 13:32:47', 'No se sienta en su sitio, molesta a su compañero dándole patadas. Me contesta de forma irrespetuosa (\"estoy hasta la polla\"). Dice que romperá el parte.', 'Folio de actividades entregado.', '14:24:50', '14:24:50', NULL, '', 2, 1, 18, 68, 3, 0, '05/12/2019', '29/11/2019', NULL),
(463, '2019-12-02 11:11:15', 'el alumno no hace nada, solo se dedica a charlar', NULL, '11:11:15', '11:11:15', NULL, '', 2, 1, 210, 128, 1, 0, NULL, '02/12/2019', NULL),
(464, '2019-12-02 11:04:53', 'el alumno no hace nada, le comento que le voy a poner un parte por ello y me contesta de mala manera faltándome al respeto', NULL, '11:12:41', '11:12:41', NULL, '', 2, 1, 225, 128, 3, 0, '05/12/2019', '02/12/2019', NULL),
(465, '2019-12-02 13:42:02', 'Estaba utilizando el móvil', NULL, '11:57:40', '11:57:40', NULL, '', 4, 1, 479, 53, 3, 0, '02/12/2019', '02/12/2019', NULL),
(466, '2019-12-02 12:14:48', 'Grita y alborota', 'Fichas de Biología   No trae los materiales de la materia\r\ny hace Inglés', '12:14:48', '12:14:48', NULL, '', 2, 1, 112, 24, 1, 0, NULL, '02/12/2019', NULL),
(467, '2019-12-02 13:09:04', 'La alumna llega 15 minutos tarde, le digo que tiene retraso y contesta que no tiene ninguno. Se va a su sitio haciendo un comentario que no escucho. Cuando le digo que lo repita contesta: \"Deberías estar más atento\"', 'Cuentas de fracciones', '13:09:04', '13:09:04', NULL, '', 10, 1, 278, 119, 1, 0, NULL, '02/12/2019', NULL),
(468, '2019-12-02 09:49:04', 'Le he avisado desde que entré en clase pero no para de hablar, levantarse y alterar la clase. Contesta de malos modales cuando le llamo la atención', 'Estudiar para mañana el examen del tema 2', '13:16:52', '13:16:52', NULL, '', 2, 1, 176, 48, 3, 0, '04/12/2019', '02/12/2019', NULL),
(469, '2019-12-02 11:02:36', 'Está lanzando gomas a un compañero, se le amonesta y no deja de hacerlo.El profesor se equivoca al llamr a un compañero y él le insulta llamándole \"tonto\".Manipula el tecladodel ordenador sin permiso.', 'Actividades pg. 58 y 59 del libro', '14:18:08', '14:18:08', NULL, '', 10, 1, 45, 124, 3, 0, '05/12/2019', '02/12/2019', NULL),
(470, '2019-12-02 09:24:22', 'Durante un examen pillo a Sergio hablando e intentando hablar con la compañera de delante,con la intención de copiarse.Lo veo hasta en 2 ocasiones en esa actitud, lo aviso de que como vuelva a verlo\r\nle quito el xamen y empieza acontestrame y dice cosas como \" Os creeis que por ser profesores teneis má derechos...\"', NULL, '14:23:25', '14:23:25', NULL, '', 3, 1, 430, 48, 3, 0, '10/12/2019', '02/12/2019', NULL),
(471, '2019-12-03 09:33:07', 'Silba en clase', NULL, '09:33:07', '09:33:07', NULL, '', 2, 1, 112, 81, 1, 0, NULL, '03/12/2019', NULL),
(472, '2019-12-03 10:43:18', 'Rompe el cristal de un extintor.', 'No procede', '10:43:18', '10:43:18', NULL, '', 4, 1, 113, 42, 1, 0, NULL, '03/12/2019', NULL),
(473, '2019-12-03 13:18:36', 'No sigue mis indicaciones, habla, molesta, rompe el bolígrafo de un compañero', 'Actividades 4, 5, 6, 7 de la página 55', '12:38:37', '12:38:37', NULL, '', 4, 1, 186, 68, 3, 0, '03/12/2019', '03/12/2019', NULL),
(474, '2019-12-03 12:46:32', 'Se enfada con  un compañero mientras hace una ficha, le tira la mochila a la papelera, le quita las gafas y se las tira al pasillo. Este compañero miente, no es propio de él', NULL, '12:46:32', '12:46:32', NULL, '', 3, 1, 119, 8, 1, 0, NULL, '03/12/2019', NULL),
(475, '2019-12-03 12:56:46', 'No deja de hablar durante la explicaciones.Se pasa gran parte de la hora hablando con el compañero y mirando para atrás.', NULL, '12:56:46', '12:56:46', NULL, '', 2, 1, 173, 68, 1, 0, NULL, '03/12/2019', NULL),
(476, '2019-12-03 12:58:11', 'No deja de hablar y de molestar durante las explicaciones.', NULL, '12:58:11', '12:58:11', NULL, '', 2, 1, 193, 68, 1, 0, NULL, '03/12/2019', NULL),
(477, '2019-12-03 13:30:08', 'Utiliza el teléfono móvil en el aula de convivencia, durante su expulsión de dos días.', NULL, '13:30:08', '13:30:08', NULL, '', 4, 1, 371, 68, 1, 1, NULL, '03/12/2019', NULL),
(478, '2019-12-03 14:01:46', 'ha puesto en el ordenador del aula el cara al sol, y tenía la pizarra digital encendida. Está usando el móvil en clase, mientras relleno el parte está cantando el inicio del cara al sol', NULL, '14:01:46', '14:01:46', NULL, '', 6, 1, 112, 124, 1, 0, NULL, '03/12/2019', NULL),
(479, '2019-12-04 11:54:32', 'Se ríe cada vez que se le llama la atención a un compañero. Le había avisado que si lo seguía haciendo le pondría un parte.', NULL, '09:35:20', '09:35:20', NULL, '', 2, 1, 226, 88, 3, 0, '03/12/2019', '03/12/2019', NULL),
(480, '2019-12-04 09:57:33', 'Estar fuera del aula prácticamente toda la 4ª hora de clase. He tenido que avisar a los profesores de guardia para que lo busquen. Llega cuando falta 5 minutos para acabar la clase.', NULL, '09:57:33', '09:57:33', NULL, '', 2, 1, 267, 48, 1, 0, NULL, '04/12/2019', NULL),
(481, '2019-12-04 10:05:05', 'A 4ª hora del martes 3 de diciembre: Raquel ha estado fuera de clase prácticamente toda la hora, sin permiso de ningún profesor. Tengo que avisar a los profesores de guardia para que la busquen. Llega a clase cuando faltan 10 minutos para que termine. Cuando llega monta un \"circo\", el resto de los alumnos están haciendo un examen y lógicamente su comportamiento impide que terminen el examen con tranquilidad como tienen derecho. Al entrar en clase se sienta en un sitio que no es el suyo y me dice: \"Me da igual lo que me digas\", \"tú no sabes hacer nada, nada más que dar por culo\". Se ríe, se niega a irse de clase cuando la echo. Este comportamiento de Raquel es intorelable, puesto que no sólo me insulta y no hace ningún caso, sino que no deja a los compañeros tener un normal desasarrollo de las actividades de clase.', NULL, '10:05:05', '10:05:05', NULL, '', 10, 1, 278, 48, 1, 0, NULL, '04/12/2019', NULL),
(482, '2019-12-04 12:01:40', 'Después de reiteradas amonestaciones de pedir silencio, la alumna habla a distancia con otra compañera, haciendo caso omiso de la profesora.', 'Lámina 37 y atrasadas', '12:01:40', '12:01:40', NULL, '', 3, 1, 267, 15, 1, 0, NULL, '04/12/2019', NULL),
(483, '2019-12-04 11:04:30', 'Entra tarde a clase sin pedir permiso. Se sienta con la espalda en la pared. Le digo que se siente bien y no hace caso. Le pido que se cambie de sitio y no lo hace. Contesta de mala forma.', 'copiar páginas 46, 47, 48 y 49 del libro.', '12:04:37', '12:04:37', NULL, '', 3, 1, 225, 88, 3, 0, '05/12/2019', '04/12/2019', NULL),
(484, '2019-12-04 11:04:13', 'No se sienta en su sitio, no me deja comenzar la clase. Cuando se sienta, lo hace en el sitio de un compañero.', 'Copiar texto del tema 3, cuaderno de actividades 2ºESO', '12:07:32', '12:07:32', NULL, '', 2, 1, 45, 71, 3, 0, '06/12/2019', '04/12/2019', NULL),
(485, '2019-12-04 12:10:18', 'Le pido que me dé el cuaderno para que lo corrija y el alumno no me lo da. Lleva varios días en los que intenta no hacer lo que se le pide y se lo tengo que pedir en numerosas ocasiones para que lo haga.', NULL, '12:10:18', '12:10:18', NULL, '', 2, 1, 248, 121, 1, 0, NULL, '04/12/2019', NULL),
(486, '2019-12-04 11:02:14', 'Se encuentra en la escalera durante las clases con el móvil. Le digo que se vaya a clase y se niega, dice que se espera a que toque el timbre. Le vuelvo a decir que no puede estar en el pasillo y se niega a entrar en clase.', NULL, '12:12:39', '12:12:39', NULL, '', 4, 1, 45, 8, 3, 0, '05/12/2019', '04/12/2019', NULL),
(487, '2019-12-04 10:28:50', 'Un alumno de otra clase se para a observar al grupo mientras hacen Ed. Física. Mª del Mar interrumpe la clase y se dirige a él de forma grosera gritándole delante de todos: \"¿Y a ti qué? ¿QUE TE PICA LA POLLA NENE?', NULL, '13:41:14', '13:41:14', NULL, '', 10, 1, 263, 17, 3, 0, '13/12/2019', '04/12/2019', NULL),
(488, '2019-12-04 13:46:29', 'No sacar el material, no trabajar en clase y no hacer caso del profesor', 'Página 60 nº 1, 2, 3, 4', '13:46:29', '13:46:29', NULL, '', 2, 1, 212, 5, 1, 0, NULL, '04/12/2019', NULL),
(489, '2019-12-04 11:03:52', 'No sacar el material, no trabajar en clase y no hacer caso del profesor', 'Página 60 nº 1, 2, 3, 4', '13:47:42', '13:47:42', NULL, '', 2, 1, 225, 5, 3, 0, '05/12/2019', '04/12/2019', NULL),
(490, '2019-12-04 14:13:28', 'usa el móvil en clase el día 29/11/2019', NULL, '14:13:28', '14:13:28', NULL, '', 4, 1, 316, 18, 1, 0, NULL, '04/12/2019', NULL),
(491, '2019-12-04 14:15:05', 'usa el móvil en clase', NULL, '14:15:05', '14:15:05', NULL, '', 4, 1, 316, 18, 1, 0, NULL, '04/12/2019', NULL),
(492, '2019-12-04 14:24:04', 'usa el móvil en clase', NULL, '14:24:04', '14:24:04', NULL, '', 4, 1, 507, 68, 1, 0, NULL, '04/12/2019', NULL),
(493, '2019-12-05 09:08:26', 'Llega más de media hora tarde.No saca el material ni se pone a trabajar tras varias amonestaciones y varios avisos de la profesora.', 'Lámina número 37', '09:08:26', '09:08:26', NULL, '', 2, 1, 210, 15, 1, 0, NULL, '05/12/2019', NULL),
(494, '2019-12-05 10:26:32', 'Lleva 33 negativos. No hace nada; y además se dedia a charlar. Siempre está de lado', NULL, '10:26:32', '10:26:32', NULL, '', 2, 1, 62, 2, 1, 0, NULL, '05/12/2019', NULL),
(495, '2019-12-05 10:28:33', 'Se pasa toda la clase alborotando, y le he avisado varias veces ya. Se pone a saltar y arranca el atril del piano.', NULL, '10:28:33', '10:28:33', NULL, '', 2, 1, 18, 2, 1, 0, NULL, '05/12/2019', NULL),
(496, '2019-12-05 10:29:45', 'Se sale de clase antes de que le dé permiso y mastica chicle.', NULL, '10:29:45', '10:29:45', NULL, '', 2, 1, 61, 2, 1, 0, NULL, '05/12/2019', NULL),
(497, '2019-12-05 11:01:46', 'No trabaja nada en clase , después de estar insistiéndole constantemente para que trabajara, incluso se niega a abrir la mochila.\r\nEste parte lo ha puesto Enrique Ayllon que comparte horario con Antonio Belmonte pero no aparece en el listado de profesores del programa.', NULL, '10:38:48', '10:38:48', NULL, '', 2, 1, 225, 16, 3, 0, '05/12/2019', '05/12/2019', NULL),
(498, '2019-12-05 11:12:26', 'Agresión a un alumno durante el recreo del día 4/12/2019, le propinó dos puñetazos en el estómago -', NULL, '11:12:26', '11:12:26', NULL, '', 10, 1, 48, 79, 1, 0, NULL, '05/12/2019', NULL),
(499, '2019-12-04 12:56:38', 'El alumno se niega a acompañarme al despacho de Dirección: grosero, desafiante y agresivo.', NULL, '12:56:38', '12:56:38', NULL, '', 10, 1, 45, 31, 1, 0, NULL, '05/12/2019', NULL),
(500, '2019-12-05 12:59:58', 'No colabora, charla continuamente e interrumpe.', 'No tiene libro. Copiar 100 veces: \"Tengo que portarme bien\".', '12:59:58', '12:59:58', NULL, '', 2, 1, 267, 69, 1, 0, NULL, '05/12/2019', NULL),
(501, '2019-12-05 13:03:21', 'La alumna está poniendo música a todo volumen en el ordenador de la clase.', 'Hacer una redacción de los valores éticos y el comportamiento.', '13:03:21', '13:03:21', NULL, '', 6, 1, 394, 65, 1, 0, NULL, '05/12/2019', NULL),
(502, '2019-12-05 13:08:45', 'No trabaja. No para de hablar (se quejan hasta los compañeros). Llama kung fu Panda (gorda) a una compañera. Hace palmas, me dice que se aburre, que si se puede ir al aula de convivencia.', 'Se queda en clase.', '13:08:45', '13:08:45', NULL, '', 2, 1, 36, 94, 1, 0, NULL, '05/12/2019', NULL),
(503, '2019-12-05 13:10:32', 'Le digo que me de el móvil y se niega.', 'Que coloree un mandala.', '13:10:31', '13:10:31', NULL, '', 2, 1, 45, 94, 1, 0, NULL, '05/12/2019', NULL),
(504, '2019-12-05 13:36:18', 'Durante un cambio de clase va corriendo por el pasillo, choca conmigo y me hace daño en una muñeca.', NULL, '13:17:24', '13:17:24', NULL, '', 3, 1, 36, 68, 3, 0, '19/12/2019', '05/12/2019', NULL),
(505, '2019-12-05 13:41:42', 'No traer firmado el parte por \"tercera\" vez. Los dos primeros los ha perdido (14 y 26 de noviembre).', 'En clase.', '13:26:41', '13:26:41', NULL, '', 2, 1, 252, 15, 3, 0, '13/01/2020', '05/12/2019', NULL),
(506, '2019-12-05 13:41:28', 'Le tira a un compañero el estuche a la cara. Le digo que se cambie de sitio y se niega.', 'Página 38, actividad 21.', '13:40:09', '13:40:09', NULL, '', 3, 1, 45, 86, 1, 0, NULL, '05/12/2019', NULL),
(507, '2019-12-05 14:02:22', 'No se sienta, cuando le digo que le pondré un parte, dice que otro para la \"colección\"', 'Repaso del Tema 3', '14:02:22', '14:02:22', NULL, '', 10, 1, 45, 28, 1, 0, NULL, '05/12/2019', NULL),
(508, '2019-12-05 09:46:53', 'No deja de reir y contestar', 'Repaso Tema 3', '14:08:59', '14:08:59', NULL, '', 10, 1, 29, 28, 3, 0, '16/12/2019', '05/12/2019', NULL),
(509, '2019-12-05 14:13:20', 'Ha cambiado datos en el cuaderno de clase (hoja de cálculo) del profesor mientras este dirigía la recogida de tabletas. También debe 2 partes.', NULL, '14:13:20', '14:13:20', NULL, '', 10, 1, 112, 2, 1, 0, NULL, '05/12/2019', NULL),
(510, '2019-12-05 14:37:47', 'Mantiene una actitud impertinente y molesta durante la guardia', 'Estudiar o hacer ejercicios (no le doy clase)', '14:37:47', '14:37:47', NULL, '', 2, 1, 193, 2, 1, 0, NULL, '05/12/2019', NULL),
(511, '2019-12-10 13:02:24', 'No trae el material necesario. Se levanta sin permiso, ignora las indicaciones que se le hacen y discute con el profesor en actitud chulesca, quedándose siempre por encima del profesor.', NULL, '13:02:24', '13:02:24', NULL, '', 3, 1, 64, 124, 1, 0, NULL, '10/12/2019', NULL),
(512, '2019-12-10 09:42:26', 'el alumno interrumpe constantemente las explicaciones del profesor. cuando se le amonesta entra en discusión con el profesor con la intención de seguir molestando. arroja papeles al suelo y se tira de la silla. su actitudes siempre la misma, incluye la burla cada vez que el profesor le dice algo', NULL, '13:53:24', '13:53:24', NULL, '', 10, 1, 29, 124, 3, 0, '16/12/2019', '10/12/2019', NULL),
(513, '2019-12-11 08:28:42', 'Estaba en el pasillo con otros compañeros y dice que le han empujado y con el codo ha roto el cristal del extintor.', NULL, '10:48:23', '10:48:23', NULL, '', 4, 1, 394, 91, 3, 0, '17/12/2019', '11/12/2019', NULL),
(514, '2019-12-11 11:13:03', 'Faltar al respeto de un alumno.', 'Actividades de Dibujo Técnico.', '10:50:13', '10:50:13', NULL, '', 2, 1, 155, 36, 1, 1, NULL, '11/12/2019', NULL),
(515, '2019-12-11 13:59:14', 'Llevamos los balones de baloncesto a la clase para ver algo de teoría. Adrián saca un balón y se lo pasa a otro alumno que está en el piso inferior en mitad del pasillo', NULL, '13:59:14', '13:59:14', NULL, '', 3, 1, 212, 17, 1, 0, NULL, '11/12/2019', NULL),
(516, '2019-12-11 14:46:34', 'Pinta la pared del aula de convivencia', NULL, '14:46:34', '14:46:34', NULL, '', 4, 1, 112, 91, 1, 0, NULL, '11/12/2019', NULL),
(517, '2019-12-11 08:32:11', 'No colabora en clase. Mantiene una actitud chulesca ante el profesor. No se sienta bien. Se expresa de forma grosera ante el profesor delante de los compañeros.', NULL, '08:32:11', '08:32:11', NULL, '', 3, 1, 120, 89, 1, 0, NULL, '12/12/2019', NULL),
(519, '2019-12-12 09:41:48', 'No deja de reír y molestar. No entregó el primer parte. Éste ratifica el anterior. Tiene comportamiento pésimo.', NULL, '10:12:34', '10:12:34', NULL, '', 2, 1, 29, 28, 3, 0, '16/12/2019', '12/12/2019', NULL),
(520, '2019-12-10 12:05:42', 'Mientras el profesor está llamando la atención de otro compañero, Pablo está riéndose con total descaro del profesor. Cuando se le amonesta por su actitud se pone en actitud chulesca y reconoce que se está riendo de mí.', NULL, '12:05:42', '12:05:42', NULL, '', 3, 1, 48, 124, 1, 0, NULL, '12/12/2019', NULL),
(521, '2019-12-11 12:10:48', 'En mitad de la clase se dedica a tirar pequeñas piedras al grupo clase cuando están practicando baloncesto.', NULL, '12:10:01', '12:10:01', NULL, '', 10, 1, 264, 17, 3, 0, '12/12/2019', '11/12/2019', NULL),
(522, '2019-12-12 12:17:48', 'Se niega rotundamente a cambiarse al lado de una compañera, desoyendo lo que le digo. Prefiere que le ponga un parte.', NULL, '12:17:48', '12:17:48', NULL, '', 2, 1, 210, 93, 1, 0, NULL, '12/12/2019', NULL),
(523, '2019-12-12 13:06:29', 'Repetidas interrupciones en clase y charla todo el rato con los compañeros durante las explicaciones.', 'Sintagmas nominales.', '13:06:29', '13:06:29', NULL, '', 2, 1, 447, 133, 1, 0, NULL, '12/12/2019', NULL),
(524, '2019-12-12 13:09:33', 'Repetidas y sistemáticas interrupciones en clase.', 'Sintagmas nominales.', '13:09:33', '13:09:33', NULL, '', 2, 1, 433, 133, 1, 0, NULL, '12/12/2019', NULL),
(525, '2019-12-12 13:11:26', 'Tras las advertencias del profesorado está fuera de clase entre horas sin permiso.', NULL, '13:11:26', '13:11:26', NULL, '', 1, 1, 430, 81, 1, 0, NULL, '12/12/2019', NULL),
(526, '2019-12-12 13:14:40', 'Tras las repetidas advertencias, sigue saliendo entre horas de clase sin permiso. Es una acción reiterada.', NULL, '13:14:40', '13:14:40', NULL, '', 1, 1, 418, 81, 1, 0, NULL, '12/12/2019', NULL),
(527, '2019-12-12 13:39:38', 'Molesta continuamente, pregunta con la intención de interrumpir constantemente. No atiende las reiteradas llamadas de atención.', 'Página 35, actividades 1, 2, 3 y 5.', '13:39:38', '13:39:38', NULL, '', 2, 1, 36, 86, 1, 0, NULL, '12/12/2019', NULL),
(528, '2019-12-12 14:10:10', 'Entra en clase sin llamar a la puerta para coger su chaquetón (viene de otra clase de desdoble) y se balancea en las mesas. Le pido que salga de nuevo y que entre llamando a la puerta y guardando las formas y empieza a dar golpes fuertes en la puerta y a contestarme de manera desafiante.', NULL, '14:10:10', '14:10:10', NULL, '', 2, 1, 36, 21, 1, 0, NULL, '12/12/2019', NULL),
(529, '2019-12-12 14:13:28', 'Ha usado una aplicación para tablet no autorizada, haciendo que dijera palabras groseras. Se empeña en negarlo cuando es cierto.', NULL, '14:13:28', '14:13:28', NULL, '', 2, 1, 61, 2, 1, 0, NULL, '12/12/2019', NULL),
(530, '2019-12-12 14:15:22', 'Le presto unos auriculares porque me dice que los suyos se han roto. En lugar de devolverlos los deja abandonados en la rejilla de la mesa', NULL, '14:15:22', '14:15:22', NULL, '', 3, 1, 75, 2, 1, 0, NULL, '12/12/2019', NULL),
(531, '2019-12-13 08:48:58', 'Durante el recreo golpea en la cara con contundencia a un compañero. Posteriormente reconoce la acción y pide disculpas al compañero.', NULL, '08:48:58', '08:48:58', NULL, '', 10, 1, 104, 133, 1, 0, NULL, '13/12/2019', NULL),
(532, '2019-12-13 11:00:35', 'Se sienta apoyado en la pared y poniendo los pies sobre la mesa. Se le lleva diciendo desde principio de curso que debe sentarse correctamente, pero siempre está de lado y con la espalda en la pared.', NULL, '11:00:35', '11:00:35', NULL, '', 2, 1, 231, 88, 2, 0, NULL, '13/12/2019', NULL),
(533, '2019-12-13 12:00:06', 'Lleva varios días haciendo constantes interrupciones, se le pide que deje dar clase, y no para de protestar.', NULL, '12:00:06', '12:00:06', NULL, '', 2, 1, 18, 83, 1, 0, NULL, '13/12/2019', NULL),
(534, '2019-12-13 12:12:57', 'Le llamé la atención en varias ocasiones para que no moleste durante el examen. Hace caso omiso y no para de molestar.', NULL, '12:12:57', '12:12:57', NULL, '', 2, 1, 210, 121, 1, 0, NULL, '13/12/2019', NULL),
(535, '2019-12-13 12:18:06', 'Después de haber sido advertida en numerosas ocasiones por sus retrasos, la alumna entra en clase tarde sin llamar a la puerta diciendo \"holi\" en voz alta, interrumpiendo al profesor mientras hablaba.', NULL, '12:18:06', '12:18:06', NULL, '', 2, 1, 263, 119, 1, 0, NULL, '13/12/2019', NULL),
(536, '2019-12-13 13:08:29', 'Llega tarde constantemente, se pasea por los pasillos, siempre poniendo excusas.', NULL, '13:08:29', '13:08:29', NULL, '', 2, 1, 263, 29, 1, 0, NULL, '13/12/2019', NULL),
(537, '2019-12-13 13:09:39', 'Llega tarde constantemente, se pasea por los pasillos y siempre tiene alguna excusa.', NULL, '13:09:39', '13:09:39', NULL, '', 2, 1, 267, 29, 1, 0, NULL, '13/12/2019', NULL),
(538, '2019-12-13 13:12:25', 'El alumno se encontraba fuera del aula entre horas sin permiso', NULL, '13:12:25', '13:12:25', NULL, '', 1, 1, 316, 91, 1, 0, NULL, '13/12/2019', NULL),
(539, '2019-12-13 13:34:19', 'Durante el cambio de clase, el alumno lanza un rotulador a la calle que está a punto de impactar en una persona que paseaba.', NULL, '13:34:19', '13:34:19', NULL, '', 10, 1, 405, 5, 1, 0, NULL, '13/12/2019', NULL),
(540, '2019-12-16 09:52:52', 'Trabaja en otra asignatura y no es la primera vez que lo hace', NULL, '09:52:52', '09:52:52', NULL, '', 2, 1, 316, 91, 1, 0, NULL, '16/12/2019', NULL),
