(561, '2019-12-19 08:45:17', 'Nada más empezar la clase empieza a emitir ruidos molestos. Toquetea las instalaciones de laboratorio sin permiso. Su actitud es poco adecuada para la permanencia en el laboratorio.', 'Hacer fichas de Biología y Geología.', '08:45:17', '08:45:17', NULL, '', 3, 1, 112, 24, 1, 0, NULL, '19/12/2019', NULL),
(563, '2019-12-19 11:07:54', 'Imposible dar clase con él.No deja de molestar, llevo media hora avisándole.', 'Estudiar partitura', '11:07:54', '11:07:54', NULL, '', 2, 1, 112, 2, 1, 0, NULL, '19/12/2019', NULL),
(564, '2019-12-19 10:33:43', 'El alumno le dice a una compañera \" mierda seca\" dese 1ª hora y continuar a 2ª hora', NULL, '11:11:05', '11:11:05', NULL, '', 3, 1, 155, 15, 3, 0, '20/12/2019', '19/12/2019', NULL),
(565, '2019-12-19 12:22:34', 'Entro en el aula y está saltando de mesa en mesa. Me pregunta si puede incendiar el instituto. Grita e interrumpe la clase. Juega con un guante a inflarlo. Cuando se va del aula me grita \"guapo\", vuelve a hacerlo una vez ha salido del aula  y no apaga la luz del aula.', NULL, '12:22:34', '12:22:34', NULL, '', 10, 1, 112, 124, 1, 0, NULL, '19/12/2019', NULL),
(566, '2019-12-19 14:16:10', 'Hacer ruido constantemente al empezar la clase. cuando le llamo la atención se lo toma a risa y me habla en un tono muy poco respetuoso', 'Actividades página 90 y 91', '14:16:10', '14:16:10', NULL, '', 2, 1, 61, 21, 1, 0, NULL, '19/12/2019', NULL),
(567, '2019-12-19 14:19:10', 'Después de ponerle un parte e irse al aula de convivencia da un portazo fuerte al salir.', 'Las lleva en el parte anterior', '14:19:10', '14:19:10', NULL, '', 2, 1, 61, 21, 1, 0, NULL, '19/12/2019', NULL),
(568, '2019-12-19 14:25:49', 'Se marcha al aseo sin pedir permiso.', NULL, '14:25:49', '14:25:49', NULL, '', 1, 1, 8, 2, 1, 0, NULL, '19/12/2019', NULL),
(569, '2019-12-20 13:42:13', 'Utiliza el móvil en clase', NULL, '13:42:13', '13:42:13', NULL, '', 4, 1, 316, 91, 1, 0, NULL, '20/12/2019', NULL),
(570, '2019-12-20 14:22:14', 'Se niega a copiar. No tiene material y dice que no pide prestado porque hoy no \"ponen\" partes', 'Dar color a un dibujo.', '14:22:14', '14:22:14', NULL, '', 2, 1, 139, 94, 1, 0, NULL, '20/12/2019', NULL),
(571, '2020-01-08 09:31:48', 'No deja de interrumpir en clase hablando y bromeando a pesar de mis llamadas de atención', 'Mapa conceptual del Tema 3', '11:11:24', '11:11:24', NULL, '', 2, 1, 36, 71, 3, 0, '27/01/2020', '08/01/2020', NULL),
(572, '2020-01-08 12:15:46', 'Al llamarle la atención por su conducta me responde textualmente: \"Que te güires\". Al salir de clase le da repetidamente al interruptor de la luz.', 'Fichas de biología y geología', '12:15:46', '12:15:46', NULL, '', 3, 1, 112, 24, 1, 0, NULL, '08/01/2020', NULL),
(573, '2020-01-08 13:30:11', 'Falta gravemente al respeto: \"ésta no se calla la puta boca\" (yo), desafiando y diciendo que el profesor anterior se va a enterar.', NULL, '13:30:11', '13:30:11', NULL, '', 10, 1, 260, 40, 1, 1, NULL, '08/01/2020', NULL),
(574, '2020-01-08 13:38:16', 'Estaba intentando decir algo cuando el alumno se pone a hablar bastante alto. Al decirle que se callase se ha golpeado con la cabeza en el cristal de la ventana.', NULL, '13:38:16', '13:38:16', NULL, '', 3, 1, 356, 24, 1, 0, NULL, '08/01/2020', NULL),
(575, '2019-12-20 13:39:41', 'Se niega a copiar. No trae el material y dice que no pide prestado porque hoy no \"ponen\" partes.', NULL, '13:39:41', '13:39:41', NULL, '', 2, 1, 139, 94, 1, 0, NULL, '08/01/2020', NULL),
(576, '2020-01-08 14:16:55', 'Desobedece las instrucciones del profesor, de forma reiterada. Incumple la instrucción de cambio de sitio en el aula', NULL, '14:16:55', '14:16:55', NULL, '', 2, 1, 64, 130, 1, 0, NULL, '08/01/2020', NULL),
(577, '2020-01-09 08:59:53', 'Hace todo lo posible para molestar. Grita y se levanta para apagar la luz...', 'Ficha de Biología y Geología', '08:59:53', '08:59:53', NULL, '', 10, 1, 112, 24, 1, 0, NULL, '09/01/2020', NULL),
(578, '2020-01-09 09:04:43', 'El lunes 16 de diciembre, el alumno en cuestión llama \"puta\" a una compañera de clase, existiendo testigos de dicha actuación y sin haber justificación alguna para ello, que tampoco hubiera sido justificación.', NULL, '09:04:43', '09:04:43', NULL, '', 3, 1, 63, 79, 1, 0, NULL, '09/01/2020', NULL),
(579, '2020-01-09 09:36:11', 'Le indico que tenemos que activar la cuenta de Classroom para poder trabajar este trimestre y me responde burlándose de mi. Le llamo para que se acerque y explicárselo despacio y me ignora repetidamente. Le cojo suavemente del brazo para que me escuche y se vuelve amenazándome:\"como me toques, te voy a dar\". Viene la jefa de estudios a por él porque no hace caso a nada.', NULL, '09:36:11', '09:36:11', NULL, '', 10, 1, 45, 17, 1, 0, NULL, '09/01/2020', NULL),
(580, '2020-01-09 11:58:31', 'Habla, se da la vuelta y cuando le llamo la atención me dice que no le chille.', 'Pág. 48 y 49: ejercicios 6, 7, 3\r\nPág. 64: ejercicio 30 c y d', '09:41:45', '09:41:45', NULL, '', 2, 1, 267, 48, 3, 0, '16/01/2020', '09/01/2020', NULL),
(581, '2020-01-09 10:02:21', 'Le llamo continuamente la atención por estar siempre de espaldas y no parar de charlar. Se levanta cuando quiere, interrumpe cuando quiere y sigue siempre de espaldas a la pizarra. No hace caso a nada. Sólo interrumpir y distraer a los compañeros.', 'Copiar tema 2 (fichas que hay en el Aula de Convivencia).', '10:02:21', '10:02:21', NULL, '', 3, 1, 112, 17, 1, 0, NULL, '09/01/2020', NULL),
(582, '2020-01-09 13:12:09', 'No para de hablar ni de darse la vuelta molestando a los compañeros. No hace caso a las llamadas de atención y no tiene ninguna intención de cambiar de actitud.', 'Leer pág. 50 y 51: hacer ejercicios 8 y 9 (pág 50)', '10:15:28', '10:15:28', NULL, '', 2, 1, 278, 48, 3, 0, '10/01/2020', '09/01/2020', NULL),
(583, '2020-01-09 10:51:19', 'Desde que entra en clase no para de incordia. Lo cambio de sitio y mantiene la misma actitud', 'Estudiar preguntas1-5 de DO RE QUE', '10:51:19', '10:51:19', NULL, '', 2, 1, 112, 2, 1, 0, NULL, '09/01/2020', NULL),
(584, '2020-01-09 12:22:04', 'Está comiendo chupa-chups en clase. Habla con los compañeros, interrumpe, le amonesto verbalmente y al segundo está lanzando objetos a una compañera.  Cuando se marcha me dice \"adiós guapo\".', NULL, '12:22:04', '12:22:04', NULL, '', 10, 1, 113, 124, 1, 0, NULL, '09/01/2020', NULL),
(585, '2020-01-09 12:38:07', 'No saca el material de clase. Molesta, interrumpe, lanza objetos y me llama \"guapo\", me chulea cuando le amonesto verbalmente y se niega a irse del aula cuando le expulso. Se burla de mí mientras sale.', NULL, '12:38:07', '12:38:07', NULL, '', 10, 1, 112, 124, 1, 0, NULL, '09/01/2020', NULL),
(586, '2020-01-09 13:32:17', 'Realiza gestos con la mano (obscenos) a otro compañero.', 'Lámina nº 6. Portada 2º trimestre. No trae materiales.', '13:32:17', '13:32:17', NULL, '', 3, 1, 260, 15, 1, 0, NULL, '09/01/2020', NULL),
(587, '2020-01-09 14:04:06', 'Durante la 3a hora se ha metido en una clase que no le correspondía. En el recreo hace prácticas arriesgadas. Se le convoca a jefatura pero se niega', NULL, '14:04:06', '14:04:06', NULL, '', 10, 1, 45, 2, 1, 0, NULL, '09/01/2020', NULL),
(588, '2020-01-09 14:06:20', 'En el recreo, se dedica a hacer prácticas de riesgo en las escaleras y barandilla. Se le convoca a jefatura pero se niega a ir.', NULL, '14:06:20', '14:06:20', NULL, '', 10, 1, 112, 2, 1, 0, NULL, '09/01/2020', NULL),
(589, '2020-01-09 14:10:16', 'Se ha encontrado en el patio de recreo el envoltorio de su bocadillo tirado en el suelo.', NULL, '14:10:16', '14:10:16', NULL, '', 2, 1, 113, 2, 1, 0, NULL, '09/01/2020', NULL),
(590, '2020-01-10 11:12:59', 'No trabaja, habla y molesta continuamente. Llama \"pija\" a una compañera en mitad de clase y a voces.', 'Copiar pág. 64 del libro.', '11:12:59', '11:12:59', NULL, '', 3, 1, 8, 68, 1, 0, NULL, '10/01/2020', NULL),
(591, '2020-01-10 12:25:16', 'Rompe un parte de incidencias que le ha sido puesto por el tutor', NULL, '12:25:16', '12:25:16', NULL, '', 10, 1, 64, 79, 1, 0, NULL, '10/01/2020', NULL),
(592, '2020-01-10 12:27:52', 'Iniciada la clase, el alumno permancece impasivo sin sacar material alguno.Cuando se le requiere que lo haga se niega a hacerlo y continua con la misma actitud', NULL, '12:27:52', '12:27:52', NULL, '', 2, 1, 64, 79, 1, 0, NULL, '10/01/2020', NULL),
(593, '2020-01-10 12:30:13', 'El alumno no trabaja en clase y además está charlando con un compañero del final del aula en repetidas ocasiones', NULL, '12:30:13', '12:30:13', NULL, '', 2, 1, 212, 121, 1, 0, NULL, '10/01/2020', NULL),
(594, '2020-01-10 12:31:53', 'Ela lumno no hace absolutamete nada, ni saca el libro de texto ni hace las actividades que se le mandan.', NULL, '12:31:53', '12:31:53', NULL, '', 2, 1, 210, 121, 1, 0, NULL, '10/01/2020', NULL),
(595, '2020-01-10 13:15:10', 'Molesta en clase y se cambia de sitio sin permiso. No atiende a las llamadas de atención.', 'Ej. 13, pág 71', '13:15:10', '13:15:10', NULL, '', 2, 1, 260, 119, 1, 0, NULL, '10/01/2020', NULL),
(596, '2020-01-10 13:17:56', 'Se dedica a dar voces cuando escribo en la pizarra.', 'ej. 13, pág 71', '13:17:56', '13:17:56', NULL, '', 2, 1, 247, 119, 1, 0, NULL, '10/01/2020', NULL),
(597, '2020-01-10 13:20:29', 'La alumna se niega a copiar una serie de ideas fundamentales dadas por la profesora.', 'Copiar pág. 58 del libro.', '13:20:29', '13:20:29', NULL, '', 2, 1, 147, 91, 1, 0, NULL, '10/01/2020', NULL),
(598, '2020-01-10 13:24:19', 'El alumno permanece en un aula que no es la suya y cuando se le pide que salga, se niega a hacerlo.', NULL, '13:24:19', '13:24:19', NULL, '', 10, 1, 45, 79, 1, 0, NULL, '10/01/2020', NULL),
(599, '2020-01-10 13:26:36', 'Tras advertirle en varias ocasiones de su actitud, continúa desafiando al profesor, tomándole a guasa y pidiéndole más partes.', NULL, '13:26:36', '13:26:36', NULL, '', 10, 1, 45, 79, 1, 0, NULL, '10/01/2020', NULL),
(600, '2020-01-10 13:28:19', 'Tras los dos partes anteriores, el alumno continúa desafiando al profesor, no siguiendo las instrucciones dadas, dando voces, jugando con las ventanas, etc.', NULL, '13:28:19', '13:28:19', NULL, '', 10, 1, 45, 79, 1, 0, NULL, '10/01/2020', NULL),
(601, '2020-01-10 13:30:50', 'Cuando ante la situación, el grupo cambia de aula y se le indica que se quede con el profesor de guardia -redactando estos partes- el chico se marcha con el grupo -que no es el suyo- a la otra aula.', NULL, '13:30:50', '13:30:50', NULL, '', 10, 1, 45, 79, 1, 0, NULL, '10/01/2020', NULL),
(602, '2020-01-10 13:32:59', 'Tras entregarle los cuatro partes, el alumno exclama ¡Qué guapo!, Ponme otro; razón por la que le pongo el 5º parte.', NULL, '13:32:59', '13:32:59', NULL, '', 10, 1, 45, 79, 1, 0, NULL, '10/01/2020', NULL),
(603, '2020-01-10 13:55:40', 'El alumno se encara con el profesor de forma violenta y gritándole que le diera el balón.', NULL, '13:55:40', '13:55:40', NULL, '', 10, 1, 45, 29, 1, 0, NULL, '10/01/2020', NULL),
(604, '2020-01-10 14:07:54', 'Se niega a cambiarse de sitio y ponerse donde le corresponde según la cuadrícula de la tutora a pesar de amenazarla con expulsarla de clase.', NULL, '14:07:54', '14:07:54', NULL, '', 2, 1, 263, 119, 1, 0, NULL, '10/01/2020', NULL),
(605, '2020-01-10 14:12:12', 'No deja de molestar desde que comienza la clase. Cuando le regaño responde que \"se enrolla mas que una persiana\".', NULL, '14:12:12', '14:12:12', NULL, '', 2, 1, 278, 119, 1, 0, NULL, '10/01/2020', NULL),
(606, '2020-01-10 14:20:11', 'Vuelve a desobedecer reiteradamente al profesor diciendo que no le da la gana hacer lo que se le manda.', 'Resolución de Kenken', '14:18:24', '14:18:24', NULL, '', 10, 1, 64, 130, 1, 0, NULL, '10/01/2020', NULL),
(607, '2020-01-10 08:25:05', 'Me llama \"hijo de puta\" al salir del aula cuando ha sido expulsado de la misma por mal comportamiento', NULL, '08:25:05', '08:25:05', NULL, '', 10, 1, 260, 119, 1, 0, NULL, '13/01/2020', NULL),
(608, '2020-01-13 08:39:44', 'El alumno no trabaja en clase normalmente ni trae materiales y hoy era la recuperación del primer trimestre. No trae agenda para comunicar a la familia que no entrega ninguna lámina.', NULL, '08:39:44', '08:39:44', NULL, '', 2, 1, 210, 15, 1, 0, NULL, '13/01/2020', NULL),
(609, '2020-01-13 14:28:47', 'De manera reiterativa no trae materiales a clase, el día anterior se le da la lámina, hoy continuamos con ella, pero no la trae. Se le da por segunda vez la lámina (espero no la pierda) y no realiza recuperación de primera evaluación (nada).', NULL, '08:48:53', '08:48:53', NULL, '', 2, 1, 208, 15, 3, 0, '16/01/2020', '13/01/2020', NULL),
(610, '2020-01-09 09:28:54', 'No para de hablar ni de darse la vuelta molestando a os compañeros. N0 hace caso a las llamadas de atención y no tiene ninguna intención de cambiar de actitud', 'Leer página 50. Hacer ejercicios 8 y 9', '09:28:54', '09:28:54', NULL, '', 2, 1, 278, 48, 1, 0, NULL, '13/01/2020', NULL),
(611, '2020-01-13 12:15:10', 'Le he pedido a la alumna hasta tres veces que s cambie de sitio y no ha querido', 'Ficha', '12:15:10', '12:15:10', NULL, '', 2, 1, 263, 69, 1, 0, NULL, '13/01/2020', NULL),
