(630, '2020-01-15 12:12:30', 'Se niega reiteradamente a seguir las instrucciones del profesor', 'Parchís de fracciones. Colocar y resolver.', '12:12:30', '12:12:30', NULL, '', 2, 1, 64, 130, 1, 0, NULL, '15/01/2020', NULL),
(631, '2020-01-15 13:00:16', 'Interrumpe de manera continuada en la clase. Avisado varias veces, trabaja en la mesa del compañero de atrás. Habla en voz alta. No atiende.', NULL, '13:00:16', '13:00:16', NULL, '', 2, 1, 193, 15, 1, 0, NULL, '15/01/2020', NULL),
