(634, '2020-01-16 10:00:44', 'El alumno se ha levantado de repente forcejeando con su compañero de pupitre. Se han agarrado de las manos y no ha ido a más porque he intervenido. Han venido a disculparse', NULL, '10:00:44', '10:00:44', NULL, '', 3, 1, 36, 124, 1, 0, NULL, '14/01/2020', NULL),
