(636, '2020-01-15 10:08:00', 'No trae materiales. Se le dan los materiales y se niega a trabajar. Se le dice que se le dan las láminas y el material . Hoy era la recuperación del primer trimestre (nada)', 'Portada', '10:08:00', '10:08:00', NULL, '', 2, 1, 278, 15, 1, 0, NULL, '15/01/2020', NULL),
(637, '2020-01-15 12:00:30', 'Comiendo en clase.', 'Realizar las láminas 37 y 38.', '10:09:35', '10:09:35', NULL, '', 2, 1, 263, 15, 3, 0, '13/02/2020', '15/01/2020', NULL),
(638, '2020-01-16 10:11:49', 'La tengo que echar todos los días de clase por perturbar constantemente el desarrollo de la clase.', 'Leer pág. 50, hacer ejercicios 8 y 9', '10:11:49', '10:11:49', NULL, '', 10, 1, 278, 48, 1, 0, NULL, '16/01/2020', NULL),
(639, '2020-01-14 10:15:12', 'El alumno está en el aula sin ningún material, se niega a sacarlo. Cuando se le amonesta, responde con burlas y actitud chulesca. Te diriges a él y  se queda de espaldas ignorando al profesor.', NULL, '10:15:12', '10:15:12', NULL, '', 3, 1, 64, 124, 1, 0, NULL, '14/01/2020', NULL),
(640, '2020-01-16 10:29:13', 'Le dejo ira ver al profesor de Biología para recoger los ejercicios de pendientes, pero cuando le veo que está hablando en la clase de al lado, le digo que vuelva a pasar,  entra en el aula dando un puñetazo a la caja del extintor y dando un portazo. Después se niega a trabajar en clase.', 'Realizar ficha de matemáticas', '11:00:56', '11:00:56', NULL, '', 4, 1, 252, 119, 3, 0, '21/01/2020', '16/01/2020', NULL),
(641, '2020-01-16 13:14:08', 'Encontrarse fuera del aula sin permiso. No contesta a la pregunta de porqué llegan tarde.', 'Portada + Nº 7.', '13:14:08', '13:14:08', NULL, '', 1, 1, 248, 15, 1, 0, NULL, '16/01/2020', NULL),
(642, '2020-01-16 13:58:13', 'Encontrarse fuera del aula si permiso. Al preguntar por la causa me dice \"que se ha perdido\".', 'Portada + Nº 7.', '13:18:36', '13:18:36', NULL, '', 1, 1, 237, 15, 3, 0, '23/01/2020', '16/01/2020', NULL),
(643, '2020-01-16 13:21:21', 'Siempre llega tarde. Hoy 10 minutos', 'Copiar 50 veces \"No volveré a llegar tarde\".', '13:21:21', '13:21:21', NULL, '', 10, 1, 278, 29, 1, 0, NULL, '16/01/2020', NULL),
(644, '2020-01-16 13:23:09', 'Llega siempre tarde. Hoy 10 minutos.', 'Copiar 50 veces \"No volveré a llegar tarde\".', '13:23:09', '13:23:09', NULL, '', 10, 1, 263, 29, 1, 0, NULL, '16/01/2020', NULL);
