(645, '2020-01-16 13:26:20', 'Siempre llega tarde. Hoy 10 minutos.', 'Copiar 50 veces \" No volveré a llegar tarde\".', '13:26:20', '13:26:20', NULL, '', 10, 1, 267, 29, 1, 0, NULL, '16/01/2020', NULL),
(646, '2020-01-16 14:04:11', 'No deja de gritar y jugar. Lanza una bola', 'Síntesis del Tema 4 del libro de texto', '14:04:10', '14:04:10', NULL, '', 2, 1, 208, 36, 1, 0, NULL, '16/01/2020', NULL),
(647, '2020-01-17 12:22:11', 'La alumna se niega a hacer la tarea encomendada a pesar de advertirle en reiteradas ocasiones. Incluso llega a decirme \"pues ponme un parte\"', NULL, '12:22:11', '12:22:11', NULL, '', 2, 1, 286, 121, 1, 1, NULL, '17/01/2020', NULL),
(648, '2020-01-17 12:26:20', 'La alumna hace caso omiso a varias llamadas de atención del profesor, incluso se levanta sin permiso e ignora mis indicaciones', NULL, '12:26:20', '12:26:20', NULL, '', 2, 1, 205, 121, 1, 0, NULL, '17/01/2020', NULL),
(649, '2020-01-17 12:56:42', 'Se avisa hasta en 3 ocasiones al alumno de que debe estar callado en clase y sentado. Se pasea por la clase y habla en voz alta.', 'Actividades del workbook (p. 25-26)', '12:56:42', '12:56:42', NULL, '', 2, 1, 18, 79, 1, 0, NULL, '17/01/2020', NULL),
(650, '2020-01-17 13:01:30', 'Le llamo multitud de veces la atención, pero hace caso omiso. Le pido que se ponga derecha y me dice \"ya voy, cojones\". Le pido que no se dirija a mi en esos términos y continúa, con contestaciones desconsideradas.', 'Actividades 1-3, p. 137 del libro de Historia.', '13:01:30', '13:01:30', NULL, '', 3, 1, 278, 121, 1, 0, NULL, '17/01/2020', NULL),
(651, '2020-01-17 13:03:08', 'La alumna se niega a bajar al aula de convivencia como consecuencia del parte anterior.', NULL, '13:03:08', '13:03:08', NULL, '', 10, 1, 278, 121, 1, 0, NULL, '17/01/2020', NULL),
(652, '2020-01-17 13:58:46', 'Tira el bocadillo a la calle mientras está en el patio durante el recreo.', NULL, '13:58:46', '13:58:46', NULL, '', 2, 1, 278, 89, 1, 0, NULL, '17/01/2020', NULL),
(653, '2020-01-20 08:27:36', 'Tras haber tocado el timbre a última hora del viernes pasado (14:50 horas), un profesor sorprende al alumno saltando desde la ventana de un aula (128) hasta el patio. La altura desde la ventana hasta el suelo es de más de 2 metros, por lo que la acción podría haber causado al alumno al ser una caída considerable', NULL, '08:27:36', '08:27:36', NULL, '', 10, 1, 61, 5, 1, 0, NULL, '20/01/2020', NULL),
(654, '2020-01-20 08:59:45', 'El alumno llega a clase a las 8.35. No trae materiales, se sienta de espaldas y cuando se le amonesta verbalmente sigue con su habitual actitud chulesca haciendo lo que le da la gana', 'Actividades de la página 76 y 77 del libro', '08:59:45', '08:59:45', NULL, '', 3, 1, 64, 124, 1, 0, NULL, '20/01/2020', NULL),
(655, '2020-01-20 08:35:10', 'Le llama la atención al alumno en repetidas ocasiones y hace caso omiso, incluso me alza el tono de voz', 'Lectura páginas 98-101', '10:10:13', '10:10:13', NULL, '', 3, 1, 247, 121, 1, 0, NULL, '20/01/2020', NULL),
