(793, '2020-02-05 13:01:32', 'Falta de respeto a la profesora. En una actividad oral en la clase de inglés emplea un vocabulario fuera de lugar y lejos de arrepentirse, no pide disculpas y no entiende la gravedad. La frase fue: \"le pintaría un pene a la profesora en la cara\". Pasa a parte grave por reírse cuando le entrego el parte y repetirlo.', NULL, '13:01:32', '13:01:32', NULL, '', 10, 1, 318, 34, 1, 0, NULL, '05/02/2020', NULL),
(794, '2020-02-05 13:03:12', 'Falta de respeto a la profesora permitiendo que sus compañeros de grupo (eran tres) escribieran en una actividad \"le pintaría un pene a la profesora en la cara\". No piden disculpas.', NULL, '13:03:12', '13:03:12', NULL, '', 3, 1, 329, 34, 1, 0, NULL, '05/02/2020', NULL),
