(798, '2020-02-06 09:06:05', 'No trae el parte firmado, después de perderlo. El primer parte, del 13 de enero, perdido. El segundo, del 23 de enero, perdido. El tercero, de 30 de enero,perdido. Viene sin materiales siempre y nunca hace nada.', 'Lámina 36', '09:06:05', '09:06:05', NULL, '', 2, 1, 210, 15, 1, 0, NULL, '06/02/2020', NULL),
(799, '2020-02-04 09:27:10', 'Llega tarde a clase después del recreo unos 10 minutos. Dice que viene del servicio (no tiene permiso ninguno). Durante la clase no saca ni el libro.', NULL, '09:27:10', '09:27:10', NULL, '', 2, 1, 267, 48, 1, 0, NULL, '04/02/2020', NULL),
