(831, '2020-02-12 10:09:43', 'El alumno se echa a dormir en clase. Cuando le llamo la atención se niega a mirarme y continúa echado. Le indico que le voy a poner un parte y me dice. \"a ver qué me pones\".', 'Actividades 1, 2, 3, 4, 5 y 6 página 147', '10:09:43', '10:09:43', NULL, '', 2, 1, 252, 121, 1, 0, NULL, '12/02/2020', NULL),
(832, '2020-02-12 10:55:08', 'Continuamente molesta a sus compañeros, \"corretea\" por la clase. Es buena chica pero \"muy juguetona\". Le he avisado muchas y creo que es la única forma para que reaccione.', NULL, '10:55:08', '10:55:08', NULL, '', 2, 1, 160, 36, 1, 0, NULL, '12/02/2020', NULL),
(833, '2020-02-12 11:22:15', 'El alumno mantiene una actitud de enfrentamiento y enfado conmigo desde una discusión ocurrida entre él y una compañera durante la semana pasada en la que él hizo un comentario ofensivo hacia las mujeres. Yo intenté hacerle razonar y que se diera cuenta de que sus palabras no eran correctas ni apropiadas pero él se cerró completamente a cualquier entendimiento manteniéndose furioso con contestaciones fuera del tono y haciendo comentarios a mis espaldas. En días sucesivos  ha estado interrumpiendo la clase haciéndose el gracioso. Y hoy, después de entregar su examen, empezó a hablar en voz alta cuando otros compañeros aún no habían acabado. Le he vuelto a llamar la atención y a pedirle que cambie de actitud. Su respuesta ha sido negativa una vez más contestándome y diciendo él siempre la última palabra así como volviendo a hacer comentarios.', NULL, '11:22:15', '11:22:15', NULL, '', 10, 1, 495, 27, 1, 0, NULL, '12/02/2020', NULL),
(834, '2020-02-12 12:54:35', 'Se ha levantado y ha llamado \"calvo\" a una persona que pasaba por la calle.', NULL, '12:54:35', '12:54:35', NULL, '', 3, 1, 112, 24, 1, 0, NULL, '12/02/2020', NULL),
(835, '2020-02-11 12:57:00', 'Se le entrega un parte al alumno por ignorar las llamadas de atención de la profesora (no para de hablar y tiene los pies sobre la mesa). No conforme, se dirige a la profesora de mala manera y amenaza con no olvidar dicho parte, contestando una y otra vez.', NULL, '12:56:35', '12:56:35', NULL, '', 10, 1, 248, 128, 1, 0, NULL, '12/02/2020', NULL),
(836, '2020-02-04 13:10:12', 'En mitad de clase le da un fuerte golpe en la espalda a una compañero que se escucha en toda la clase. El compañero no se ha quejado, no hay intención de agredir, pero no es un acto correcto.', NULL, '13:10:12', '13:10:12', NULL, '', 3, 1, 137, 124, 1, 0, NULL, '12/02/2020', NULL),
(837, '2020-02-11 13:12:22', 'Tira el estuche del compañero.', NULL, '13:12:22', '13:12:22', NULL, '', 2, 1, 104, 53, 1, 0, NULL, '12/02/2020', NULL),
