(839, '2020-02-12 13:15:00', 'Al entrar en el aula de guardia, les indico que trabajen, el alumno me ignora, se levanta y me contesta muy alterado, dándome voces.', NULL, '13:15:00', '13:15:00', NULL, '', 2, 1, 430, 123, 1, 0, NULL, '12/02/2020', NULL),
