(912, '2020-02-19 12:18:48', 'Se dedica a darle patadas a los balones de voleibol. Se le advierte varias veces y continúa haciéndolo.', NULL, '12:18:48', '12:18:48', NULL, '', 4, 1, 68, 17, 1, 0, NULL, '19/02/2020', NULL),
(913, '2020-02-19 12:21:37', 'Después de ponerle un parte me protesta en un tono excesivamente elevado y de mala forma diciendo que siempre se le pone el parte a las mismas personas.', NULL, '12:21:37', '12:21:37', NULL, '', 3, 1, 351, 88, 1, 0, NULL, '19/02/2020', NULL),
(914, '2020-02-19 12:23:47', 'No trabaja nada. Habla a voces con un compañero que está en la otra punta.', NULL, '12:23:47', '12:23:47', NULL, '', 2, 1, 352, 88, 1, 0, NULL, '19/02/2020', NULL),
(915, '2020-02-19 12:25:55', 'Habla a voces con un compañero que está en la otra punta de la clase. Es habitual que haga comentarios en voz alta que no vienen a cuento.', NULL, '12:25:55', '12:25:55', NULL, '', 2, 1, 351, 88, 1, 0, NULL, '19/02/2020', NULL),
(916, '2020-02-19 08:27:11', 'Se dedica a pegar patadones a los balones de voleibol. Se le avisa varias veces, continúa haciéndolo hasta que lo echo fuera del recinto. Uno de los pelotazos alcanza a un compañero en el pecho haciéndole bastante daño y provocando que llore de dolor.', NULL, '12:30:39', '12:30:39', NULL, '', 3, 1, 74, 17, 3, 0, '25/02/2020', '19/02/2020', NULL),
(917, '2020-02-19 12:33:00', 'En clase de tutoría, hablando de un asunto de convivencia y material de la clase, se dirige a una niña así: \"Miente como una perra. Cuando la pille en la calle la voy a machacar\".', NULL, '12:33:00', '12:33:00', NULL, '', 10, 1, 120, 89, 1, 0, NULL, '19/02/2020', NULL),
(918, '2020-02-19 12:34:52', 'En clase de tutoría se dirige al profesor en términos despectivos: \"Que te esperes\", \"Que te calles ya, illo\", \"Estoy hasta los cojones\".', NULL, '12:34:52', '12:34:52', NULL, '', 10, 1, 139, 89, 1, 0, NULL, '19/02/2020', NULL),
(920, '2020-02-19 12:37:21', 'Le digo que se vaya a jefatura y que me espere allí cuando toque para el recreo. Cuando voy, no está.', NULL, '12:37:21', '12:37:21', NULL, '', 10, 1, 139, 89, 1, 0, NULL, '19/02/2020', NULL),
(921, '2020-02-19 13:18:38', 'No hace nada y dice que no lo va a hacer pese a advertírselo repetidamente.', NULL, '13:18:38', '13:18:38', NULL, '', 2, 1, 256, 119, 1, 0, NULL, '19/02/2020', NULL),
