(925, '2020-02-20 09:33:58', 'No ha trabajado en toda la hora. Al finalizar la clase, se mete en otro aula, le digo que no haga tonterías y me contesta: \"Me parezco a ti de tonto, aquí los únicos tontos son los maestros\".', NULL, '09:33:58', '09:33:58', NULL, '', 10, 1, 45, 17, 1, 0, NULL, '20/02/2020', NULL),
