(928, '2020-02-19 12:21:32', 'Aparece 5 minutos antes de que termine la clase. Cuando le pregunto de dónde viene me contesta que ha estado por ahí con sus amigos. Además me dice que a mí lo mismo me da donde esté él. Sigue desafiándome cuando le doy el parte. Por esta razón, el parte pasa de 4 puntos a 8.', NULL, '12:14:40', '12:14:40', NULL, '', 3, 1, 223, 21, 1, 0, NULL, '19/02/2020', NULL),
(929, '2020-02-19 12:21:06', 'Mientras le llamo la atención a sus compañeros para que se sienten y guarden silencio, se pone a gritar por encima de mi voz intentando silenciarme. Cuando me dirijo hacia él, se ríe. Como después pide disculpas el parte pasa de 5 puntos a 2.', NULL, '12:21:06', '12:21:06', NULL, '', 2, 1, 222, 21, 1, 0, NULL, '20/02/2020', NULL),
