(992, '2020-02-25 13:15:20', 'Le ha dado un empujón a otro compañero, el cual se ha caído sobre otra compañera. El primero se ha hecho daño en la barbilla y la segunda en el brazo y en la pierna al golpearle contra una mesa.', NULL, '13:15:20', '13:15:20', NULL, '', 3, 1, 61, 2, 1, 0, NULL, '03/03/2020', NULL),
