(994, '2020-03-03 08:40:55', 'Mirándose en un espejo, sin cumplir con la obligación de atender en clase. Se enfada y se va de la clase.', 'Fotocopias nº 64 y 67.', '13:31:15', '13:31:15', NULL, '', 2, 1, 253, 15, 3, 0, '10/03/2020', '03/03/2020', NULL),
(995, '2020-03-03 13:56:16', 'desde el patio y a través de las ventanas molestan a alumnos que están en clase', NULL, '13:56:16', '13:56:16', NULL, '', 2, 1, 68, 17, 1, 0, NULL, '03/03/2020', NULL),
