(997, '2020-03-05 10:36:00', 'No trae la tarea que se le puso como castigo a la conducta que originó el parte,antes de su paso por convivencia. Copiar 50 veces: \" Eructar fuerte en clase es una falta de educación\"', NULL, '10:36:00', '10:36:00', NULL, '', 2, 1, 263, 47, 1, 0, NULL, '05/03/2020', NULL),
(998, '2020-03-05 10:52:05', 'No saca el material de trabajo, Me dice que no va a hacerlo que he mandado enclase', 'Resumir pág.-130-131, y hacer ejercicio 3-6 pág. 131 dellibro', '10:52:05', '10:52:05', NULL, '', 2, 1, 267, 47, 1, 0, NULL, '05/03/2020', NULL),
(999, '2020-03-05 12:30:07', 'Tira apeles l suelo (tienen su nombre) y le echa la culpa a otra', NULL, '12:30:07', '12:30:07', NULL, '', 3, 1, 37, 94, 1, 0, NULL, '05/03/2020', NULL),
(1000, '2020-03-05 13:30:34', 'Se levanta de su sitio y dice en voz alta \"este niño asqueroso de mierda me está molestando\", refiriéndose al compañero que está sentado delante.', NULL, '12:33:53', '12:33:53', NULL, '', 3, 1, 11, 68, 3, 0, '06/03/2020', '05/03/2020', NULL),
(1001, '2020-03-05 13:05:05', 'Se pasa la hora mirando parar atrás, no trabaja y molesta al compañero.', NULL, '12:35:40', '12:35:40', NULL, '', 2, 1, 6, 68, 3, 0, '10/03/2020', '05/03/2020', NULL),
(1002, '2020-03-05 12:40:24', 'Llega a quinta hora tras decirle a sus padres que no había clase en las horas anteriores.', NULL, '12:40:24', '12:40:24', NULL, '', 2, 1, 351, 42, 1, 0, NULL, '05/03/2020', NULL),
