(1004, '2020-03-05 13:05:19', 'Durante la clase de matemáticas ha sacado un desodorante y e ha puesto a echarlo a pesar de que se le había advertido que lo guardara.', NULL, '13:05:19', '13:05:19', NULL, '', 2, 1, 351, 99, 1, 0, NULL, '05/03/2020', NULL),
(1005, '2020-03-05 13:37:27', 'Le digo que se cambie de sitio y se niega y a continuación se cambia pero dice\r\n\"que ya no va a hacer nada\". Después me desafía: \"ponme un parte y llama a mi madre. \r\nNo es la primera vez que lo hace, así que se lo pongo. A continuación dice \"como te inventes algo en el parte te enteras\"', 'Problemas de la fotocopia (edades)', '13:37:27', '13:37:27', NULL, '', 3, 1, 338, 40, 1, 0, NULL, '05/03/2020', NULL),
