(1027, '2020-03-10 12:13:50', 'Llega tarde a clase. Entra sin dar ningún tipo de explicación. Le pregunto por qué llega tarde y me contesta \" estaba fuera, como tú llegas siempre tarde\". Últimamente tiene continuas faltas de respeto', 'Página 97, 6, 7, 26. 27. 29', '12:13:50', '12:13:50', NULL, '', 3, 1, 286, 48, 1, 0, NULL, '10/03/2020', NULL),
