(1029, '2020-03-10 13:07:28', 'Durante el visionado de un documental está jugando con la capucha, vuelto de espaldas, charlando con otros compañeros y distrayendo a otros que tiene cerca. Lo último es golpear una botella de agua.', NULL, '13:07:28', '13:07:28', NULL, '', 3, 1, 74, 124, 1, 0, NULL, '10/03/2020', NULL),
(1030, '2020-03-10 13:11:07', 'Durante el visionado de un documental está mascando chicle toda la hora, hablando con otros compañeros, riéndose y con los pies en la cajonera de la mesa. Le he advertido más de 5 veces y sigue. También gesticula para llamar la atención y causar burlas.', NULL, '13:11:07', '13:11:07', NULL, '', 3, 1, 63, 124, 1, 0, NULL, '10/03/2020', NULL),
(1031, '2020-03-10 13:12:56', 'Lego a clase. Sigue jugando y le da patadas al compañero.', NULL, '13:12:56', '13:12:56', NULL, '', 2, 1, 83, 53, 1, 0, NULL, '10/03/2020', NULL),
